INSERT INTO `perfiles` VALUES (1,'A','Agricultura, ganadera, silvicultura y pesca',1,NULL,1,1),(2,'01','Agricultura, ganadera, caza y actividades de los servicios relacionados con las mismas',2,'01 Agricultura, ganadera, caza y servicios relacionados con las mismas\nEsta divisin incluye dos actividades fundamentales, la produccin agrcola y la produccin animal, incluyendo\nasimismo la agricultura orgnica, el cultivo de productos agrarios modificados genticamente y la cra de animales\nmodificados genticamente. Esta divisin incluye la produccin agrcola tanto en superficies a cielo abierto como en\ninvernaderos.\nEsta divisin incluye tambin los servicios de apoyo a la agricultura, as como la caza, la captura de animales y las\nactividades relacionadas con las mismas.\nEl grupo 01.5 (Produccin agrcola combinada con la produccin ganadera) se aparta de los principios habituales de\ndeterminacin de la actividad principal. En l se acepta que muchas explotaciones agrarias tienen una produccin\nagrcola y ganadera razonablemente equilibrada y que sera arbitrario clasificarlas en una categora u otra.\nLas actividades agrarias excluyen  cualquier elaboracin posterior de los productos agrarios [clasificada en las\ndivisiones 10 y 11 (Industrias de la alimentacin y las bebidas), y 12 (Industria del tabaco)], aparte de la que resulta\nnecesaria para prepararlos para los mercados primarios. Se incluye en este apartado la preparacin de productos\npara los mercados primarios.\nLa divisin excluye los trabajos de construccin para la preparacin de terrenos (por ejemplo, el abancalamiento, el\ndrenaje, la preparacin de arrozales, etc.), clasificada en la seccin F (Construccin), y los compradores y\nasociaciones cooperativas que se dedican a la comercializacin de productos agrarios clasificados en la seccin G.\nExcluye tambin el mantenimiento y cuidado de jardines, clasificado en la clase 81.30 (Actividades de jardinera).\n',1,1),(3,'011','Cultivos no perennes',3,'01.1 Cultivos no perennes\nSe incluye en este grupo el cultivo de plantas no perennes, por ejemplo, plantas que no duran ms de dos\ntemporadas. Se incluye el cultivo de estas plantas para la produccin de semillas.\n',0,0),(4,'0111','Cultivo de cereales (excepto arroz), leguminosas y semillas oleaginosas',4,'01.11 Cultivo de cereales (excepto arroz), leguminosas y semillas oleaginosas\nEsta clase comprende todos los tipos de cultivo de cereales, leguminosas y semillas oleaginosas en superficies a\ncielo abierto. El cultivo de estos productos suele combinarse dentro de cada unidad agraria.\nEsta clase comprende:\n- el cultivo de cereales como:\n trigo\n maz en grano\n sorgo\n cebada\n centeno\n avena\n mijo\n otros cereales n.c.o.p.\n- el cultivo de leguminosas como:\n alubias\n habas\n garbanzos\n juda carilla\n lentejas\n altramuces\n guisantes\n guisante de Angola\n otras leguminosas\n- el cultivo de semillas oleaginosas como:\n Habas de soja\n cacahuetes\n semilla de algodn\n semilla de ricino\n semilla de linaza\n semilla de mostaza\n semilla de nger\n semilla de crtamo\n semilla de ssamo\n semillas de girasol\n otras semillas oleaginosas\n',0,0),(5,'0112','Cultivo de arroz',4,'01.12 Cultivo de arroz\n',0,0),(6,'0113','Cultivo de hortalizas, races y tubrculos',4,'01.13 Cultivo de hortalizas, races y tubrculos\nEsta clase comprende:\n- el cultivo de hortalizas de hoja o tallo, como:\n alcachofas\n esprragos\n coles\n coliflor y brcol\n lechuga y escarola\n espinacas\n otras hortalizas de hoja grande o tallo endeble\n- el cultivo de hortalizas que dan frutos, como:\n pepinos y pepinillos\n berenjenas\n tomates\n sandas\n meln cantalupo\n otros melones y hortalizas que dan frutos\n- el cultivo de hortalizas con races, bulbos o tubrculos, como:\n zanahorias\n nabos\n ajos\n cebollas (incluidos chalotas)\n puerros y otras hortalizas aliceas\n otras hortalizas con races, bulbos o tubrculos\n- el cultivo de setas y trufas\n- el cultivo de semillas de hortalizas, incluidas las semillas de remolacha azucarera y excluidas otras semillas de\nremolacha\n- el cultivo de remolacha azucarera\n- el cultivo de otras hortalizas\n- el cultivo de races y tubrculos como:\n patatas\n boniatos y batatas\n mandioca\n ame\n otras races y tubrculos\n',0,0),(7,'0114','Cultivo de caa de azcar',4,'01.14 Cultivo de caa de azcar\n',0,0),(8,'0115','Cultivo de tabaco',4,'01.15 Cultivo de tabaco\n',0,0),(9,'0116','Cultivo de plantas para fibras textiles',4,'01.16 Cultivo de plantas para fibras textiles\nEsta clase comprende:\n- el cultivo de algodn\n- el cultivo de yute, kenaf y otras fibras textiles blandas\n- el cultivo de lino y camo\n- el cultivo de sisal y otras fibras textiles del gnero agave\n- el cultivo de abac, ramio y otras fibras textiles de origen vegetal\n- el cultivo de otras plantas textiles\n',0,0),(10,'0119','Otros cultivos no perennes',4,'01.19 Otros cultivos no perennes\nEsta clase comprende el cultivo de las dems plantas no perennes:\n- el cultivo de colinabos, remolacha forrajera, races forrajeras, trboles, alfalfa, pipirigallo, maz para pienso y forraje\ny otras gramneas, coles forrajeras y productos similares para forraje\n- el cultivo de trigo sarraceno\n- el cultivo de semillas de remolacha (excluidas las semillas de remolacha azucarera) y las semillas de plantas\nforrajeras\n- el cultivo de flores\n- la produccin de flores cortadas y capullos\n- el cultivo de semillas de flores\n',0,0),(11,'012','Cultivos perennes',3,'01.2 Cultivos perennes\nEste grupo comprende el cultivo de productos perennes, es decir, plantas que duran ms de dos temporadas, bien\nporque se secan despus de cada estacin o porque crecen continuamente. Se incluye el cultivo de estas plantas\npara la produccin de semillas.\n',0,0),(12,'0121','Cultivo de la vid',4,'01.21 Cultivo de la vid\nEsta clase comprende:\n- el cultivo de uva de para produccin de vino y de uva de mesa en viedos\n',0,0),(13,'0122','Cultivo de frutos tropicales y subtropicales',4,'01.22 Cultivo de frutos tropicales y subtropicales\nEsta clase comprende:\n- el cultivo de frutas tropicales y subtropicales:\n aguacates\n pltanos y llantenes\n dtiles\n higos\n mangos\n papayas\n pias\n otras frutas tropicales y subtropicales\n',0,0),(14,'0123','Cultivo de ctricos',4,'01.23 Cultivo de ctricos\nEsta clase comprende:\n- el cultivo de agrios:\n toronjas y pomelos\n limones y limas\n naranjas\n tangerinas, mandarinas y clementinas\n otros agrios\n',0,0),(15,'0124','Cultivo de frutos con hueso y pepitas',4,'01.24 Cultivo de frutos con hueso y pepitas\nEsta clase comprende:\n- el cultivo de frutas de pepita y frutas de hueso:\n manzanas\n albaricoques\n cerezas y guindas\n melocotones y nectarinas\n peras y membrillos\n ciruelas y endrinas\n otras frutas de pepita y de hueso\n',0,0),(16,'0125','Cultivo de otros rboles y arbustos frutales y frutos secos',4,'01.25 Cultivo de otros rboles y arbustos frutales y frutos secos\nEsta clase comprende:\n- el cultivo de bayas:\n arndanos\n grosellas\n grosella espinosa\n kiwis\n frambuesas\n fresas\n otras bayas\n- el cultivo de semillas de frutas\n- el cultivo de frutos secos comestibles\n almendras\n anacardos\n castaas\n avellanas\n pistachos\n nueces\n otros frutos secos\n- el cultivo de otras frutas de rbol y de arbusto\n algarrobas\n',0,0),(17,'0126','Cultivo de frutos oleaginosos',4,'01.26 Cultivo de frutos oleaginosos\nEsta clase comprende:\n- el cultivo de frutos oleaginosos:\n cocos\n aceitunas\n palma de aceite\n otros frutos oleaginosos\n',0,0),(18,'0127','Cultivo de plantas para bebidas',4,'01.27 Cultivo de plantas para bebidas\nEsta clase comprende:\n- el cultivo de plantas para bebidas:\n caf\n t\n mate\n cacao\n otras plantas para bebidas\n',0,0),(19,'0128','Cultivo de especias, plantas aromticas, medicinales y farmacuticas',4,'01.28 Cultivo de especias, plantas aromticas, medicinales y farmacuticas\nEsta clase comprende:\n- el cultivo de plantas aromticas y especias perennes y no perennes:\n pimienta (piper sop.)\n chiles y pimientos (capsicum sop.)\n nuez moscada, macis y cardamomo\n ans, ans estrellado e hinojo\n canela\n clavo\n jengibre\n vainilla\n lpulos\n otras plantas aromticas y especias\n- el cultivo de plantas para la elaboracin de frmacos y narcticos\n',0,0),(20,'0129','Otros cultivos perennes',4,'01.29 Otros cultivos perennes\nEsta clase comprende:\n- el cultivo de rboles caucheros para la recoleccin de ltex\n- el cultivo de rboles de navidad\n- el cultivo de rboles para la extraccin de savia\n- el cultivo de materiales vegetales del tipo usado en cestera y espartera\n',0,0),(21,'013','Propagacin de plantas',3,'01.3 Propagacin de plantas\n',0,0),(22,'0130','Propagacin de plantas',4,'01.30 Propagacin de plantas\nEsta clase comprende la produccin de todos los productos vegetales para plantacin, incluidos esquejes, serpollos\ny semilleros, para la reproduccin directa de plantas o para produccin de injertos mediante la seleccin de\nvstagos.\nEsta clase comprende:\n- el cultivo de plantas para plantacin\n- el cultivo de plantas ornamentales, incluida la turba para trasplantes\n- el cultivo de plantas vivas para bulbos, races y tubrculos; esquejes y mugrones;  esporas de setas\n- la explotacin de viveros, salvo los viveros forestales\n',0,0),(23,'014','Produccin ganadera',3,'01.4 Produccin ganadera\nEste grupo comprende la cra (ganadera) y reproduccin de todos los animales, excepto los acuticos\nEste grupo no comprende:\n- la estabulacin de animales de granja y su cuidado (vase 01.62)\n- la produccin de pieles y cueros procedentes de mataderos (vase 10.11)\n',0,0),(24,'0141','Explotacin de ganado bovino para la produccin de leche',4,'01.41 Explotacin de ganado bovino para la produccin de leche\nEsta clase comprende:\n- la cra y reproduccin de ganado bovino lechero\n- la produccin de leche cruda de vaca o bfalo\n',0,0),(25,'0142','Explotacin de otro ganado bovino y bfalos',4,'01.42 Explotacin de otro ganado bovino y bfalos\nEsta clase comprende:\n- la cra y reproduccin de ganado bovino y bfalos para carne\n- la produccin de esperma de bovino\n',0,0),(26,'0143','Explotacin de caballos y otros equinos',4,'01.43 Explotacin de caballos y otros equinos\nEsta clase comprende:\n- la cra y reproduccin de caballos, burros, mulas o burdganos\n',0,0),(27,'0144','Explotacin de camellos y otros camlidos',4,'01.44 Explotacin de camellos y otros camlidos\nEsta clase comprende:\n- la cra y reproduccin de camellos (dromedarios) y camlidos\n',0,0),(28,'0145','Explotacin de ganado ovino y caprino',4,'01.45 Explotacin de ganado ovino y caprino\nEsta clase comprende:\n- la cra y reproduccin de ganado ovino y caprino\n- la produccin de leche cruda de ganado ovino y caprino\n- la produccin de lana en bruto\n',0,0),(29,'0146','Explotacin de ganado porcino',4,'01.46 Explotacin de ganado porcino\n',0,0),(30,'0147','Avicultura',4,'01.47 Avicultura\nEsta clase comprende:\n- la cra y reproduccin de aves de corral\n pollos, pavos, patos, ocas y pintadas\n- la produccin de huevos de aves de corral\n- la explotacin de incubadoras de aves de corral\n',0,0),(31,'0149','Otras explotaciones de ganado',4,'01.49 Otras explotaciones de ganado\nEsta clase comprende:\n- la cra y reproduccin de animales semidomesticados u otros animales vivos:\n avestruces y ems\n otras aves (excepto aves de corral)\n insectos\n conejos y otros animales de peletera\n- la produccin de pieles para peletera, pieles de reptiles y aves procedentes de granjas\n- la explotacin de criaderos de gusanos, moluscos terrestres, caracoles, etc.\n- la cra de gusanos de seda y la sericultura\n- la apicultura y la produccin de miel y cera de abeja\n- la cra y reproduccin de animales de compaa (excepto peces):\n gatos y perros\n pjaros, como periquitos, etc.\n hmsters, etc.\n- la cra de animales diversos\n',0,0),(32,'015','Produccin agrcola combinada con la produccin ganadera',3,'01.5 Produccin agrcola combinada con la produccin ganadera\n',0,0),(33,'0150','Produccin agrcola combinada con la produccin ganadera',4,'01.50 Produccin agrcola combinada con la produccin ganadera\nEsta clase comprende la produccin mixta agrcola y ganadera sin especializacin en ninguna de ellas. El tamao de\nla explotacin general no es un factor determinante. Si la produccin agrcola o la produccin ganadera en una\nunidad determinada representa el 66 % o ms de los mrgenes brutos normales, la actividad conjunta no debera\nincluirse en este apartado, sino asignarse a produccin agrcola o a produccin ganadera.\n',0,0),(34,'016','Actividades de apoyo a la agricultura, a la ganadera y de preparacin posterior a la cosecha',3,'01.6 Actividades de apoyo a la agricultura, a la ganadera y de preparacin posterior a la cosecha\nEste grupo comprende las actividades relacionadas con la produccin agrcola y otras similares a la agricultura que\nno tienen fines de produccin (en el sentido de cosecha de productos agrarios), y realizadas por cuenta de terceros.\nSe incluyen tambin las actividades posteriores a la cosecha destinadas a preparar los productos agrarios para el\nmercado primario.\n',0,0),(35,'0161','Actividades de apoyo a la agricultura',4,'01.61 Actividades de apoyo a la agricultura\nEsta clase comprende:\n- las actividades agrcolas por cuenta de terceros:\n la preparacin de terrenos de cultivo\n la siembra de cultivos\n el tratamiento de los cultivos\n la fumigacin de los cultivos, incluida la fumigacin area\n la poda de los rboles frutales y las vides\n el trasplante de los tallos de arroz y el raleo de las remolachas\n la cosecha\n el control de las plagas (incluida la de conejos) en relacin con la agricultura\n- el mantenimiento del terreno agrcola en buenas condiciones agrcolas y medioambientales\n- la explotacin de equipos agrcolas de riego\nEsta clase comprende tambin:\n- la provisin de maquinaria agraria con operarios\n',0,0),(36,'0162','Actividades de apoyo a la ganadera',4,'01.62 Actividades de apoyo a la ganadera\nEsta clase comprende:\n- las actividades ganaderas por cuenta de terceros:\n las actividades destinadas al fomento, desarrollo y produccin de ganado\n los servicios de control del ganado, de su conduccin, de pasturaje, de castracin de aves de corral, de limpieza\nde corrales, etc.\n las actividades relacionadas con la inseminacin artificial\n los servicios de oferta de sementales\n el esquileo de ovejas\n la estabulacin de animales de granja y su cuidado\nEsta clase comprende tambin:\n- las actividades de herraje\n',0,0),(37,'0163','Actividades de preparacin posterior a la cosecha',4,'01.63 Actividades de preparacin posterior a la cosecha\nEsta clase comprende:\n- la preparacin de cultivos para los mercados primarios (limpieza, recorte de hojas y pednculos, clasificacin,\ndesinfeccin)\n- el desmotado de algodn\n- la preparacin de hojas de tabaco (por ejemplo, secado)\n- la preparacin de granos de cacao (por ejemplo, pelado)\n- el encerado de la fruta\n',0,0),(38,'0164','Tratamiento de semillas para reproduccin',4,'01.64 Tratamiento de semillas para reproduccin\nEsta clase comprende todas las actividades posteriores a la cosecha destinadas a mejora la calidad de reproduccin\nde la semilla mediante la eliminacin de materiales ajenos a la semilla, los demasiado pequeos, los que tienen\ndaos mecnicos o causados por insectos, las semillas no maduras, as como la eliminacin de la humedad de la\nsemilla hasta un nivel seguro para el almacenamiento de sta. Esta actividad incluye el secado, la limpieza, la\nclasificacin y el tratamiento de las semillas hasta su comercializacin. Se incluye en este apartado el tratamiento de\nsemillas genticamente modificadas.\n',0,0),(39,'017','Caza, captura de animales y servicios relacionados con las mismas',3,'01.7 Caza, captura de animales y servicios relacionados con las mismas\n',0,0),(40,'0170','Caza, captura de animales y servicios relacionados con las mismas',4,'01.70 Caza, captura de animales y servicios relacionados con las mismas\nEsta clase comprende:\n- la caza y captura de animales con fines comerciales\n- el aprovechamiento de los animales (vivos o muertos) para carne, pieles, cueros o para utilizarlos en la\ninvestigacin, en zoolgicos o como animales de compaa\n- la produccin de pieles para peletera, de pieles de reptiles y aves procedentes de la caza\nEsta clase comprende tambin:\n- la captura, en instalaciones en tierra, de mamferos marinos como focas y morsas\n',0,0),(41,'02','Silvicultura y explotacin forestal',2,'02 Silvicultura y explotacin forestal\nEsta divisin comprende la produccin de madera en rollo, as como la extraccin y recoleccin de productos\nforestales silvestres no madereros. Adems de la produccin de madera, la silvicultura da lugar a productos que\nsufren escasa elaboracin, como la lea, el carbn y la madera en rollo utilizada sin tratar (por ejemplo, puntales\npara minas, madera para pasta, etc.). Estas actividades pueden realizarse en bosques naturales o plantados.\nSe excluye la elaboracin posterior de la madera, a partir del aserrado y cepillado de la madera (vase la\ndivisin 16).\n',0,0),(42,'021','Silvicultura y otras actividades forestales',3,'02.1 Silvicultura y otras actividades forestales\n',0,0),(43,'0210','Silvicultura y otras actividades forestales',4,'02.10 Silvicultura y otras actividades forestales\nEsta clase comprende:\n- el cultivo de madera en pie: la plantacin, la repoblacin, el trasplante, el raleo y la conservacin de bosques y\nzonas forestales\n- el cultivo de sotos, madera para pasta y madera para combustible\n- la explotacin de viveros forestales\nEstas actividades pueden realizarse en bosques naturales o plantados.\n',0,0),(44,'022','Explotacin de la madera',3,'02.2 Explotacin de la madera\n',0,0),(45,'0220','Explotacin de la madera',4,'02.20 Explotacin de la madera\nEsta clase comprende:\n- la produccin de madera en rollo para las industrias manufactureras\n- la produccin de madera en rollo utilizada sin tratar para usos como los puntales para minas, estacas para vallas y\npostes para tendidos elctricos y de comunicaciones\n- recoleccin y produccin de madera como recurso energtico\n- recoleccin y produccin de residuos de la explotacin forestal como recurso energtico\n- produccin de carbn en el bosque (utilizando mtodos tradicionales)\nLos productos resultantes de esta actividad pueden ser en forma de troncos o madera para combustible.\n',0,0),(46,'023','Recoleccin de productos silvestres, excepto madera',3,'02.3 Recoleccin de productos silvestres, excepto madera\n',0,0),(47,'0230','Recoleccin de productos silvestres, excepto madera',4,'02.30 Recoleccin de productos silvestres, excepto madera\nEsta clase comprende:\n- la recoleccin de productos forestales silvestres:\n setas, trufas\n bayas silvestres\n frutos secos\n balata y otras gomas similares al caucho\n corcho\n laca y resinas\n blsamos naturales\n crin vegetal\n crin marina\n bellotas y castaas de indias\n musgos y lquenes\n',0,0),(48,'024','Servicios de apoyo a la silvicultura',3,'02.4 Servicios de apoyo a la silvicultura\n',0,0),(49,'0240','Servicios de apoyo a la silvicultura',4,'02.40 Servicios de apoyo a la silvicultura\nEsta clase comprende la ejecucin de parte de la explotacin forestal, realizada por cuenta de terceros.\nEsta clase comprende:\n- las actividades de los servicios forestales:\n la evaluacin de masas en pie\n los servicios de asesoramiento en gestin forestal\n la estimacin del valor de la madera\n la prevencin y extincin de incendios forestales\n la lucha contra las plagas forestales\n- los servicios relacionados con la explotacin forestal:\n el transporte de madera en el interior del bosque\n',0,0),(50,'03','Pesca y acuicultura',2,'03 Pesca y acuicultura\nEsta divisin comprende la pesca y la acuicultura, y cubre la utilizacin de los recursos pesqueros de los medios\nmarinos, de aguas salobres o agua dulce, con el fin de capturar o recolectar peces, crustceos, moluscos y otros\norganismos y productos del mar (por ejemplo, plantas acuticas, perlas, esponjas, etc.).\nIncluye tambin las actividades que estn integradas normalmente en el proceso de produccin por cuenta propia\n(por ejemplo, el injerto de ostras para la produccin de perlas). En las actividades relacionadas con la pesca o la\nacuicultura se incluyen los servicios relacionados con la pesca marina, de agua dulce o la acuicultura.\nEsta divisin no incluye la construccin y reparacin de barcos (30.1, 33.15), ni la pesca deportiva o recreativa\n(93.19). Se excluye la elaboracin de pescados, crustceos y moluscos, tanto en instalaciones en tierra como en\nbuques factora (10.20).\n',0,0),(51,'031','Pesca',3,'03.1 Pesca\nEste grupo comprende la pesca, es decir, las actividades de captura y recoleccin de organismos acuticos vivos\n(en especial, pescado, moluscos y crustceos), incluidas las plantas de las aguas ocenicas, costeras o\ncontinentales para consumo humano y otros fines, a mano o por medio de cualquier arte de pesca como redes,\npalangres o trampas fijas. Tales actividades pueden realizarse en la lnea de costa intermareal (por ejemplo, la\ncaptura de moluscos como los mejillones y las ostras) o instalando redes en la costa, o bien con pequeas\nembarcaciones o utilizando grandes buques pesqueros, tanto en aguas de bajura o costeras como de altura. Tales\nactividades incluyen tambin la pesca en masas de agua repobladas.\n',0,0),(52,'0311','Pesca marina',4,'03.11 Pesca marina\nEsta clase comprende:\n- la pesca martima (incluida la costera) con fines comerciales\n- la captura de moluscos y crustceos marinos\n- la captura de ballenas\n- la captura de animales acuticos marinos: tortugas, ascidias y otros tunicados, erizos de mar, etc.\nEsta clase comprende tambin:\n- las actividades de las embarcaciones dedicadas tanto a la pesca marina como a la preparacin y conservacin del\npescado\n- la captura de otros organismos y materiales marinos: perlas naturales, esponjas, coral y algas\n',0,0),(53,'0312','Pesca en agua dulce',4,'03.12 Pesca en agua dulce\nEsta clase comprende:\n- la pesca comercial en aguas continentales\n- la captura de moluscos y crustceos de agua dulce\n- la captura de animales acuticos de agua dulce\nEsta clase comprende tambin:\n- la recoleccin de materiales de agua dulce\n',0,0),(54,'032','Acuicultura',3,'03.2 Acuicultura\nEste grupo comprende la acuicultura (o piscicultura), es decir, el proceso de produccin que incluye el cultivo o la\ncra (incluida la recogida) de organismos acuticos (peces, moluscos, crustceos, plantas, cocodrilos, caimanes y\nanfibios) con tcnicas encaminadas a aumentar, por encima de las capacidades naturales del medio, la\nproduccin de los organismos en cuestin; (por ejemplo, manteniendo unas condiciones idneas estables,\nsuministrando una alimentacin adecuada o proporcionando proteccin contra los predadores).\nEl cultivo/la cra se refieren al cultivo hasta la fase juvenil y/o adulta en cautividad de los organismos citados.\nAdems, acuicultura comprende tambin la propiedad privada o pblica de los organismos individuales a lo largo\nde toda la fase de cultivo o cra y el momento de su recogida.\n',0,0),(55,'0321','Acuicultura marina',4,'03.21 Acuicultura marina\nEsta clase comprende:\n- la cra de peces en agua marina, incluida la cra de peces marinos ornamentales\n- la produccin de larvas de bivalvos (ostras, mejillones, etc.), y larvas de otros moluscos, bogavantes jvenes,\ncamarones poslarvarios, alevines y jaramugos\n- el cultivo de algas comestibles\n- el cultivo de crustceos, bivalvos, otros moluscos y otros animales de agua marina.\nEsta clase comprende tambin:\n- las actividades de acuicultura en aguas salobres\n- las actividades de acuicultura en depsitos o embalses con agua salada\n- la explotacin de piscifactoras (marinas)\n- la explotacin de criaderos de gusanos marinos\n',0,0),(56,'0322','Acuicultura en agua dulce',4,'03.22 Acuicultura en agua dulce\nEsta clase comprende:\n- la cra de peces en agua dulce, incluida la cra de peces ornamentales de agua dulce\n- el cultivo de crustceos, bivalvos, otros moluscos y otros animales de agua dulce\n- la explotacin de piscifactoras (de agua dulce)\n- la cra de ranas\n',0,0),(57,'B','Industrias extractivas',1,NULL,1,1),(58,'05','Extraccin de antracita, hulla y lignito',2,'05 Extraccin de antracita, hulla y lignito\nEsta divisin comprende la extraccin de combustibles minerales slidos procedentes tanto de explotaciones\nmineras subterrneas como a cielo abierto, y comprende operaciones (como la clasificacin, la limpieza, la\ncompresin y otros pasos necesarios para el transporte, etc.) que dan como resultado un producto comercializable.\nEsta divisin no comprende la coquizacin (vase 19.10), ni los servicios relacionados con la extraccin de antracita,\nhulla y lignito (vase 09.90), ni la fabricacin de briquetas (vase 19.20).\n',0,0),(59,'051','Extraccin de antracita y hulla',3,'05.1 Extraccin de antracita y hulla\n',0,0),(60,'0510','Extraccin de antracita y hulla',4,'05.10 Extraccin de antracita y hulla\nEsta clase comprende:\n- la extraccin de hulla: la explotacin de minas subterrneas o a cielo abierto, incluida la que se realiza mediante\nmtodos de licuefaccin;\n- el lavado, el cribado, la clasificacin, la pulverizacin, la compresin, etc. de hulla con el fin de clasificar, mejorar la\ncalidad o facilitar el transporte o el almacenamiento.\nEsta clase comprende tambin:\n- la recuperacin de hulla a partir de polvo de antracita.\n',0,0),(61,'052','Extraccin de lignito',3,'05.2 Extraccin de lignito\n',0,0),(62,'0520','Extraccin de lignito',4,'05.20 Extraccin de lignito\nEsta clase comprende:\n- la extraccin de lignito (carbn fsil): la explotacin de minas subterrneas o a cielo abierto, incluida la que se\nrealiza mediante mtodos de licuefaccin;\n- el lavado, la deshidratacin, la pulverizacin y la compresin del lignito para mejorar la calidad o facilitar el\ntransporte o el almacenamiento.\n',0,0),(63,'06','Extraccin de crudo de petrleo y gas natural',2,'06 Extraccin de crudo de petrleo y gas natural\nEsta divisin comprende la produccin de crudo de petrleo, la extraccin de petrleo a partir de esquisto bituminoso\ny arenas bituminosas y la produccin de gas natural y recuperacin de hidrocarburos lquidos. Esta divisin\ncomprende las actividades de funcionamiento o desarrollo de explotaciones de yacimientos de petrleo y gas. Entre\ndichas actividades pueden incluirse la perforacin, la terminacin y el equipamiento de pozos; el funcionamiento de\nlos separadores, equipos de desenlodamiento y tuberas colectoras de yacimiento para crudo de petrleo, as como\ntodas las dems actividades de preparacin del petrleo y gas hasta el punto de transporte desde el lugar de\nproduccin.\nEsta divisin no comprende:\n- los servicios en yacimientos de petrleo y gas, prestados por cuenta de terceros (vase 09.10);\n- la prospeccin de pozos de petrleo y gas (vase 09.10);\n- las perforaciones y sondeos prospectivos (vase 09.10);\n- el refino de petrleo (vase 19.20);\n- los estudios geofsicos, geolgicos y ssmicos (vase 71.12).\n',0,0),(64,'061','Extraccin de crudo de petrleo',3,'06.1 Extraccin de crudo de petrleo\n',0,0),(65,'0610','Extraccin de crudo de petrleo',4,'06.10 Extraccin de crudo de petrleo\nEsta clase comprende:\n- la extraccin de crudos de petrleo.\nEsta clase comprende tambin:\n- la extraccin de esquisto bituminoso y arenas bituminosas;\n- la produccin de crudos de petrleo a partir de arenas y esquistos bituminosos;\n- los procesos para obtener crudos de petrleo; - la decantacin, la desalinizacin, la deshidratacin, la\nestabilizacin, etc.\n',0,0),(66,'062','Extraccin de gas natural',3,'06.2 Extraccin de gas natural\n',0,0),(67,'0620','Extraccin de gas natural',4,'06.20 Extraccin de gas natural\nEsta clase comprende:\n- la produccin de hidrocarburos gaseosos crudos (gas natural);\n- la extraccin de condensados;\n- el drenaje y la separacin de fracciones de hidrocarburos lquidos;\n- la desulfurizacin de gas.\nEsta clase comprende tambin:\n- la obtencin de hidrocarburos lquidos mediante licuefaccin o pirlisis.\n',0,0),(68,'07','Extraccin de minerales metlicos',2,'07 Extraccin de minerales metlicos\nEsta divisin comprende la extraccin de minerales metlicos realizada en explotaciones mineras subterrneas, a\ncielo abierto, o de fondos marinos, etc. Se incluyen asimismo las operaciones de preparacin de minerales, como el\ntriturado, la pulverizacin, el lavado, el secado, la sinterizacin, la calcinacin y la lixiviacin y la separacin por\ngravedad o flotacin.\nEsta divisin no comprende:\n- el tostado de las piritas de hierro (vase 20.13);\n- la produccin de xido de aluminio (vase 24.42);\n- la explotacin de altos hornos (vase la divisin 24).\n',1,1),(69,'071','Extraccin de minerales de hierro',3,'07.1 Extraccin de minerales de hierro\n',0,0),(70,'0710','Extraccin de minerales de hierro',4,'07.10 Extraccin de minerales de hierro\nEsta clase comprende:\n- la extraccin de minerales cuya explotacin se debe fundamentalmente a su contenido en hierro;\n- el aprovechamiento y la aglomeracin de minerales de hierro.\n',0,0),(71,'072','Extraccin de minerales metlicos no frreos',3,'07.2 Extraccin de minerales metlicos no frreos\nSe incluye en este grupo la extraccin de minerales metlicos no frreos.\n',1,1),(72,'0721','Extraccin de minerales de uranio y torio',4,'07.21 Extraccin de minerales de uranio y torio\nEsta clase comprende:\n- la extracccin de minerales cuya explotacin se debe fundamentalmente a su contenido en uranio y torio:\npechblenda, etc.;\n- la concentracin de estos minerales;\n- la fabricacin de concentrado de uranio (yellowcake).\n',1,1),(73,'0729','Extraccin de otros minerales metlicos no frreos',4,'07.29 Extraccin de otros minerales metlicos no frreos\nEsta clase comprende:\n- la extraccin y preparacin de minerales cuya explotacin se debe fundamentalmente a su contenido en metales\nno frreos:\n minerales de aluminio (bauxita), cobre, plomo, cinc, estao, manganeso, cromo, nquel, cobalto, molibdeno,\ntantalio, vanadio, etc.;\n minerales de metales preciosos: oro, plata y platino.\n',0,0),(74,'08','Otras industrias extractivas',2,'08 Otras industrias extractivas\nEsta divisin abarca la extraccin en minas o canteras, as como el dragado de depsitos aluviales, la trituracin de\nrocas y la utilizacin de salinas. Los productos se utilizan principalmente en la construccin (por ejemplo, arenas,\npiedras, etc.), la fabricacin de materiales (por ejemplo, arcilla, yeso, calcio, etc.) y de productos qumicos, etc.\nEsta divisin no comprende la elaboracin (excepto la trituracin, pulverizacin, corte, limpieza, secado, clasificacin\ny mezcla) de los minerales extrados.\n',0,0),(75,'081','Extraccin de piedra, arena y arcilla',3,'08.1 Extraccin de piedra, arena y arcilla\n',0,0),(76,'0811','Extraccin de piedra ornamental y para la construccin, piedra caliza, yeso, creta y pizarra',4,'08.11 Extraccin de piedra ornamental y para la construccin, piedra caliza, yeso, creta y pizarra\nEsta clase comprende:\n- la extraccin, desbastado y troceado por aserrado de las piedras de talla y de construccin como mrmol, granito,\nareniscas, etc.;\n- la trituracin y molido de piedra ornamental y de construccin;\n- la extraccin, pulverizacin y trituracin de piedra caliza;\n- la extraccin de yeso y anhidrita;\n- la extraccin de creta y dolomita no calcinada.\n',0,0),(77,'0812','Extraccin de gravas y arenas; extraccin de arcilla y caoln',4,'08.12 Extraccin de gravas y arenas; extraccin de arcilla y caoln\nEsta clase comprende:\n- la extraccin y el dragado de arena industrial, arena para la construccin y grava;\n- la trituracin y molido de grava;\n- la extraccin de arena;\n- la extraccin de arcilla, tierras refractarias y caoln.\n',0,0),(78,'089','Industrias extractivas n.c.o.p.',3,'08.9 Industrias extractivas n.c.o.p.\n',0,0),(79,'0891','Extraccin de minerales para productos qumicos y fertilizantes',4,'08.91 Extraccin de minerales para productos qumicos y fertilizantes\nEsta clase comprende:\n- la extraccin de fosfatos naturales y sales de potasio naturales;\n- la extraccin de azufre;\n- la extraccin y preparacin de piritas y pirrotita, excepto el tostado;\n- la extraccin de sulfatos y de carbonatos de bario naturales (baritina y witherita), de boratos naturales, de sulfatos\nde magnesio naturales (kieserita);\n- la extraccin de tierras colorantes, espato fluor y otros minerales valorados fundamentalmente como fuente de\nproductos qumicos.\nEsta clase comprende tambin:\n- la extraccin de guano.\n',0,0),(80,'0892','Extraccin de turba',4,'08.92 Extraccin de turba\nEsta clase comprende:\n- la extraccin de turba;\n- la preparacin de la turba para mejorar su calidad o facilitar su transporte o almacenamiento\n',0,0),(81,'0893','Extraccin de sal',4,'08.93 Extraccin de sal\nEsta clase comprende:\n- la extraccin de sal de yacimientos subterrneos, incluidos la disolucin y el bombeo;\n- la produccin de sal por evaporacin del agua de mar y de otras aguas salinas;\n- el molido, la purificacin y el refinado de sal por el productor.\n',0,0),(82,'0899','Otras industrias extractivas n.c.o.p.',4,'08.99 Otras industrias extractivas n.c.o.p.\nEsta clase comprende:\n- la extraccin de minerales y materiales diversos:\n materias abrasivas, amianto, harinas fsiles de silicio, grafito natural, esteatita (talco), feldespato, etc.\n asfalto natural, asfaltita y rocas asflticas; betn slido natural\n piedras preciosas, cuarzo, mica, etc.\n',0,0),(83,'09','Actividades de apoyo a las industrias extractivas',2,'09 Actividades de apoyo a las industrias extractivas\nEsta divisin comprende servicios complementarios especializados relacionados con las actividades de extraccin y\nprestados por cuenta de terceros. Comprende los servicios de prospeccin basados en mtodos tradicionales como\nel sondeo de muestras y las observaciones geolgicas, as como la perforacin, el sondeo y la perforacin repetida\nde pozos de petrleo y en yacimientos de minerales metlicos y no metlicos. Otros servicios habituales son las\nobras de cimentacin de pozos de petrleo y gas, la cementacin de tuberas de revestimiento de pozos de petrleo\ny gas, la limpieza, achique y pistoneo de pozos de petrleo y gas, el drenaje y bombeo de minas, la retirada de\nsobrecargas en minas, etc.\n',0,0),(84,'091','Actividades de apoyo a la extraccin de petrleo y gas natural',3,'09.1 Actividades de apoyo a la extraccin de petrleo y gas natural\n',0,0),(85,'0910','Actividades de apoyo a la extraccin de petrleo y gas natural',4,'09.10 Actividades de apoyo a la extraccin de petrleo y gas natural\nEsta clase comprende:\n- las actividades de los servicios de los yacimientos de petrleo y gas natural prestados por cuenta de terceros:\n servicios de prospeccin relacionados con la extraccin de petrleo o gas, por ejemplo, mtodos de prospeccin\ntradicionales como las observaciones geolgicas en posibles emplazamientos;\n la perforacin dirigida, la perforacin repetida; el inicio de la perforacin (por vibracin del cable); la construccin in\nsitu, la reparacin y el desmantelamiento de torres de perforacin; el bombeo de los pozos; el taponamiento y\nabandono de los pozos, etc.\n la licuefaccin y regasificacin de gas natural para su transporte, realizadas en la explotacin minera;\n servicios de drenaje y bombeo, por cuenta de terceros;\n perforaciones y sondeos en relacin con la extraccin de petrleo o gas.\nEsta clase comprende tambin:\n- los servicios de extincin de incendios en yacimientos de petrleo y gas.\n',0,0),(86,'099','Actividades de apoyo a otras industrias extractivas',3,'09.9 Actividades de apoyo a otras industrias extractivas\n',0,0),(87,'0990','Actividades de apoyo a otras industrias extractivas',4,'09.90 Actividades de apoyo a otras industrias extractivas\nEsta clase comprende:\n- los servicios complementarios prestados por cuenta de terceros y requeridos para las actividades de extraccin\ncomprendidas en las divisiones 05, 07 y 08;\n los servicios de prospeccin, por ejemplo, los mtodos de prospeccin tradicionales como el sondeo de muestras\ny las observaciones geolgicas en posibles emplazamientos;\n servicios de drenaje y bombeo, por cuenta de terceros;\n las perforaciones y sondeos.\n',0,0),(88,'C','Industria manufacturera',1,NULL,1,1),(89,'10','Industria de la alimentacin',2,'10 Industria de la alimentacin\nEsta divisin comprende la transformacin de los productos de la agricultura, la silvicultura y la pesca en alimentos\npara las personas y animales, as como la produccin de diversos productos intermedios que no constituyen\nexactamente productos alimenticios. La actividad con frecuencia genera productos asociados de mayor o menor\nvalor (como pieles procedentes de mataderos, o tortas de aceite, de la produccin de aceite).\nLa presente divisin se organiza por actividades relacionadas con distintos tipos de productos: carne, pescado,\nfrutas y hortalizas, grasas y aceites, productos lcteos, productos de molinera, , otros productos alimenticios y\nproductos para la alimentacin animal. La produccin puede realizarse por cuenta propia o por cuenta de terceros,\ncomo la matanza por encargo.\nEsta divisin no comprende la preparacin de comidas aptas para su consumo inmediato, como la que se realiza en\nrestaurantes.\nDeterminadas actividades se consideran pertenecientes a la industria manufacturera (por ejemplo, las efectuadas en\npanaderas, pasteleras y establecimientos de productos crnicos etc., que venden su propia produccin), aunque se\nrealice venta al por menor de los productos en el establecimiento de los productores. Sin embargo, cuando la\nelaboracin es mnima y no da como resultado una verdadera transformacin, la unidad se clasifica como comercio\nal por mayor o comercio al por menor en la seccin G.\nLa preparacin de alimentos para el consumo inmediato en el establecimiento, se clasifica en la divisin 56\n(Servicios de comidas y bebidas).\nLa produccin de productos para la alimentacin de animales a partir de residuos o subproductos de los mataderos\nse clasifica en 10.9, mientras que la transformacin de residuos de productos alimenticios y bebidas en materia\nprima secundaria se clasifica en 38.3, y la eliminacin de residuos de productos alimenticios y bebidas, en 38.21.\n',1,1),(90,'101','Procesado y conservacin de carne y elaboracin de productos crnicos',3,'10.1 Procesado y conservacin de carne y elaboracin de productos crnicos\n',0,0),(91,'1011','Procesado y conservacin de carne',4,'10.11 Procesado y conservacin de carne\nEsta clase comprende:\n- la explotacin de mataderos dedicados al sacrificio, la preparacin o el empaquetado de carne: de vaca, cerdo,\ncordero, conejo, camello, etc.;\n- la produccin de carne fresca, refrigerada o congelada, en canal;\n- la produccin de carne fresca, refrigerada o congelada, en piezas.\nEsta clase comprende tambin:\n- el sacrificio y el tratamiento de ballenas en tierra o en embarcaciones especializadas;\n- la produccin de pieles procedentes de mataderos;\n- la obtencin de manteca de cerdo y otras grasas comestibles de origen animal;\n- el tratamiento de despojos de animales;\n- la produccin de lana apelambrada.\n',0,0),(92,'1012','Procesado y conservacin de volateria',4,'10.12 Procesado y conservacin de volatera\nEsta clase comprende:\n- la explotacin de mataderos dedicados al sacrificio, la preparacin o el empaquetado de aves;\n- la produccin de carne fresca, refrigerada o congelada, en porciones individuales;\n- la extraccin de grasas comestibles de aves.\nEsta clase comprende tambin:\n- la produccin de plumas y plumn.\n',0,0),(93,'1013','Elaboracin de productos crnicos y de volateria',4,'10.13 Elaboracin de productos crnicos y de volatera\nEsta clase comprende:\n- la produccin de carne seca, salada o ahumada;\n- la fabricacin de productos crnicos:\n embutidos, salami, morcillas, salchichas, pats, chicharrones y jamones cocidos.\n',0,0),(94,'102','Procesado y conservacin de pescados, crustceos y moluscos',3,'10.2 Procesado y conservacin de pescados, crustceos y moluscos\n',0,0),(95,'1020','Procesado y conservacin de pescados, crustceos y moluscos',4,'10.20 Procesado y conservacin de pescados, crustceos y moluscos\nEsta clase comprende:\n- la preparacin y conservacin de pescados, crustceos y moluscos: congelacin, ultracongelacin, secado,\ncoccin, ahumado, salazn, conservacin en salmuera, enlatado, etc.;\n- la produccin de productos de pescado, crustceos y moluscos; filetes de pescado, huevas, caviar, sucedneos de\ncaviar, etc.;\n- la fabricacin de productos a base de pescado para el consumo humano o la alimentacin animal;\n- la produccin de comidas y productos solubles a partir de pescado y otros animales acuticos no aptos para el\nconsumo humano.\nEsta clase comprende tambin:\n- las actividades de barcos factora dedicados exclusivamente a la elaboracin y conservacin de pescado;\n- el procesado de algas marinas.\n',0,0),(96,'103','Procesado y conservacin de frutas y hortalizas',3,'10.3 Procesado y conservacin de frutas y hortalizas\n',1,1),(97,'1031','Procesado y conservacin de patatas',4,'10.31 Procesado y conservacin de patatas\nEsta clase comprende:\n- la preparacin y conservacin de patatas:\n la fabricacin de patatas congeladas precocinadas;\n la fabricacin de pur de patatas deshidratadas;\n la fabricacin de aperitivos a base de patata;\n la elaboracin de harinas y smola de patatas.\nEsta clase comprende tambin:\n- el pelado industrial de patatas.\n',0,0),(98,'1032','Elaboracin de zumos de frutas y hortalizas',4,'10.32 Elaboracin de zumos de frutas y hortalizas\nEsta clase comprende:\n- la fabricacin de jugos de frutas y hortalizas.\nEsta clase comprende tambin:\n- la produccin de concentrados de frutas y hortalizas frescas.\n',0,0),(99,'1039','Otro procesado y conservacin de frutas y hortalizas',4,'10.39 Otro procesado y conservacin de frutas y hortalizas\nEsta clase comprende:\n- la fabricacin de productos alimenticios a base fundamentalmente de frutas o verduras, excepto platos preparados\ncongelados o enlatados;\n- la conservacin de frutas, frutos secos, legumbres y hortalizas: congelacin, secado, conservacin en aceite o en\nvinagre, enlatado, etc.;\n- la fabricacin de productos alimenticios a base de frutas, legumbres y hortalizas;\n- la fabricacin de confituras, mermeladas y jaleas;\n- el tostado de frutos secos;\n- la fabricacin de productos alimenticios y pastas a base de frutos secos.\nEsta clase comprende tambin:\n- la fabricacin de productos alimenticios preparados perecederos a base de frutas, legumbres y hortalizas, como:\n ensaladas empaquetadas;\n hortalizas peladas o troceadas;\n tofu (requesn de soja).\n',1,1),(100,'104','Fabricacin de aceites y grasas vegetales y animales',3,'10.4 Fabricacin de aceites y grasas vegetales y animales\nEste grupo comprende la produccin de aceites y grasas refinados y sin refinar de origen vegetal o animal, excepto\nla obtencin o el refinado de manteca de cerdo y otras grasas animales comestibles.\n',0,0),(101,'1041','Fabricacin de aceites y grasas',4,'10.41 Fabricacin de aceites y grasas\nEsta clase comprende:\n- la fabricacin de aceites vegetales sin refinar: aceite de oliva, soja, palma, girasol, semillas de algodn, colza,\nnabina, mostaza, linaza, etc.;\n- la fabricacin de harinas o smolas no desgrasadas a partir de semillas, frutos secos o pepitas oleaginosas;\n- la fabricacin de aceites vegetales refinados: aceite de oliva, soja, etc.;\n- el procesado de aceites vegetales: soplado, cocido, deshidratacin, hidrogenacin, etc.\nEsta clase comprende tambin:\n- la fabricacin de aceites y grasas animales no comestibles;\n- la obtencin de aceites de pescado y de mamferos marinos;\n- la produccin de borras de algodn, tortas de aceite y dems residuos de la obtencin de aceite.\n',0,0),(102,'1042','Fabricacin de margarina y grasas comestibles similares',4,'10.42 Fabricacin de margarina y grasas comestibles similares\nEsta clase comprende:\n- la fabricacin de margarina;\n- la elaboracin de otros sucedneos de la mantequilla;\n- la obtencin de grasas compuestas para cocinar.\n',0,0),(103,'105','Fabricacin de productos lcteos',3,'10.5 Fabricacin de productos lcteos\n',0,0),(104,'1051','Preparacin de leche y fabricacin de  sus derivados',4,'10.51 Preparacin de leche y fabricacin de sus derivados\nEsta clase comprende:\n- la produccin de leche lquida fresca, pasteurizada, esterilizada, homogeneizada o tratada a altas temperaturas;\n- la produccin de bebidas a base de leche;\n- la produccin de nata a partir de leche lquida fresca, pasteurizada, esterilizada, homogeneizada;\n- la elaboracin de leche en polvo o concentrada, azucarada o sin azucarar;\n- la produccin de leche o nata en forma slida;\n- la produccin de mantequilla;\n- la produccin de yogur;\n- la produccin de queso y cuajada;\n- la produccin de suero de leche;\n- la produccin de casena y lactosa.\n',0,0),(105,'1052','Elaboracin de helados',4,'10.52 Elaboracin de helados\nEsta clase comprende:\n- la fabricacin de helados y productos similares como sorbetes.\n',0,0),(106,'106','Fabricacin de productos de molinera, almidones y productos amilceos',3,'10.6 Fabricacin de productos de molinera, almidones y productos amilceos\nEste grupo comprende la molienda de harina o smola a partir de cereales o productos de origen vegetal; la\nmolienda, limpieza y pulido del arroz; y la fabricacin de mezclas de harinas o masas de estos productos. Se incluye\nasimismo el triturado hmedo de maz y hortalizas, y la fabricacin de almidones y productos amilceos.\n',0,0),(107,'1061','Fabricacin de productos de molinera',4,'10.61 Fabricacin de productos de molinera\nEsta clase comprende:\n- la molienda de cereales: produccin de harinas, graones, smolas o aglomerados (pellets) de trigo, centeno,\navena, maz y otros granos de cereales;\n- la molienda de arroz: produccin de arroz descascarillado, blanqueado, pulido, glaseado, escaldado o convertido.\nLa elaboracin de harina de arroz;\n- la molienda de productos de origen vegetal: produccin de harinas o smolas de leguminosa de grano seco, de\nraces o tubrculos, o de frutos secos comestibles;\n- la fabricacin de productos para el desayuno a base de cereales;\n- la fabricacin de mezclas de harinas y masas preparadas para pan, pasteles, galletas o tortitas.\n',0,0),(108,'1062','Fabricacin de almidones y productos amilceos',4,'10.62 Fabricacin de almidones y productos amilceos\nEsta clase comprende:\n- la elaboracin de almidones y fculas de arroz, patata, maz, etc.;\n- el triturado de maz hmedo;\n- la elaboracin de glucosa, jarabe de glucosa, maltosa, inulina, etc.;\n- la elaboracin de gluten;\n- la elaboracin de tapioca y sucedneos de tapioca preparados a base de almidones;\n- la elaboracin de aceite de maz.\n',0,0),(109,'107','Fabricacin de productos de panadera y pastas alimenticias',3,'10.7 Fabricacin de productos de panadera y pastas alimenticias\nEste grupo comprende la produccin de productos de panadera, pastas alimenticias y productos similares.\n',1,1),(110,'1071','Fabricacin de pan y de productos frescos de panadera y pastelera',4,'10.71 Fabricacin de pan y de productos frescos de panadera y pastelera\nEsta clase comprende:\n- la fabricacin de productos de panadera:\n panes y panecillos;\n pastas, tortas, tartas, pasteles, tortitas, gofres, bollos, etc.;\n',1,1),(111,'1072','Fabricacin de galletas y productos de panadera y pastelera de larga duracin',4,'10.72 Fabricacin de galletas y productos de panadera y pastelera de larga duracin\nEsta clase comprende:\n- la fabricacin de galletas y biscotes y de otros productos secos de panadera;\n- la fabricacin de productos de repostera con conservante;\n- la produccin de aperitivos (galletas dulces o saladas, pretzels, etc.) dulces o salados.\n',0,0),(112,'1073','Fabricacin de pastas alimenticias, cuscs y productos similares',4,'10.73 Fabricacin de pastas alimenticias, cuscs y productos similares\nEsta clase comprende:\n- la fabricacin de pastas alimenticias: cocidas y sin cocer, rellenas o sin rellenar;\n- la fabricacin de cuscs;\n- la fabricacin de pastas alimenticias enlatadas o congeladas.\n',0,0),(113,'108','Fabricacin de otros productoa alimenticios',3,'10.8 Fabricacin de otros productos alimenticios\nEste grupo comprende la produccin de azcar y productos de confitera, comidas y platos preparados, caf, t y\nespecias, as como de productos alimenticios perecederos y especiales.\n',0,0),(114,'1081','Fabricacin de azcar',4,'10.81 Fabricacin de azcar\nEsta clase comprende:\n- la produccin y refinado de azcar (sacarosa) y sucedneos del azcar obtenidos a partir del jarabe de caa,\nremolacha, arce, palma;\n- la elaboracin de jarabes de azcar;\n- la fabricacin de melaza;\n- la produccin de azcar y jarabe de arce.\n',0,0),(115,'1082','Fabricacin de cacao, chocolate y productos de confitera',4,'10.82 Fabricacin de cacao, chocolate y productos de confitera\nEsta clase comprende:\n- la elaboracin de cacao, manteca de cacao, grasa de cacao, aceite de cacao;\n- la elaboracin de chocolate y productos de chocolate;\n- la elaboracin de productos de confitera: caramelos, pastillas de regaliz, turrones, glaseados, chocolate blanco;\n- la fabricacin de chicle;\n- la conservacin en azcar de frutas, frutos secos, cortezas de frutas y otras partes de plantas;\n- la elaboracin de pastillas de confitera.\n',0,0),(116,'1083','Elaboracin de caf, t e infusiones',4,'10.83 Elaboracin de caf, t e infusiones\nEsta clase comprende:\n- el descafeinado y el tostado de caf;\n- la produccin de productos de caf:\n caf molido;\n caf soluble;\n extractos y concentrados de caf;\n- la elaboracin de sucedneos de caf;\n- la mezcla de t y de hierba mate;\n- la fabricacin de extractos y preparados a base de t o hierba mate.\nEsta clase comprende tambin:\n- la elaboracin de infusiones (menta, verbena, manzanilla, etc.).\n',0,0),(117,'1084','Elaboracin de especias, salsas y condimentos',4,'10.84 Elaboracin de especias, salsas y condimentos\nEsta clase comprende:\n- la elaboracin de especias, salsas y condimentos:\n mayonesa;\n harina de mostaza;\n mostaza preparada, etc.;\n- la fabricacin de vinagre.\nEsta clase comprende tambin:\n- la preparacin de la sal para su consumo, por ejemplo, sal yodada.\n',0,0),(118,'1085','Elaboracin de platos y comidas preparados',4,'10.85 Elaboracin de platos y comidas preparados\nEsta clase comprende la fabricacin de comidas y platos listos para su consumo (es decir, preparados,\ncondimentados y cocinados). Estos platos estn procesados para su conservacin, por ejemplo congelados o\nenlatados, y suelen envasarse y etiquetarse para su reventa, es decir, esta clase no comprende la preparacin de\ncomidas para su consumo inmediato, por ejemplo en restaurantes. Para ser considerado un plato estas comidas\ndeben contener al menos dos ingredientes (aparte de los condimentos, etc.).\nEsta clase comprende:\n- la elaboracin de platos de carne;\n- la elaboracin de platos a base de pescado;\n- la elaboracin de platos a base de hortalizas;\n- la elaboracin de pizzas congeladas o conservadas por cualquier otro mtodo\nEsta clase comprende tambin:\n- la elaboracin de platos y comidas locales y nacionales\n',0,0),(119,'1086','Elaboracin de preparados alimenticios homogeneizados y alimentos dietticos',4,'10.86 Elaboracin de preparados alimenticios homogeneizados y alimentos dietticos\nEsta clase comprende:\n- la elaboracin de alimentos de nutricin especial:\n los alimentos preparados infantiles;\n la leche y otros alimentos de crecimiento;\n los productos de alimentacin infantil;\n los alimentos de rgimen, de poco o reducido valor energtico;\n los alimentos dietticos para fines mdicos especiales;\n los alimentos pobres en sodio, incluidas las sales dietticas con bajo o nulo contenido de sodio;\n los alimentos sin gluten;\n los alimentos destinados a combatir el desgaste causado por el esfuerzo muscular intenso, especialmente\nindicados para deportistas;\n los alimentos para personas que padecen desrdenes metablicos en la asimilacin de los hidratos de carbono\n(diabetes).\n',0,0),(120,'1089','Elaboracin de otros productos alimenticios n.c.o.p.',4,'10.89 Elaboracin de otros productos alimenticios n.c.o.p.\nEsta clase comprende:\n- la elaboracin de sopas y caldos\n- la fabricacin de caramelo y miel artificial\n- la elaboracin de productos alimenticios preparados perecederos, como:\n sandwiches\n pizza fresca (sin hornear)\n- la elaboracin de suplementos alimenticios y otros productos alimenticios n.c.o.p.\nEsta clase comprende tambin:\n- la elaboracin de levadura\n- la fabricacin de extractos y jugos de carne, pescados, crustceos y moluscos\n- la produccin de sucedneos no lcteos de la leche y el queso\n- la elaboracin de productos a base de huevo y ovoalbmina\n- la fabricacin de concentrados artificiales\n',0,0),(121,'109','Fabricacin de productos para la alimentacin animal',3,'10.9 Fabricacin de productos para la alimentacin animal\n',0,0),(122,'1091','Fabricacin de productos para la alimentacin de animales de granja',4,'10.91 Fabricacin de productos para la alimentacin de animales de granja\nEsta clase comprende:\n- la fabricacin de productos para la alimentacin de animales de granja incluidos los suplementos y concentrados\nde alimentacin para animales;\n- la preparacin de productos sin mezclar para la alimentacin de los animales de granja.\nEsta clase comprende tambin:\n- el tratamiento de residuos de mataderos para la produccin de productos para la alimentacin animal.\n',0,0),(123,'1092','Fabricacin de productos para la alimentacin de animales de compaa',4,'10.92 Fabricacin de productos para la alimentacin de animales de compaa\nEsta clase comprende:\n- la fabricacin de productos para la alimentacin de animales de compaa, incluidos perros, gatos, pjaros, peces,\netc.\nEsta clase comprende tambin:\n- el tratamiento de residuos de mataderos para la produccin de productos para la alimentacin animal.\n',0,0),(124,'11','Fabricacin de bebidas',2,'11 Fabricacin de bebidas\nEsta divisin comprende la fabricacin de bebidas, tales como las bebidas no alcohlicas y el agua mineral, la\nfabricacin de bebidas alcohlicas, fundamentalmente mediante fermentacin, cerveza y vino, y la fabricacin de\nbebidas alcohlicas destiladas.\nEsta divisin no comprende:\n- la produccin de zumos de frutas y verduras (vase 10.32);\n- la produccin de bebidas a base de leche (vase 10.51);\n- la elaboracin de productos a base de caf, t y hierba mate (vase 10.83).\n',0,0),(125,'110','Fabricacin de bebidas',3,'11.0 Fabricacin de bebidas\n',0,0),(126,'1101','Destilacin, rectificacin y mezcla de bebidas alcohlicas',4,'11.01 Destilacin, rectificacin y mezcla de bebidas alcohlicas\nEsta clase comprende:\n- la destilacin de bebidas alcohlicas: gisqui, coac, ginebra, licores, etc.;\n- la fabricacin de bebidas mezcladas con bebidas alcohlicas destiladas;\n- la mezcla de bebidas alcohlicas destiladas;\n- la produccin de alcohol rectificado.\n',0,0),(127,'1102','Elaboracin de vinos',4,'11.02 Elaboracin de vinos\nEsta clase comprende:\n- la elaboracin de vinos;\n- la elaboracin de vinos espumosos;\n- la elaboracin de vino a partir de mosto concentrado.\nEsta clase comprende tambin:\n- la mezcla, depuracin y embotellado de vinos;\n- la elaboracin de vino bajo en alcohol o sin alcohol.\n',0,0),(128,'1103','Elaboracin de sidra y otras bebidas fermentadas a partir de frutas',4,'11.03 Elaboracin de sidra y otras bebidas fermentadas a partir de frutas\nEsta clase comprende:\n- la elaboracin de bebidas alcohlicas fermentadas, pero no destiladas: sake, sidra, perada y otras bebidas\nfermentadas a partir de frutas.\nEsta clase comprende tambin:\n- la elaboracin de aguamiel y bebidas mezcladas con bebidas fermentadas a partir de frutas.\n',0,0),(129,'1104','Elaboracin de otras bebidas no destiladas, procedentes de la fermentacin',4,'11.04 Elaboracin de otras bebidas no destiladas, procedentes de la fermentacin\nEsta clase comprende:\n- la elaboracin de vermut y similares.\n',0,0),(130,'1105','Fabricacin de cerveza',4,'11.05 Fabricacin de cerveza\nEsta clase comprende:\n- la elaboracin de bebidas alcohlicas de malta, como cerveza, ale, porter y stout.\nEsta clase comprende tambin:\n- la elaboracin de cerveza sin alcohol o con bajo contenido alcohlico.\n',0,0),(131,'1106','Fabricacin de malta',4,'11.06 Fabricacin de malta\n',0,0),(132,'1107','Fabricacin de bebidas no alcohlicas; produccin de aguas minerales y otras aguas embotelladas',4,'11.07 Fabricacin de bebidas no alcohlicas; produccin de aguas minerales y otras aguas embotelladas\nEsta clase comprende la elaboracin de bebidas no alcohlicas (excepto la cerveza y el vino sin alcohol):\n- la produccin de aguas minerales naturales y otras aguas embotelladas;\n- la produccin de bebidas no alcohlicas:\n la produccin de bebidas no alcohlicas aromatizadas o azucaradas: limonada, naranjada, cola, bebidas de frutas,\naguas tnicas, etc.\n',0,0),(133,'12','Industria del tabaco',2,'12 Industria del tabaco\nEsta divisin comprende la transformacin de un producto agrario, el tabaco, en una forma adecuada para su\nconsumo final.\n',0,0),(134,'120','Industria del tabaco',3,'12.0 Industria del tabaco\n',0,0),(135,'1200','Industria del tabaco',4,'12.00 Industria del tabaco\nEsta clase comprende:\n- la elaboracin de productos de tabaco y sucedneos del tabaco: cigarrillos, tabaco de picadura fina,\ncigarros puros, tabaco de pipa, tabaco para mascar y rap;\n- la elaboracin de tabaco homogeneizado o reconstituido.\nEsta clase comprende tambin:\n- el desvenado y resecado del tabaco.\n',0,0),(136,'13','Industria textil',2,'13 Industria textil\nEsta divisin comprende la preparacin e hilado de fibras textiles, as como de tejidos textiles, el acabado de textiles\ny prendas de vestir, la fabricacin de artculos confeccionados con textiles, excepto prendas (como ropa blanca,\nmantas, alfombras, cuerdas, etc.). El cultivo de fibras naturales corresponde a la divisin 01, mientras que la\nfabricacin de fibras sintticas es un proceso qumico clasificado en la clase 20.60. La fabricacin de prendas de\nvestir se considera en la divisin 14.\n',0,0),(137,'131','Preparacin e hilado de fibras textiles',3,'13.1 Preparacin e hilado de fibras textiles\n',0,0),(138,'1310','Preparacin e hilado de fibras textiles',4,'13.10 Preparacin e hilado de fibras textiles\nEsta clase comprende las operaciones preparatorias sobre fibras textiles y el hilado de fibras textiles. Esta tarea\npuede realizarse a partir de diversas materias primas, como la seda, la lana, otras fibras animales, vegetales o\nartificiales y sintticas, papel, vidrio, etc.\nEsta clase comprende:\n- las operaciones preparatorias de fibras textiles:\n devanado y lavado de la seda;\n desuardado y carbonizado de la lana y teido de vellones;\n cardado y peinado de todo tipo de fibras animales, vegetales y artificiales y sintticas;\n- hilado y fabricacin de filamento o hilo para tejer o coser, para su comercializacin o para un tratamiento ulterior;\n espadado del lino;\n texturado, torsin, plegado, cableado e inmersin de filamentos sintticos y artificiales.\nEsta clase comprende tambin:\n- la fabricacin de hilo de papel.\n',0,0),(139,'132','Fabricacin de tejidos textiles',3,'13.2 Fabricacin de tejidos textiles\n',0,0),(140,'1320','Fabricacin de tejidos textiles',4,'13.20 Fabricacin de tejidos textiles\nEsta clase comprende la fabricacin de tejidos textiles. Esta tarea puede realizarse a partir de diversas materias\nprimas, como la seda, la lana, otras fibras animales, vegetales o artificiales y sintticas, papel, vidrio, etc.\nEsta clase comprende:\n- la fabricacin de tejidos anchos de tipo algodn, lana, lana peinada o seda, incluidos los realizados a base de\nmezclas o hilos artificiales o sintticos (poliprpileno, etc.);\n- la fabricacin de otros tejidos anchos utilizando lino, ramio, camo, yute, fibras blandas e hilados especiales.\nEsta clase comprende tambin:\n- la fabricacin de tejidos de felpilla o chenilla, de toallera de tejido de rizo, de tejido de gasa, etc.;\n- la fabricacin de tejidos de fibra de vidrio;\n- la fabricacin de tejidos de carbono y aramida;\n- la fabricacin de pieles de imitacin obtenidas por tejido.\n',0,0),(141,'133','Acabado de textiles',3,'13.3 Acabado de textiles\n',0,0),(142,'1330','Acabado de textiles',4,'13.30 Acabado de textiles\nEsta clase comprende el acabado de textiles y prendas de vestir, es decir, el blanqueo, teido, apresto y actividades\nsimilares.\nEsta clase comprende:\n- el blanqueo y teido de fibras textiles, hilos, tejidos y artculos textiles, incluidas las prendas de vestir;\n- el apresto, secado, vaporizado, encogimiento, remendado, sanforizado y mercerizado de materias textiles y de\nartculos textiles, incluidas las prendas de vestir.\nEsta clase comprende tambin:\n- el blanqueo de pantalones vaqueros;\n- el plisado y labores anlogas sobre textiles;\n- la impermeabilizacin, el recuubrimiento, el engomado y la impregnacin de prendas de vestir adquiridas;\n- el serigrafiado sobre textiles y prendas de vestir.\n',0,0),(143,'139','Fabricacin de otros productos textiles',3,'13.9 Fabricacin de otros productos textiles\nEste grupo comprende la fabricacin de productos obtenidos a partir de textiles, excepto las prendas de vestir, como\nlos artculos confeccionados con textiles, alfombras y moquetas, cuerda, cintas tejidas, artculos de pasamanera,\netc.\n',0,0),(144,'1391','Fabricacin de tejidos de punto',4,'13.91 Fabricacin de tejidos de punto\nEsta clase comprende:\n- la fabricacin y el tratamiento de gneros de punto:\n tejidos de rizo y de pelo;\n tejidos de mallas anudadas para visillos y cortinas fabricados con mquinas Raschel o similares;\n otros gneros de punto\nEsta clase comprende tambin:\n- la fabricacin de pieles de imitacin obtenidas mediante tricotaje.\n',0,0),(145,'1392','Fabricacin de artculos confeccionados con textiles, excepto prendas de vestir',4,'13.92 Fabricacin de artculos confeccionados con textiles, excepto prendas de vestir\nEsta clase comprende:\n- la fabricacin de artculos confeccionados con cualquier material textil, incluidos los gneros de punto:\n mantas, incluidas las de viaje;\n ropa de cama, mesa, bao y cocina;\n acolchados, edredones, almohadones, pufes, almohadas, sacos de dormir, etc.;\n- la fabricacin de artculos confeccionados para el hogar:\n cortinas, visillos, cenefas, estores, cubrecamas, cubiertas de mobiliario o mquinas, etc.\n lonas, tiendas de campaa y otros artculos anlogos de acampada, velas para embarcaciones, toldos, cubiertas\nsueltas para vehculos automviles, maquinaria o mobiliario, etc.;\n banderas, gallardetes, estandartes, etc.;\n bayetas, arpilleras para fregar y artculos similares, chalecos salvavidas, paracadas, etc.\nEsta clase comprende tambin:\n- la fabricacin de los componentes textiles para mantas elctricas;\n- la fabricacin de tapices tejidos a mano\n',0,0),(146,'1393','Fabricacin de alfombras y moquetas',4,'13.93 Fabricacin de alfombras y moquetas\nEsta clase comprende:\n- la fabricacin de revestimientos textiles para suelos:\n alfombras, moquetas, felpudos y esteras, baldosas\nEsta clase comprende tambin:\n- la fabricacin de revestimientos para suelos de fieltro\n',0,0),(147,'1394','Fabricacin de cuerdas, cordeles, bramantes y redes',4,'13.94 Fabricacin de cuerdas, cordeles, bramantes y redes\nEsta clase comprende:\n- la fabricacin de cuerdas, cordeles, bramantes y cordajes de fibras textiles, cintas y similares, estn o no\nimpregnados, baados, recubiertos o revestidos de caucho o materias plsticas\n- la fabricacin de redes de punto anudado hechas de cordelera;\n- la fabricacin de productos de cordelera y de redes: redes para pescar, guardamancebos para embarcaciones,\ncojines de descarga, eslingas, cuerdas o cables equipados con anillas metlicas, etc.\n',0,0),(148,'1395','Fabricacin de telas no tejidas y artculos confeccionados con ellas, excepto prendas de vestir',4,'13.95 Fabricacin de telas no tejidas y artculos confeccionados con ellas, excepto prendas de vestir\nEsta clase comprende todas las actividades relacionadas con la fabricacin de textiles y productos confeccionados\ncon stos no especificadas en las divisiones 13  14, que incluyen un gran nmero de procesos y una amplia gama\nde artculos producidos.\n',0,0),(149,'1396','Fabricacin de otros productos textiles de uso tcnico e industrial',4,'13.96 Fabricacin de otros productos textiles de uso tcnico e industrial\nEsta clase comprende:\n- la fabricacin de cintas tejidas, incluidas las consistentes en urdimbre sin trama unidas por medio de un adhesivo\n- la fabricacin de etiquetas, insignias, etc.\n- la fabricacin de guarniciones ornamentales: galones, borlas, pompones, etc.\n- la fabricacin de tejidos impregnados, baados, recubiertos o estratificados con materias plsticas\n- la fabricacin de hilo metalizado y de hilo recubierto metalizado, de cuerda de hilo de goma recubierta de materia\ntextil, de hilo o cinta textil recubiertos, impregnados, baados o revestidos con caucho o materias plsticas\n- la fabricacin de tejido de cordelera para neumticos de hilo sinttico o artificial de alta tenacidad\n- la fabricacin de otros tejidos tratados o recubiertos: bucarn y otros tejidos reforzados similares, tejidos baados\nen goma o almidn\n- la fabricacin de productos textiles diversos: mechas textiles, manguitos (camisas) incandescentes para gas y\ntejido tubular para su fabricacin\n- la fabricacin de tejidos para manguitos, mangueras, cintas transportadoras o de transmisin (reforzadas o no con\nmetal u otro material), gasas y telas para cerner, tejidos filtrantes\n- la fabricacin de guarnicionera para automviles\n- la fabricacin de lienzos para pintura y papel tela para dibujo\n',0,0),(150,'1399','Fabricacin de otros productos textiles n.c.o.p.',4,'13.99 Fabricacin de otros productos textiles n.c.o.p.\nEsta clase comprende:\n- la fabricacin de fieltro\n- la fabricacin de tules y de tejidos de mallas anudadas, de encajes en pieza, en tiras o en motivos, de bordados\n- la fabricacin de cintas de tela sensibles a la presin\n- la fabricacin de cordones de zapatos de materias textiles\n- la fabricacin de borlas y pompones para maquillaje\n',0,0),(151,'14','Confeccin de prendas de vestir',2,'14 Confeccin de prendas de vestir\nEsta divisin abarca todo tipo de confeccin (confeccionada en serie o a medida), en todos los materiales (cuero,\ntejidos, punto, etc.), de todo tipo de prendas (exteriores, ropa interior para hombre, mujer y nio, ropa de trabajo,\nropa de calle e informal, etc.) y accesorios. No se hace distincin entre prendas para adultos y para nios, o entre\nprendas modernas y tradicionales. La divisin 14 comprende tambin la industria peletera (pieles y prendas de\nvestir).\n',0,0),(152,'141','Confeccin de prendas de vestir, excepto de peletera',3,'14.1 Confeccin de prendas de vestir, excepto de peletera\nEste grupo comprende la fabricacin de prendas de vestir. El material utilizado puede ser de cualquier tipo, y estar\nbaado, impregnado o engomado.\n',0,0),(153,'1411','Confeccin de prendas de vestir de cuero',4,'14.11 Confeccin de prendas de vestir de cuero\nEsta clase comprende:\n- la fabricacin de prendas de vestir confeccionadas con cuero o cuero artificial o regenerado, incluidos los\naccesorios de cuero para actividades industriales, como los delantales de cuero para soldadura\n',0,0),(154,'1412','Confeccin de ropa de trabajo',4,'14.12 Confeccin de ropa de trabajo\n',0,0),(155,'1413','Confeccin de otras prendas de vestir exteriores',4,'14.13 Confeccin de otras prendas de vestir exteriores\nEsta clase comprende:\n- la confeccin de otras prendas exteriores con tejidos, gneros de punto, tela no tejida, etc., para hombres, mujeres\ny nios:\n abrigos, trajes, conjuntos, chaquetas, pantalones, faldas, etc.\nEsta clase comprende tambin:\n- la sastrera a medida\n- la fabricacin de partes de los productos mencionados en esta clase\n',0,0),(156,'1414','Confeccin de ropa interior',4,'14.14 Confeccin de ropa interior\nEsta clase comprende:\n- la confeccin de ropa interior y de dormir con tejidos, gnero de punto, encaje, etc. para hombres, mujeres y nios:\n camisas, camisetas, calzoncillos, pijamas, camisones, batas, blusas, bragas, sujetadores, corss, etc.\n',0,0),(157,'1419','Confeccin de otras prendas de vestir y accesorios',4,'14.19 Confeccin de otras prendas de vestir y accesorios\nEsta clase comprende:\n- la confeccin de prendas para bebs, prendas para la prctica de deportes, prendas de esqu, baadores, etc.\n- la fabricacin de sombreros y gorras\n- la fabricacin de otros accesorios de vestir: guantes, cinturones, chales, corbatas, corbatines, redecillas para el\npelo, etc.\nEsta clase comprende tambin:\n- la confeccin de gorros de piel\n- la fabricacin de calzado de materias textiles sin suela incorporada\n- la fabricacin de componentes de los productos consignados\n',0,0),(158,'142','Fabricacin de artculos de peletera',3,'14.2 Fabricacin de artculos de peletera\n',0,0),(159,'1420','Fabricacin de artculos de peletera',4,'14.20 Fabricacin de artculos de peletera\nEsta clase comprende:\n- la confeccin de artculos de peletera:\n prendas de vestir y accesorios de piel\n productos a partir de recortes de piel como pieles cosidas, lminas, tapetes, cintas, etc.\n artculos de peletera diversos: alfombras, pufes sin rellenar, gamuzas para la limpieza industrial\n',0,0),(160,'143','Confeccin de prendas de vestir de punto',3,'14.3 Confeccin de prendas de vestir de punto\n',0,0),(161,'1431','Confeccin de calcetera',4,'14.31 Confeccin de calcetera\nEsta clase comprende:\n- la fabricacin de artculos de calcetera, incluidos calcetines, medias ordinarias y medias pantaln\n',0,0),(162,'1439','Confeccin de otras prendas de vestir de punto',4,'14.39 Confeccin de otras prendas de vestir de punto\nEsta clase comprende:\n- la confeccin de prendas en tejido de punto y otros artculos confeccionados modelados directamente: jerseys,\nchaquetas de punto, chalecos y artculos similares.\n',0,0),(163,'15','Industria del cuero y del calzado',2,'15 Industria del cuero y del calzado\nEsta divisin comprende la preparacin y el teido de pieles y la transformacin de pieles en cuero mediante el\ncurtido o el curado, as como la conversin del cuero en productos para el consumo final. Comprende asimismo la\nelaboracin de productos similares a partir de otros materiales (cueros de imitacin o sucedneos de cuero), como el\ncalzado de caucho, artculos de viaje textiles, etc. Los productos elaborados a partir de sucedneos de cuero se\nincluyen en esta categora porque se fabrican de manera similar a la empleada en el caso de los productos de cuero\n(p. ej., artculos de viaje), y suelen producirse en la misma unidad.\n',0,0),(164,'151','Preparacin, curtido y acabado del cuero; fabricacin de artculos de marroquinera, viaje y de gusrnicionera y talabartera; preparacin y teido de pieles',3,'15.1 Preparacin, curtido y acabado del cuero; fabricacin de artculos de marroquinera, viaje y de\nguarnicionera y talabartera; preparacin y teido de pieles\nEste grupo comprende la fabricacin de cuero, pieles y productos elaborados con stos.\n',0,0),(165,'1511','Preparacin, curtido y acabado del cuero; preparacin y teido de pieles',4,'15.11 Preparacin, curtido y acabado del cuero; preparacin y teido de pieles\nEsta clase comprende:\n- la preparacin, curtido, teido y acabado de cueros y pieles\n- la fabricacin de cueros agamuzados, apergaminados, acharolados y metalizados\n- la fabricacin de cuero artificial o regenerado\n- el raspado, tundido, despinzado, adobado, curtido, blanqueo y teido de pieles y cueros sin depilar\n',0,0),(166,'1512','Fabricacin de artculos de marroquinera, viaje y de guarnicionera y talabartera',4,'15.12 Fabricacin de artculos de marroquinera, viaje y de guarnicionera y talabartera\nEsta clase comprende:\n- la fabricacin de artculos de viaje, bolsos de mano y artculos semejantes de cuero natural, artificial o regenerado,\no de cualquier otro material como plstico, materias textiles, fibra vulcanizada o cartn, siempre que se utilice la\nmisma tecnologa que para el cuero\n- la fabricacin de artculos de guarnicionera y talabartera\n- la fabricacin de correas no metlicas para relojes de pulsera (p. ej., tela, cuero, plstico)\n- la fabricacin de diversos artculos de cuero natural o de cuero artificial o regenerado: correas de transmisin,\nenvases, etc.\n- la fabricacin de cordones de zapatos, de cuero\n- la fabricacin de ltigos y fustas\n',0,0),(167,'152','Fabricacin de calzado',3,'15.2 Fabricacin de calzado\n',0,0),(168,'1520','Fabricacin de calzado',4,'15.20 Fabricacin de calzado\nEsta clase comprende:\n- la fabricacin de calzado de cualquier tipo y de cualquier material, producido mediante cualquier proceso, incluso el\nvaciado (vanse las excepciones ms adelante)\n- la fabricacin de partes de cuero del calzado: palas y sus componentes, suelas y plantillas, tacones, etc.\n- la fabricacin de polainas, botines y artculos similares\n',0,0),(169,'16','Industria de la madera y del corcho, excepto muebles; cestera y espartera',2,'16 Industria de la madera y del corcho, excepto muebles; cestera y espartera\nEsta divisin comprende la fabricacin de productos de madera, como madera de construccin, contrachapados,\nchapas, envases y embalajes de madera, entarimados, vigas trianguladas de madera y edificios de madera\nprefabricados. Entre los procedimientos de produccin se incluyen el aserrado, el cepillado, la conformacin, la\nlaminacin y el ensamblaje de productos de madera, empezando por los troncos que se cortan en trozas, o madera\nde construccin que puede seguir cortndose ulteriormente, o conformada con el torno u otras herramientas. La\nmadera de construccin y otras formas de madera transformada pueden tambin cepillarse o pulirse posteriormente\ny ensamblarse en productos acabados, como envases y embalajes de madera.\nCon la excepcin del aserrado, esta divisin se subdivide con arreglo principalmente a los productos especficos\nfabricados.\nEsta divisin no comprende la fabricacin de muebles (31.0), ni la instalacin de trabajos de carpintera y similares\n(43.32, 43.33, 43.39).\n',0,0),(170,'161','Aserrado y cepillado de la madera',3,'16.1 Aserrado y cepillado de la madera\n',0,0),(171,'1610','Aserrado y cepillado de la madera',4,'16.10 Aserrado y cepillado de la madera\nEsta clase comprende:\n- el aserrado y el cepillado de la madera\n- el corte, el pelado y el desbarbado de troncos\n- la fabricacin de traviesas de madera para vas frreas\n- la fabricacin de maderas sin ensamblar para suelos\n- la fabricacin de lana, harina y virutas de madera\nEsta clase comprende tambin:\n- el secado de la madera\n- la impregnacin o tratamiento qumico de la madera con agentes conservantes u otras materias\n',0,0),(172,'162','Fabricacin de productos de madera, corcho, cestera y espartera',3,'16.2 Fabricacin de productos de madera, corcho, cestera y espartera\nEste grupo comprende la fabricacin de productos de madera, corcho, cestera y espartera, incluidas tanto formas\nbsicas, como productos montados\n',0,0),(173,'1621','Fabricacin de chapas y tableros de madera',4,'16.21 Fabricacin de chapas y tableros de madera\nEsta clase comprende:\n- la fabricacin de chapas de la delgadez suficiente para su utilizacin en enchapados, la elaboracin de\ncontrachapados y otros fines:\n pulido, teido, baado, impregnado, reforzado (con forro de papel o tejido)\n elaboracin en forma de motivos\n- la fabricacin de tableros contrachapados, chapas y tableros de madera laminada similares\n- la fabricacin de tableros con filamentos orientados (OSB) y otros tableros de partculas;\n- la fabricacin de tableros de fibras de densidad media (MDF) y otros trableros de fibras\n- la fabricacin de madera densificada\n- la fabricacin de madera laminada encolada y madera de chapado laminada\n',0,0),(174,'1622','Fabricacin de suelos de madera ensamblados',4,'16.22 Fabricacin de suelos de madera ensamblados\nEsta clase comprende:\n- la fabricacin de placas de parquet, tiras, etc. de madera, ensambladas en planchas\n',0,0),(175,'1623','Fabricacin de otras estructuras de madera y piezas de carpintera y ebanistera para la construccin',4,'16.23 Fabricacin de otras estructuras de madera y piezas de carpintera y ebanistera para la\nconstruccin\nEsta clase comprende:\n- la fabricacin de estructuras de madera y piezas de carpintera destinadas principalmente a la construccin:\n vigas, viguetas, vigas maestras\n vigas trianguladas de madera laminada encolada para tejados, prefabricadas y conectadas por elementos\nmetlicos\n puertas, ventanas, persianas y sus marcos, contengan o no accesorios metlicos como herrajes, cerraduras, etc.\n escaleras y barandillas\n listones y molduras, ripias para tejados\n- la construccin de edificios prefabricados o sus elementos, hechos en su mayor parte con madera, por ejemplo,\nsaunas\n- la fabricacin de viviendas mviles\n- la fabricacin de tabiques de madera (excepto los paneles mviles independientes)\n',0,0),(176,'1624','Fabricacin de envases y embalajes de madera',4,'16.24 Fabricacin de envases y embalajes de madera\nEsta clase comprende:\n- la fabricacin de cajas, cajitas, jaulas, cilindros, urnas y envases similares de madera\n- la fabricacin de palets y otros paneles de madera para carga\n- la fabricacin de barriles, cubas, tinas y otras manufacturas de tonelera, de madera\n- la fabricacin de bobinas de madera para cables\n',0,0),(177,'1629','Fabricacin de otros productos de madera; artculos de corcho, cestera y espartera',4,'16.29 Fabricacin de otros productos de madera; artculos de corcho, cestera y espartera\nEsta clase comprende:\n- la fabricacin de productos diversos de madera:\n la fabricacin de monturas y mangos de herramientas, escobas y cepillos\n la fabricacin de hormas de madera para el calzado, perchas\n la fabricacin de utensilios domsticos y de cocina de madera\n la fabricacin de estatuillas y otros objetos decorativos de madera, madera con trabajo de marquetera o taracea\n la fabricacin de cajas, estuches y joyeros, y artculos similares de madera\n la fabricacin de canillas, carretes y bobinas para hilos y artculos similares de madera torneada\n la fabricacin de otros artculos de madera\n- el tratamiento de corcho natural en bruto, la fabricacin de corcho aglomerado;\n- la fabricacin de artculos de corcho natural o aglomerado, incluidos revestimientos para suelos\n- la fabricacin de trenzas y artculos de materias trenzables: esteras, salvamanteles, pantallas, cajas, etc.\n- la fabricacin de artculos de cestera y mimbre\n- la fabricacin de madera para combustible y pellets como recurso energtico, elaborados de madera prensada o\nmateriales sustitutivos como posos de caf o semilla de soja\n- la fabricacin de marcos de madera para espejos y cuadros\n- la fabricacin de marcos para lienzos de pintura\n- la fabricacin de partes de madera para el calzado (p. ej., tacones y hormas)\n- la fabricacin de mangos para paraguas, bastones y artculos similares\n- la fabricacin de bloques para la fabricacin de pipas\n',0,0),(178,'17','Industria del papel',2,'17 Industria del papel\nEsta divisin abarca la fabricacin de pasta papelera, papel y productos de papel transformado. La fabricacin de\nestos productos se agrupa porque constituye una serie de procesos conectados verticalmente. Con frecuencia se\nrealiza ms de una actividad en la misma unidad.\nFundamentalmente se llevan a cabo tres actividades. La fabricacin de pasta papelera consiste en separar las fibras\nde celulosa de otros materiales en la madera, o en disolver y destintar el papel usado, y aadir a la mezcla pequeas\ncantidades de reactivos para reforzar la aglutinacin de las fibras. La fabricacin del papel comprende el vertido de\nla pasta en una criba mvil con el fin de formar una hoja continua. Los productos de papel transformado se fabrican\ncon papel y otros materiales mediante diversas tcnicas.\nLos artculos de papel pueden estar impresos (papeles pintados, envoltorios para regalo, etc.), siempre que la\nfinalidad principal no sea la impresin de informacin.\nLa produccin de pasta papelera, papel y cartn a granel se incluye en el grupo 17.1, mientras que el resto de clases\ncomprende la produccin de papel y productos de papel sometidos a transformaciones ulteriores.\n',0,0),(179,'171','Industria de pasta papelera, papel y cartn',3,'17.1 Fabricacin de pasta papelera, papel y cartn\n',0,0),(180,'1711','Fabricacin de pasta papelera',4,'17.11 Fabricacin de pasta papelera\nEsta clase comprende:\n- la fabricacin de pasta de papel blanqueada, semiblanqueada o cruda mediante procedimientos mecnicos,\nqumicos (solubles o no) o semiqumicos\n- la fabricacin de pasta papelera de borras de algodn\n- la eliminacin de tinta y la fabricacin de pasta papelera a partir de papel usado\n',0,0),(181,'1712','Fabricacin de papel y cartn',4,'17.12 Fabricacin de papel y cartn\nEsta clase comprende:\n- la fabricacin de papel y cartn con vistas a un tratamiento industrial posterior\nEsta clase comprende tambin:\n- el tratamiento ulterior de papel y cartn:\n el encolado, el recubrimiento y la impregnacin de papel y cartn\n la fabricacin de papel rizado o plegado\n la fabricacin de laminados y papel de aluminio, si se laminan con papel o cartn\n- la fabricacin de papel hecho a mano\n- la fabricacin de papel prensa y otro papel de impresin o escritura\n- la fabricacin de guata de celulosa y bandas de fibras de celulosa\n- la fabricacin de papel de calco y papel para clichs de multicopista en rollos o grandes pliegos\n',0,0),(182,'172','Fabricacin de artculos de papel y cartn',3,'17.2 Fabricacin de artculos de papel y de cartn\n',0,0),(183,'1721','Fabricacin de papel y cartn ondulados; fabricacin de envases y embalajes de papel y cartn',4,'17.21 Fabricacin de papel y cartn ondulados; fabricacin de envases y embalajes de papel y cartn\nEsta clase comprende:\n- la fabricacin de papel y cartn ondulados\n- la fabricacin de embalajes de papel o cartn ondulados\n- la fabricacin de embalajes plegables de cartn\n- la fabricacin de embalajes de cartn duro\n- la fabricacin de otros embalajes de papel y cartn\n- la fabricacin de sacos y bolsas de papel\n- la fabricacin de archivadores de cartn de oficina y artculos similares\n',0,0),(184,'1722','Fabricacin de artculos de papel y cartn para uso domstico, sanitario e higinico',4,'17.22 Fabricacin de artculos de papel y cartn para uso domstico, sanitario e higinico\nEsta clase comprende:\n- la fabricacin de papel para uso domstico e higiene personal, y de productos de guata de celulosa:\n toallitas para desmaquillar\n pauelos, toallas, servilletas\n papel higinico\n compresas higinicas y tampones, paales para bebs\n vasos, platos y bandejas\n- la fabricacin de guata y artculos textiles de guata: compresas higinicas, tampones, etc.\n',0,0),(185,'1723','Fabricacin de artculos de papelera',4,'17.23 Fabricacin de artculos de papelera\nEsta clase comprende:\n- la fabricacin de papel listo para impresin y escritura\n- la fabricacin de papel para impresora de ordenador\n- la fabricacin de papel autocopiativo listo para su uso\n- la fabricacin de clichs de multicopista y papel de calco listo para su uso\n- la fabricacin de papel engomado o adhesivo listo para su uso\n- la fabricacin de sobres y tarjetas postales\n- la fabricacin de artculos de papelera educativos y comerciales (cuadernos, carpetas, registros, libros contables,\nformularios comerciales, etc.) cuando la informacin impresa no constituya su caracterstica principal\n- la fabricacin de cajas, carteras y juegos de artculos de escritorio que incluyan un surtido de material de papelera\n',0,0),(186,'1724','Fabricacin de papeles pintados',4,'17.24 Fabricacin de papeles pintados\nEsta clase comprende:\n- la fabricacin de papeles pintados y otros revestimientos similares para paredes, incluido el papel con un bao de\nvinilo y el papel textil\n',0,0),(187,'1729','Fabricacin de otros artculos de papel y cartn',4,'17.29 Fabricacin de otros artculos de papel y cartn\nEsta clase comprende:\n- la fabricacin de etiquetas\n- la fabricacin de papel y cartn filtrantes\n- la fabricacin de tambores, bobinas, canillas, etc. de papel y cartn\n- la fabricacin de embalajes alveolares de pasta de papel para huevos y otros productos similares, etc.\n- la fabricacin de artculos promocionales y de regalo de papel\n- la fabricacin de tarjetas de papel o cartn para mquinas Jacquard\n',0,0),(188,'18','Artes grficas y reproduccin de soportes grabados',2,'18 Artes grficas y reproduccin de soportes grabados\nEsta divisin comprende la impresin de peridicos, libros, publicaciones peridicas, impresos comerciales, tarjetas\nde felicitacin y otros materiales impresos, y las actividades complementarias asociadas, como la encuadernacin,\nlos servicios de fotograbado y la representacin en imgenes de los datos. Las actividades complementarias\nincluidas aqu forman parte integrante de la industria de la impresin y estas operaciones en casi todos los casos\nofrecen un producto (una plancha para impresin, un libre encuadernado o un disco o fichero informtico) que forma\nparte integrante de la industria de las artes grficas.\nEntre los procedimientos que se utilizan en las artes grficas se encuentran una serie de mtodos de transferencia\nde imgenes desde una plancha, pantalla o fichero informtico a un soporte, como papel, plstico, metal, artculos\ntextiles o madera. Los mtodos ms importantes consisten en la transferencia de la imagen desde una plancha o\npantalla al soporte por medio de la litografa, el huecograbado, la serigrafa o la flexografa.\nAunque una sola unidad puede realizar la impresin y la edicin (un peridico, por ejemplo), cada vez es menos\nfrecuente que se lleven a cabo estas actividades diferenciadas en la misma ubicacin fsica.\nEsta divisin comprende tambin la reproduccin de soportes grabados, como discos compactos, grabaciones de\nvdeo y programas informticos en discos o cintas, etc.\nEsta divisin no comprende las actividades de edicin (vase la seccin J).\n',0,0),(189,'181','Artes grficas y servicios relacionados con las mismas',3,'18.1 Artes grficas y servicios relacionados con las mismas\nEste grupo comprende la impresin de peridicos, libros, publicaciones peridicas, impresos comerciales, tarjetas de\nfelicitacin y otros materiales impresos, y las actividades complementarias asociadas, como la encuadernacin, los\nservicios de fotograbado y la representacin en imgenes de los datos. La impresin puede realizarse utilizando\ndiversas tcnicas y en distintos materiales.\n',0,0),(190,'1811','Impresin de peridicos',4,'18.11 Impresin de peridicos\nEsta clase comprende tambin:\n- la impresin de otras publicaciones peridicas que se publican al menos cuatro veces por semana\n',0,0),(191,'1812','Otras actividades de impresin y artes grficas',4,'18.12 Otras actividades de impresin y artes grficas\nEsta clase comprende:\n- la impresin de otras revistas y publicaciones peridicas que se publican menos de cuatro veces por semana\n- la impresin de libros y folletos, cuadernos y partituras de msica, mapas, atlas, carteles, catlogos, prospectos y\notros impresos publicitarios, sellos de correos, timbres fiscales, documentos de propiedad, cheques y otros ttulos,\ntarjetas inteligentes, lbumes, dietarios, calendarios y otros impresos comerciales, artculos de papelera de uso\npersonal y otros impresos, por medio de prensas de imprenta, offset, fotograbado, flexografa, serigrafa u otros\nmtodos de impresin por estampacin, por multicopistas, impresoras controladas por ordenador, grabadoras en\nrelieve, etc.,  incluyendo la impresin rpida\n- la impresin directa en textiles, plstico, vidrio, metal, madera y cermica\nEl material impreso generalmente est sujeto a derechos de autor.\nEsta clase comprende tambin:\n- la impresin en etiquetas (impresin litogrfica, fotograbado, flexografa u otras)\n',0,0),(192,'1813','Servicios de preimpresin y preparacin de soportes',4,'18.13 Servicios de preimpresin y preparacin de soportes\nEsta clase comprende:\n- la composicin, la fotocomposicin, la introduccin de datos para preimpresin, incluido el escaneado y el\nreconocimiento ptico de caracteres, la compaginacin electrnica\n- la preparacin de ficheros de datos para aplicaciones multimedia (impresin en papel, CD-ROM, Internet)\n- los servicios de fotograbado, incluida la composicin de imgenes y de clichs (para los procedimientos de\nimpresin tipogrfica y offset)\n- la preparacin de cilindros: el grabado de cilindros de fotograbado\n- el procesado de planchas: \"del ordenador a la plancha (\"computer to plate\" CTP) (incluidas las planchas de\nfotopolmeros)\n- la preparacin de planchas y troqueles para la impresin o la estampacin en relieve\n- la preparacin de:\n trabajos artsticos de carcter tcnico, como la preparacin bloques de madera o piedra para litografa\n soportes de presentacin, por ejemplo transparencias y otras formas de presentacin\n bocetos, croquis, maquetas, etc.\n produccin de pruebas\n',0,0),(193,'1814','Encuadernacin y servicios relacionados con la misma',4,'18.14 Encuadernacin y servicios relacionados con la misma\nEsta clase comprende:\n- la encuadernacin comercial, montaje de muestras y servicios de postimpresin de apoyo a las actividades de\nimpresin, como la encuadernacin comercial y el acabado de libros, folletos, revistas, catlogos, etc. mediante\nplegado, corte, alzado, embastado, encuadernacin, encolado, estampado en oro; la encuadernacin espiral y la\nencuadernacin con cable de plstico\n- la encuadernacin y el acabado de papel o cartn impresos mediante plegado, estampado, perforacin, taladrado,\ngrabado, pegado, encolado, laminado\n- los servicios de acabado para CD-ROM\n- los servicios de acabado para la expedicin de correspondencia, como la personalizacin y la preparacin de\nsobres\n- otras actividades de acabado como troquelado, grabado y estampacin, copia de Braille.\n',0,0),(194,'182','Reproduccin de soportes grabados',3,'18.2 Reproduccin de soportes grabados\n',0,0),(195,'1820','Reproduccin de soportes grabados',4,'18.20 Reproduccin de soportes grabados\nEsta clase comprende:\n- la reproduccin, a partir de grabaciones originales, de discos, discos compactos y cintas de msica u otras\ngrabaciones sonoras\n- la reproduccin, a partir de grabaciones originales, de discos, discos compactos y cintas de pelculas u otras\ngrabaciones de vdeo\n- la reproduccin, a partir de grabaciones originales, de programas y datos en discos y cintas\n',0,0),(196,'19','Coqueras y refino de petrleo',2,'19 Coqueras y refino de petrleo\nEsta divisin comprende la transformacin de crudo de petrleo y carbn en productos utilizables. El proceso\ndominante es el refino de petrleo, que consiste en la separacin del crudo de petrleo en sus componentes\nmediante tcnicas como el craqueo y la destilacin. Esta divisin comprende tambin la elaboracin por cuenta\npropia de productos caractersticos (por ejemplo, coque, butano, propano, queroseno, fueloil, etc.), as como los\nservicios de tratamiento (por ejemplo, refino por encargo).\nEsta divisin comprende la fabricacin de gases como etano, propano y butano como productos de las refineras de\npetrleo.\nNo se incluye la fabricacin de dichos gases en otras unidades (20.14), la fabricacin de gases industriales (20.11),\nla extraccin de gas natural (metano, etano, butano o propano) (06.20) ni la produccin de gas combustible distinto\nde los gases de petrleo (por ejemplo, gas de hulla, gas de agua, gas pobre) (35.21). La fabricacin de productos\npetroqumicos a partir de petrleo refinado se clasifica en la divisin 20.\n',0,0),(197,'191','Coqueras',3,'19.1 Coqueras\n',0,0),(198,'1910','Coqueras',4,'19.10 Coqueras\nEsta clase comprende:\n- la explotacin de coqueras\n- la produccin de coque y semicoque\n- la produccin de brea y coque de brea\n- la produccin de gas de hulla en coqueras\n- la produccin de alquitranes de hulla y lignito en bruto\n- la aglomeracin de coque\n',0,0),(199,'192','Refino de petrleo',3,'19.2 Refino de petrleo\n',0,0),(200,'1920','Refino de petrleo',4,'19.20 Refino de petrleo\nEsta clase comprende la fabricacin de combustibles lquidos y gaseosos y de otros productos a partir del crudo de\npetrleo, minerales bituminosos o los productos de su fraccionamiento. El refino de petrleo comprende una o varias\nde las actividades siguientes: fraccionamiento, destilacin directa de crudo de petrleo y craqueo.\nEsta clase comprende:\n- la produccin de combustible para motores: gasolina, queroseno, etc.\n- la produccin de combustible: fueloil ligero, medio y pesado, gases de refinera como etano, propano, butano, etc.\n- la fabricacin de aceites o grasas lubricantes derivados del petrleo, incluso a partir de residuos de lubricantes\n- la fabricacin de productos para la industria petroqumica y para la elaboracin de revestimientos de carreteras\n- la fabricacin de diversos productos: bencina mineral, vaselina, cera de parafina, petrolato, etc.\n- la fabricacin de briquetas de petrleo\n- la mezcla de biocombustibles, es decir, la mezcla de alcoholes con petrleo (p. ej., gasohol)\nEsta clase comprende tambin:\n- la fabricacin de briquetas de turba\n- la fabricacin de briquetas combustibles de hulla y lignito\n',0,0),(201,'20','Industria qumica',2,'20 Industria qumica\nEsta divisin comprende la transformacin de materias primas orgnicas e inorgnicas mediante un proceso qumico\ny la formacin de productos. Distingue entre la fabricacin de productos qumicos bsicos que constituye el primer\ngrupo, y la fabricacin de productos intermedios y finales mediante el tratamiento de productos qumicos bsicos,\nque se incluyen en las dems clases.\n',0,0),(202,'201','Fabricacin de productos qumicos bsicos, compuestos nitrogeneados, fertilizantes, plsticos y caucho sinttico en formas primarias',3,'20.1 Fabricacin de productos qumicos bsicos, compuestos nitrogenados, fertilizantes, plsticos y\ncaucho sinttico en formas primarias\nEste grupo comprende la fabricacin de productos qumicos bsicos, fertilizantes y compuestos nitrogenados, as\ncomo de plsticos y caucho sinttico en sus formas primarias.\n',0,0),(203,'2011','Fabricacin de gases industriales',4,'20.11 Fabricacin de gases industriales\nEsta clase comprende:\n- la fabricacin de gases inorgnicos industriales o mdicos licuados o comprimidos:\n gases elementales\n aire lquido o comprimido\n gases refrigerantes\n mezclas de gases industriales\n gases inertes, tales como dixido de carbono\n gases aislantes\n',0,0),(204,'2012','Fabricacin de colorantes y pigmentos',4,'20.12 Fabricacin de colorantes y pigmentos\nEsta clase comprende:\n- la fabricacin de colorantes y pigmentos de cualquier origen, en forma bsica o concentrada\nEsta clase comprende tambin:\n- la fabricacin de productos que se utilizan como agentes abrillantadores fluorescentes o como luminforos\n',0,0),(205,'2013','Fabricacin de otros productos bsicos de qumica inorgnica',4,'20.13 Fabricacin de otros productos bsicos de qumica inorgnica\nEsta clase comprende la fabricacin de productos qumicos utilizando procesos bsicos. El producto de estos\nprocesos suele consistir en elementos qumicos independientes o compuestos definidos qumicamente\nindependientes.\nEsta clase comprende:\n- la fabricacin de elementos qumicos (excepto gases industriales y metales bsicos)\n- la fabricacin de cidos inorgnicos excepto el cido ntrico\n- la fabricacin de lcalis, lejas y otras bases inorgnicas excepto el amonaco\n- la fabricacin de otros compuestos inorgnicos\n- el tostado de piritas de hierro\n- la fabricacin de agua destilada\nEsta clase comprende tambin:\n- el enriquecimiento de minerales de uranio y de torio\n',0,0),(206,'2014','Fabricacin de otros productos bsicos de qumica orgnica',4,'20.14 Fabricacin de otros productos bsicos de qumica orgnica\nEsta clase comprende la fabricacin de productos qumicos utilizando procesos bsicos, como el craqueo trmico y\nla destilacin. El producto de estos procesos suele consistir en elementos qumicos independientes o compuestos\ndefinidos qumicamente independientes.\nEsta clase comprende:\n- la fabricacin de productos qumicos orgnicos bsicos:\n hidrocarburos acclicos, saturados y no saturados\n hidrocarburos cclicos, saturados y no saturados\n alcoholes acclicos y cclicos\n cidos mono- y policarboxlicos, incluido el cido actico\n otros compuestos de funcin oxgeno, incluidos aldehdos, cetonas, quinonas y compuestos de funcin oxgeno\nbinarios o mltiples\n glicerol sinttico\n compuestos de funcin nitrgeno, incluidas las aminas\n fermentacin de caa de azcar, maz o productos similares para producir alcoholes y esteres\n otros compuestos orgnicos incluidos los productos procedentes de la destilacin de la madera (p. ej., carbn\nvegetal), etc.\n- la fabricacin de productos sintticos aromticos\n- la destilacin de alquitrn de hulla\n',0,0),(207,'2015','Fabricacin de fertilizantes y compuestos nitrogenados',4,'20.15 Fabricacin de fertilizantes y compuestos nitrogenados\nEsta clase comprende:\n- la fabricacin de abonos:\n abonos nitrogenados, fosfatados o potsicos puros o complejos\n urea, fosfatos naturales en bruto y sales de potasio naturales en bruto\n- la fabricacin de productos nitrogenados afines:\n cido ntrico y cido sulfontrico, amonaco, cloruro de amonio, carbonato de amonio, nitritos y nitratos de potasio\nEsta clase comprende tambin:\n- la fabricacin de sustratos para plantacin con turba como componente principal\n- la fabricacin de sustratos para plantacin a base de mezclas de tierra natural, arena, arcilla y minerales\n',0,0),(208,'2016','Fabricacin de plsticos en formas primarias',4,'20.16 Fabricacin de plsticos en formas primarias\nEsta clase comprende la fabricacin de resinas, materiales plsticos y elastmeros termoplsticos no vulcanizables,\nas como la mezcla y combinacin por encargo de resinas y la fabricacin de resinas sintticas no producidas segn\nespecificaciones.\nEsta clase comprende:\n- la fabricacin de primeras materias plsticas:\n polmeros, incluidos los polmeros de etileno, propileno, estireno, cloruro de vinilo, acetato de vinilo y acrlicos\n poliamidas\n resinas fenlicas, resinas de expxido y poliuretano\n resinas alqudicas, resinas de polister y polisteres\n siliconas\n intercambiadores de iones basados en polmeros\nEsta clase comprende tambin:\n- la fabricacin de celulosa y sus derivados qumicos\n',0,0),(209,'2017','Fabricacin de caucho sinttico en formas primarias',4,'20.17 Fabricacin de caucho sinttico en formas primarias\nEsta clase comprende:\n- la fabricacin de caucho sinttico en sus formas primarias:\n caucho sinttico\n factis\n- la fabricacin de mezclas de caucho sinttico y caucho natural o gomas similares al caucho (por ejemplo, balata)\n',0,0),(210,'202','Fabricacin de pesticidas y otros productos agroqumicos',3,'20.2 Fabricacin de pesticidas y otros productos agroqumicos\n',0,0),(211,'2020','Fabricacin de pesticidas y otros productos agroqumicos',4,'20.20 Fabricacin de pesticidas y otros productos agroqumicos\nEsta clase comprende:\n- la fabricacin de insecticidas, raticidas, fungicidas, herbicidas, acaricidas, moluscicidas, biocidas\n- la fabricacin de inhibidores de germinacin y reguladores del crecimiento de las plantas\n- la fabricacin de desinfectantes tanto agrcolas como para otros usos\n- la fabricacin de otros productos agroqumicos n.c.o.p.\n',0,0),(212,'203','Fabricacin de pinturas, barnices y revestimientos similares; tintas de imprenta y masillas',3,'20.3 Fabricacin de pinturas, barnices y revestimientos similares; tintas de imprenta y masillas\n',0,0),(213,'2030','Fabricacin de pinturas, barnices y revestimientos similares; tintas de imprenta y masillas',4,'20.30 Fabricacin de pinturas, barnices y revestimientos similares; tintas de imprenta y masillas\nEsta clase comprende:\n- la fabricacin de pinturas y barnices, esmaltes o lacas\n- la fabricacin de pigmentos y tintes, opacificadores y colores preparados\n- la fabricacin de esmaltes vitrificables y vidriados y engobes y preparados similares\n- la fabricacin de masillas\n- la fabricacin de compuestos de calafateado, plastes o masillas de relleno no refractarios similares\n- la fabricacin de disolventes y diluyentes orgnicos compuestos\n- la fabricacin de preparados quitapinturas y quitabarnices\n- la fabricacin de tintas de imprenta\n',0,0),(214,'204','Fabricacin de jabones, detergentes y otros artculos de limpieza y abrillantamiento; fabricacin de perfumes y cosmticos',3,'20.4 Fabricacin de jabones, detergentes y otros artculos de limpieza y abrillantamiento; fabricacin de\nperfumes y cosmticos\n',0,0),(215,'2041','Fabricacin de jabones, detergentes y otros artculos de limpieza y abrillantamiento',4,'20.41 Fabricacin de jabones, detergentes y otros artculos de limpieza y abrillantamiento\nEsta clase comprende:\n- la fabricacin de agentes tensoactivos orgnicos\n- la fabricacin de papel, guata, fieltro, etc., revestidos o recubiertos con jabn o detergente\n- la fabricacin de glicerina bruta\n- la fabricacin de jabn, excepto jabn cosmtico\n- la fabricacin de preparados tensoactivos:\n polvos para lavar y detergentes en forma slida o lquida\n preparados para lavavajillas\n suavizantes de tejidos\n- la fabricacin de productos de limpieza y de abrillantamiento:\n preparados para perfumar y desodorizar locales\n ceras artificiales y ceras preparadas\n lustres y cremas para cuero\n lustres y cremas para madera\n lustres para carroceras de automviles, cristales y metales\n polvos o pastas de limpieza, incluidos papel, guata, etc revestidos o recubiertos con estos productos\n',0,0),(216,'2042','Fabricacin de perfumes y cosmticos',4,'20.42 Fabricacin de perfumes y cosmticos\nEsta clase comprende:\n- la fabricacin de perfumes y cosmticos:\n perfumes y agua de tocador\n productos de belleza y de maquillaje\n productos para el bronceado y la prevencin de las quemaduras de sol\n preparados para manicura o pedicura\n champs, lacas para el pelo, preparados para el rizado y el alisado\n dentfricos y preparados para la higiene bucal, incluidos los preparados para la fijacin de dentaduras postizas\n preparados para el afeitado, incluidos los preparados para antes y despus del afeitado\n desodorantes y sales de bao\n productos para la depilacin\n- la fabricacin de jabn cosmtico\n',0,0),(217,