 tubos y perfiles de plstico',4,'22.21 Fabricacin de placas, hojas, tubos y perfiles de plstico\nEsta clase comprende:\n- la fabricacin de productos semielaborados de materias plsticas:\n placas, planchas, bloques, pelculas, lminas, bandas, etc. de plstico (autoadhesivo o no)\n- la fabricacin de productos acabados de plstico:\n tubos, conductos y mangueras de plstico, accesorios para tuberas y mangueras\n pelcula o lmina de celofn\n',0,0),(235,'2222','Fabricacin de envases y embalajes de plstico',4,'22.22 Fabricacin de envases y embalajes de plstico\nEsta clase comprende:\n- la fabricacin de artculos de embalaje de materias plsticas:\n bolsas, sacos, cajas, cajones, bombonas, botellas, etc.\n',0,0),(236,'2223','Fabricacin de productos de plstico para la construccin',4,'22.23 Fabricacin de productos de plstico para la construccin\nEsta clase comprende:\n- la fabricacin de productos de materias plsticas para la construccin:\n puertas, ventanas, marcos, cierres, persianas y zcalos, de plstico\n tanques, depsitos\n revestimientos de plstico para suelos, paredes o techos en rollos o en forma de losetas, etc.\n artculos de plstico de uso sanitario como baeras, platos de ducha, lavabos, tazas de inodoro, cisternas, etc.\n- la fabricacin de revestimientos de suelos resistentes, como vinilo, linleo, etc.\n- la fabricacin de piedra artificial (por ejemplo, mrmol artificial)\n',0,0),(237,'2229','Fabricacin de otros productos de plstico',4,'22.29 Fabricacin de otros productos de plstico\nEsta clase comprende:\n- la fabricacin de servicios de mesa, utensilios de cocina y artculos de tocador, de plstico\n- la fabricacin de productos de plstico diversos:\n sombrerera, aislamientos, piezas para lmparas y accesorios de iluminacin, artculos de escritorio y para uso\nescolar, prendas de vestir (slo cuando las piezas se unen por adhesin y no por costura), guarniciones para\nmuebles, estatuillas, cintas transportadoras y de transmisin, cintas de plstico autoadhesivas, hormas de zapato\n