imilares con una base de sustancias minerales o de\ncelulosa\n- la fabricacin de materiales minerales aislantes:\n lana de escorias, de roca y lanas minerales similares, vermiculita exfoliada, arcillas dilatadas y materiales similares\npara aislamiento trmico y acstico\n- la fabricacin de artculos de sustancias minerales diversas:\n mica trabajada y productos de mica, turba, grafito (excepto artculos elctricos), etc.\n- la fabricacin de artculos de asfalto y de materiales similares, como, por ejemplo, adhesivos a base de asfalto,\nbrea de alquitrn de hulla, etc.\n- la fabricacin de fibras y productos de carbono y grafito (excepto electrodos y aplicaciones elctricas)\n- la fabricacin de corindn artificial\n',0,0),(271,'24','Metalurgia; fabricacin de productos de hierro, acero y ferroaleaciones',2,'24 Metalurgia; fabricacin de productos de hierro, acero y ferroaleaciones\nEsta divisin comprende las actividades de fundicin o refinado de metales frreos y no frreos a partir del mineral,\nlingote o chatarra mediante tcnicas electrometalrgicas y otras tcnicas metalrgicas de tratamiento. Esta divisin\ncomprende tambin la fabricacin de aleaciones y superaleaciones metlicas introduciendo otros elementos\nqumicos en los metales puros. El resultado de la fundicin y refinado, normalmente en forma de lingotes, se utiliza\nen las operaciones de laminacin, estirado y extrusin para fabricar chapas, flejes, barras, varillas, alambre o tubos,\ntuberas y perfiles huecos, y en forma licuada para hacer piezas fundidas y otros productos metlicos bsicos.\n',0,0),(272,'241','Fabricacin de productos bsicos de hierro, acero y ferroaleaciones',3,'24.1 Fabricacin de productos bsicos de hierro, acero y ferroaleaciones\nEste grupo comprende actividades como la reduccin directa de mineral de hierro, la fabricacin de lingotes de\nhierro en forma licuada o slida; la transformacin de lingotes de hierro en acero, la fabricacin de ferroaleaciones y\nla fabricacin de productos de acero.\n',0,0),(273,'2410','Fabricacin de productos bsicos de hierro, acero y ferroaleaciones',4,'24.10 Fabricacin de productos bsicos de hierro, acero y ferroaleaciones\nEsta clase comprende:\n- la explotacin de altos hornos, convertidores de acero, talleres de laminado y de acabado\n- la produccin de lingotes de hierro y fundicin especular en lingotes, bloques u otras formas primarias\n- la produccin de ferroaleaciones\n- la produccin de productos frreos por reduccin directa de hierro y otros productos frreos porosos; la produccin\nde hierro de una pureza excepcional por electrlisis y otros procesos qumicos\n- la refundicin en lingotes de desechos de hierro o acero\n- la produccin de hierro granulado y polvo de hierro\n- la produccin de acero en lingotes y otras formas primarias\n- la produccin de productos semielaborados de acero\n- la fabricacin de productos laminados en caliente o en fro de acero\n- la fabricacin de barras y varillas de acero laminadas en caliente\n- la fabricacin de angulares y perfiles de acero laminados en caliente\n- la fabricacin de tablestacas y de perfiles y angulares soldados de acero\n- la fabricacin de materiales de acero para vas frreas (rales sin ensamblar)\n',0,0),(274,'242','Fabricacin de tubos, tuberias, perfiles huecos  y sus accesorios, de acero',3,'24.2 Fabricacin de tubos, tuberas, perfiles huecos y sus accesorios, de acero\n',0,0),(275,'2420','Fabricacin de tubos, tuberias, perfiles huecos  y sus accesorios, de acero',4,'24.20 Fabricacin de tubos, tuberas, perfiles huecos y sus accesorios, de acero\nEsta clase comprende:\n- la fabricacin de tubos y tuberas sin soldadura de seccin transversal circular o no circular y de piezas de fundicin\nde seccin transversal circular, para su tratamiento posterior, mediante laminacin en caliente, extrusin en caliente\nu otros procesos en caliente de productos intermedios que pueden consistir en barras o tochos obtenidos mediante\nlaminacin en caliente o colada continua\n- la fabricacin de tubos y tuberas sin soldadura de precisin y de no precisin a partir de piezas laminadas o\nextrusionadas en caliente mediante el estirado o la laminacin en fro de tubos y tuberas de seccin transversal\ncircular, y el estirado en fro nicamente para los tubos y tuberas de seccin transversal no circular y perfiles huecos\n- la fabricacin de tubos y tuberas soldados de un dimetro externo superior a 406,4 mm, conformados en fro a\npartir de productos planos laminados en caliente y soldados longitudinalmente o en espiral\n- la fabricacin de tubos y tuberas soldados de un dimetro externo de 406,4 mm o menos de seccin transversal\ncircular mediante conformacin continua en fro o caliente de productos planos laminados en fro o en caliente y\nsoldados longitudinalmente o en espiral, y de seccin transversal no circular, mediante conformacin en caliente o\nen fro a partir de bandas laminadas en caliente o en fro y soldadas longitudinalmente\n- la fabricacin de tubos y tuberas soldados de precisin, de un dimetro externo de 406,4 mm o menos, mediante\nconformacin en caliente o en fro de bandas laminadas en caliente o en fro y soldadas longitudinalmente,\nsimplemente soldados o tratados mediante estirado, laminado o conformacin en fro de tubos y tuberas de seccin\ntransversal no circular\n- la fabricacin de bridas y bridas planas con collares forjados mediante el tratamiento de productos planos de acero\nlaminados en caliente\n- la fabricacin de juntas de soldadura, como codos y reducciones, mediante la forja de tubos de acero sin soldadura\nlaminados en caliente\n- juntas de rosca y otras juntas de soldadura de tubos y tuberas de acero\n',0,0),(276,'243','Fabricacin de otros productos de primera transformacin del acero',3,'24.3 Fabricacin de otros productos de primera transformacin del acero\nEste grupo comprende la fabricacin de otros productos mediante el procesado en fro del acero.\n',0,0),(277,'2431','Estirado en fro',4,'24.31 Estirado en fro\nEsta clase comprende:\n- la fabricacin de barras y perfi