mbin:\n- el trefilado de estos metales mediante estirado\n',0,0),(287,'2446','Procesamiento de combustibles nucleares',4,'24.46 Procesamiento de combustibles nucleares\nEsta clase comprende :\n- la fabricacin de metal de uranio a partir de pechblenda u otros minerales\n- la fundicin y el refinado de uranio\n',0,0),(288,'245','Fundicin de metales',3,'24.5 Fundicin de metales\nEste grupo comprende la fabricacin de productos semielaborados y fundiciones diversas mediante procesos de\nfundicin.\nEste grupo no comprende:\n- la fabricacin de productos de fundicin acabados, como:\n calderas y radiadores (vase 25.21)\n artculos de fundicin para el hogar (vase 25.99)\n',0,0),(289,'2451','Fundicin de hierro',4,'24.51 Fundicin de hierro\nEsta clase comprende las actividades de las fundiciones de hierro.\nEsta clase comprende:\n- la fundicin de productos semielaborados de hierro\n- la fundicin de piezas de moldeo de hierro\n- la fundicin de piezas de moldeo esferoidales de grafito\n- la fundicin de productos maleables de hierro fundido\n- la fabricacin de tubos, tuberas y perfiles huecos, y de accesorios para tubos y tuberas de hierro fundido\n',0,0),(290,'2452','Fundicin de acero',4,'24.52 Fundicin de acero\nEsta clase comprende las actividades de las fundiciones de acero.\nEsta clase comprende:\n- la fundicin de productos semielaborados de acero\n- la fundicin de piezas de moldeo de acero\n- la fabricacin de tubos y tuberas sin soldadura de acero mediante fundicin centrfuga\n- la fabricacin de accesorios para tubos y tuberas de acero fundido\n',0,0),(291,'2453','Fundicin de metales ligeros',4,'24.53 Fundicin de metales ligeros\nEsta clase comprende:\n- la fundicin de productos semielaborados de aluminio, magnesio, titanio, cinc, etc.\n- la fundicin de piezas de moldeo de metales ligeros\n',0,0),(292,'2454','Fundicin de otros metales no frreos',4,'24.54 Fundicin de otros metales no frreos\nEsta clase comprende:\n- la fundicin de piezas de moldeo metlicas pesadas\n- la fundicin