)\n- la fabricacin de pistolas de gas o aire comprimido\n- la fabricacin de municiones de guerra\nEsta clase comprende tambin:\n- la fabricacin de armas de fuego y municiones para la prctica deportiva o la defensa personal\n- la fabricacin de dispositivos explosivos como bombas, minas y torpedos\n',0,0),(304,'255','Forja, estampacin y embuticin de metales; metalurgia de polvos',3,'25.5 Forja, estampacin y embuticin de metales; metalurgia de polvos\nEste grupo comprende actividades generales para el tratamiento de metales, como la forja y la estampacin, que se\nrealizan habitualmente por cuenta de terceros.\n',0,0),(305,'2550','Forja, estampacin y embuticin de metales; metalurgia de polvos',4,'25.50 Forja, estampacin y embuticin de metales; metalurgia de polvos\nEsta clase comprende:\n- la forja, estampacin, embuticin y laminacin de metales\n- los trabajos de pulvimetalurgia: fabricacin de objetos elaborados a base de polvos metlicos por tratamiento\ntrmico (sinterizacin) o compresin\n',0,0),(306,'256','Tratamiento y revestimiento de metales; Ingeniera mecnica por cuenta de terceros',3,'25.6 Tratamiento y revestimiento de metales; ingeniera mecnica por cuenta de terceros\nEste grupo comprende actividades generales para el tratamiento de metales, como el chapado, el revestimiento, el\ngrabado, la perforacin, el pulido, la soldadura, etc., que se realizan habitualmente por cuenta de terceros.\n',0,0),(307,'2561','Tratamiento y revestimiento de metales',4,'25.61 Tratamiento y revestimiento de metales\nEsta clase comprende:\n- el chapado, la anodizacin, etc., de metales\n- el tratamiento trmico de metales\n- el desbarbado, la limpieza por chorro de arena, la limpieza en tambor giratorio, la limpieza de metales\n- la coloracin y el grabado de los metales\n- el revestimiento no metlico de metales:\n plastificacin, esmaltado, lacado, etc.\n- el endurecimiento y el pulido de metales\n',0,0),(308,'2562','Ingeniera mecnica por cuenta de terceros',4,'25.62 Ingeniera mecnica por cuenta de terceros\nEsta clase comprende:\n- la perforacin, el torneado, el fresado, la corrosin, el desbastado, la pulimentacin, el punzado, el nivelado, el\naserrado, el esmerilado, el afilado, el pulido, la soldadura, el empalme, etc., de piezas metlicas trabajadas\n- el corte de metales y la escritura sobre metal mediante rayos lser\n',0,0),(309,'257','Fabricacin de artculos de cuchillera y cubertera, herramientas y ferretera',3,'25.7 Fabricacin de artculos de cuchillera y cubertera, herramientas y ferretera\nEste grupo comprende la fabricacin de artculos de cuchillera y cubertera, herramientas y ferretera.\n',0,0),(310,'2571','Fabricacin de artculos de cuchillera y cubertera',4,NULL,0,0),(311,'2572','Fabricacin de cerraduras y herrajes',4,'25.72 Fabricacin de cerraduras y herrajes\nEsta clase comprende:\n- la fabricacin de candados, cerraduras, llaves, bisagras y otros artculos similares de ferretera para edificios,\nmuebles, vehculos, etc.\n',0,0),(312,'2573','Fabricacin de herramientas',4,'25.73 Fabricacin de herramientas\nEsta clase comprende:\n- la fabricacin de cuchillas y hojas cortantes para mquinas y aparatos mecnicos\n- la fabricacin de herramientas manuales, como alicates, destornilladores, etc.\n- la fabricacin de herramientas agrcolas manuales no elctricas\n- la fabricacin de sierras y hojas de sierra, incluidas las hojas de sierras circulares y de sierras de cadena\n- la fabricacin de tiles intercambiables para herramientas de mano, elctricas o no, y para mquinas herramientas:\nbrocas, punzones, fresas, etc.\n- la fabricacin de herramientas de herrero: forjas, yunques, etc.\n- la fabricacin de troqueles de estampacin\n- la fabricacin de cajas y moldes de fundicin (excepto lingoteras)\n- la fabricacin de tornillos de banco, abrazaderas\n',0,0),(313,'259','Fabricacin de otros productos metlicos',3,'25.9 Fabricacin de otros productos metlicos\nEste grupo comprende la fabricacin de productos metlicos diversos, como botes y baldes; puntas, pernos y\ntu