ntes electrnicos y circuitos impresos ensamblados',3,'26.1 Fabricacin de componentes electrnicos y circuitos impresos ensamblados\n',0,0),(321,'2611','Fabricacin de componentes electrnicos',4,'26.11 Fabricacin de componentes electrnicos\nEsta clase comprende la fabricacin de semiconductores y otros componentes para aplicaciones electrnicas.\nEsta clase comprende:\n- la fabricacin de capacitadores electrnicos\n- la fabricacin de resistencias electrnicas\n- la fabricacin de microprocesadores\n- la fabricacin de tubos electrnicos\n- la fabricacin de conectores electrnicos\n- la fabricacin de placas para circuitos impresos sin componentes ensamblados\n- la fabricacin de circuitos integrados (analgicos, digitales o hbridos)\n- la fabricacin de diodos, transistores y otros dispositivos discretos\n- la fabricacin de inductores (p. ej., limitadores de potencia, bobinas, transformadores), considerados como\ncomponentes electrnicos\n- la fabricacin de cristales electrnicos y ensamblajes de cristal\n- la fabricacin de solenoides, interruptores y transductores para aparatos electrnicos\n- la fabricacin de microplaquetas u obleas, semiconductores, acabados o semielaborados\n- la fabricacin de componentes de pantallas de visualizacin (plasma, polmeros, LCD)\n- la fabricacin de diodos emisores de luz (LED)\nEsta clase comprende tambin:\n- la fabricacin de cables de impresora y monitor, cables USB, conectores, etc.\n',0,0),(322,'2612','Fabricacin de circuitos impresos ensamblados',4,'26.12 Fabricacin de circuitos impresos ensamblados\nEsta clase comprende:\n- la fabricacin de placas de circuitos impresos con componentes ensamblados\n- El ensamblaje de componentes en placas de circuitos impresos\n- la fabricacin de tarjetas de interfaz (p. ej. sonido, vdeo, controladores, red, mdems)\n',0,0),(323,'262','Fabricacin de ordenadores y equipos perifricos',3,'26.2 Fabricacin de ordenadores y equipos perifricos\n',0,0),(324,'2620','Fabricacin de ordenadores y equipos perifricos',4,'26.20 Fabricacin de ordenadores y equipos perifricos\nEsta clase comprende la fabricacin y el montaje de ordenadores, como unidades centrales (mainframes),\nordenadores de sobremesa, ordenadores porttiles y servidores informticos, as como de perifricos, como los\ndispositivos de almacenamiento y de entrada y salida (impresoras, monitores, teclados). Los ordenadores pueden\nser analgicos, digitales o hbridos. Los digitales, que constituyen el tipo ms comn, son dispositivos que realizan la\ntotalidad de las siguientes tareas: (1) almacenan el programa o programas de procesamiento y los datos necesarios\npara la ejecucin del programa; (2) pueden programarse libremente con arreglo a los requisitos del usuario; (3)\nrealizan las operaciones aritmticas especificadas por el usuario; y (4) ejecutan, sin intervencin humana, un\nprograma de procesamiento que requiere que el ordenador modifique su ejecucin mediante decisiones lgicas\ndurante la operacin de procesamiento. Los ordenadores analgicos son capaces de simular modelos matemticos\ny constan, al menos, de un control analgico y elementos de programacin.\nEsta clase comprende:\n- la fabricacin de ordenadores de sobremesa\n- la fabricacin de ordenadores porttiles\n- la fabricacin de ordenadores centrales (mainframes)\n- la fabricacin de ordenadores de mano (p. ej., PDA)\n- la fabricacin de unidades de disco magnticas, unidades de memoria flash y otros dispositivos de almacenamiento\n- la fabricacin de unidades de disco pticas (p. ej., CD-RW, CD-ROM, DVD-ROM, DVD-RW)\n- la fabricacin de impresoras\n- la fabricacin de monitores\n- la fabricacin de teclados\n- la fabricacin de todo tipo de ratones, joysticks y accesorios trackball\n- la fabricacin de terminales informticos especializados\n- la fabricacin de servidores informticos\n- la fabricacin de escneres, incluidos los lectores de cdigos de barras\n- la fabricacin de lectores de tarjetas inteligentes\n- la fabricacin de cascos de realidad virtual\n- la fabricacin de proyectores informticos (proyectores de vdeo)\nEsta clase comprende tambin:\n- la fabricacin de terminales informticos, como los cajeros automticos (ATM), los terminales de punto de venta, no\noperados mecnicamente\n- la fabricacin de equipos ofimticos multifuncin que ejecutan dos o ms de las funciones siguientes: impresin,\nescaneado, copia, gestin de faxes\n',0,0),(325,'263','Fabricacin de equipos de telecomunicaciones',3,'26.3 Fabricacin de equipos de telecomunicaciones\n',0,0),(326,'2630','Fabricacin de equipos de telecomunicaciones',4,'26.30 Fabricacin de equipos de telecomunicaciones\nEsta clase comprende la fabricacin de equipos telefnicos y de transmisin de datos utilizados para transmitir\nseales electrnicamente a travs de cables, o a travs del aire como en el caso de los equipos de emisin de radio\ny televisin y de comunicacin inalmbrica.\nEsta clase comprende:\n- la fabricacin de equipos de conmutacin de centrales telefnicas\n- la fabricacin de telfonos inalmbricos\n- la fabricacin de equipos para centralitas privadas conectadas a la red pblica (PBX)\n- la fabricacin de equipos telefnicos y de fax, incluidos los contestadores automticos\n- la fabricacin de equipos de transmisin de datos, como puentes (bridges), enrutadores (routers) y puntos de\nacceso (gateways)\n- la fabricacin de antenas de transmisin y recepcin\n- la fabricacin de equipos de televisin por cable\n- la fabricacin de localizadores (buscapersonas)\n- la fabricacin de telfonos mviles\n- la fabricacin de equipos de comunicacin porttiles\n- la fabricacin de equipos de emisin y para estudios de radio y televisin, incluidas las cmaras de televisin\n- la fabricacin de mdems, equipos portadores\n- la fabricacin de sistemas de alarma antirrobo y antiincendios, que emiten seales a una central de control\n- la fabricacin de transmisores de radio y televisin\n- la fabricacin de dispositivos de comunicacin que utilizan seales infrarrojas (p. ej., mandos a distancia)\n',0,0),(327,'264','Fabricacin de productos electrnicos de consumo',3,'26.4 Fabricacin de productos electrnicos de consumo\n',0,0),(328,'2640','Fabricacin de productos electrnicos de consumo',4,'26.40 Fabricacin de productos electrnicos de consumo\nEsta clase comprende la fabricacin de equipos electrnicos de audio y vdeo para el ocio domstico, los vehculos\nde motor, los sistemas de megafona y la amplificacin de instrumentos musicales.\nEsta clase comprende:\n- la fabricacin de aparatos de grabacin y duplicacin de cintas de vdeo\n- la fabricacin de televisiones\n- la fabricacin de monitores y pantallas de televisin\n- la fabricacin de sistemas de grabacin y duplicacin de sonido\n- la fabricacin de equipos estereofnicos\n- la fabricacin de receptores de radio\n- la fabricacin de sistemas de altavoces\n- la fabricacin de videocmaras de uso domstico\n- la fabricacin de mquinas de discos (jukeboxes)\n- la fabricacin de amplificadores para instrumentos musicales y sistemas de megafona\n- la fabricacin de micrfonos\n -la fabricacin de reproductores de CD y de DVD\n- la fabricacin de equipos de karaoke\n- la fabricacin de auriculares (p. ej., para radio, equipos estereofnicos, ordenador)\n- la fabricacin de consolas de videojuegos\n',0,0),(329,'265','Fabricacin de instrumentos y aparatos de medida, verificacin y navegacin; fabricacin de relojes',3,'26.5 Fabricacin de instrumentos y aparatos de medida, verificacin y navegacin; fabricacin de relojes\nEste grupo comprende la fabricacin de equipos de medida, verificacin y navegacin para diversos fines\nindustriales y no industriales, incluidos los dispositivos de medicin en funcin del tiempo como relojes y aparatos\nafines.\n',0,0),(330,'2651','Fabricacin de instrumentos y aparatos de medida, verificacin y navegacin',4,'26.51 Fabricacin de instrumentos y aparatos de medida, verificacin y navegacin\nEsta clase comprende la fabricacin de sistemas e instrumentos de bsqueda, deteccin, navegacin, orientacin,\naeronuticos y nuticos; reguladores y controles automticos para aplicaciones, como la calefaccin, el aire\nacondicionado, la refrigeracin y diversos electrodomsticos; instrumentos y dispositivos para medir, visualizar,\nindicar, registrar, transmitir y controlar la temperatura, humedad, presin, vaco, combustin, flujo, nivel, viscosidad,\ndensidad, acidez, concentracin o rotacin; contadores y medidores de fluidos de totalizacin (es decir, de registro);\ninstrumentos para la medicin y la comprobacin de las caractersticas de la electricidad y las seales elctricas;\ninstrumentos y sistemas de instrumentacin para el anlisis de laboratorio de la concentracin o la composicin\nqumica o fsica de muestras de materiales slidos, lquidos, gaseosos o compuestos; otros instrumentos de\nmedicin y comprobacin y partes de los mismos.\nEsta categora comprende la fabricacin de equipos de medida verificacin y navegacin no elctricos (excepto las\nherramientas mecnicas simples).\nEsta clase comprende:\n- la fabricacin de instrumentos para motores de aviacin\n- la fabricacin de equipos de comprobacin de emisiones de gases de automocin\n- la fabricacin de instrumentos meteorolgicos\n- la fabricacin de equipos de comprobacin e inspeccin de las propiedades fsicas\n- la fabricacin de polgrafos\n- la fabricacin de instrumentos de deteccin y vigilancia de radiaciones\n- la fabricacin de instrumentos de geodesia\n- la fabricacin de termmetros de vidrio relleno de lquido y bimetlicos (excepto de uso mdico)\n- la fabricacin de higrostatos\n- la fabricacin de controles de lmite hidrnico\n- la fabricacin de controles de llama y de quemadores\n- la fabricacin de espectrmetros\n- la fabricacin de comparadores de aire comprimido\n- la fabricacin de contadores de consumo (p. ej., agua, gas, electricidad)\n- la fabricacin de caudalmetros y contadores de suministro\n- la fabricacin de totalizadores\n- la fabricacin de detectores de minas, generadores de impulsos (seales); detectores de metal\n- la fabricacin de equipos de bsqueda, deteccin, navegacin, aeronuticos y nuticos, incluidas sonoboyas\n- la fabricacin de dispositivos GPS\n- la fabricacin de controles medioambientales y controles automticos para diversos aparatos\n- la fabricacin de equipos de medicin y registro (p. ej., registradores de parmetros de vuelo)\n- la fabricacin de detectores de movimiento\n- la fabricacin de radares\n- la fabricacin de instrumentos analticos de laboratorio (p. ej., equipos para anlisis de sangre)\n- la fabricacin de platillos, balanzas, incubadoras y otros aparatos de laboratorio para medicin, comprobacin, etc.\n',0,0),(331,'2652','Fabricacin de relojes',4,'26.52 Fabricacin de relojes\nEsta clase comprende la fabricacin de relojes y crongrafos, as como de partes de los mismos.\nEsta clase comprende:\n- la fabricacin de relojes de todas clases, incluidos los relojes de cuadros de instrumentos\n- la fabricacin de cajas de relojes, incluidas las de metales preciosos\n- la fabricacin de equipos de contadores de tiempo y de aparatos para medir, registrar u otras formas de indicar\nintervalos de tiempo con un mecanismo de relojera o un motor sincrnico, como\n parqumetros\n relojes registradores\n sellos de fecha y hora\n contadores de minutos\n- la fabricacin de temporizadores y otros dispositivos con un mecanismo de relojera o un motor sincrnico:\n cerraduras temporizadas\n- la fabricacin de piezas sueltas de relojera:\n mecanismos de relojera de todo tipo\n muelles, ranguas, esferas, manecillas, platinas, puentes y otras piezas\n cajas de relojes de todo tipo de materiales\n',0,0),(332,'266','Fabricacin de equipos de radiacin, electromdicos y electroteraputicos',3,'26.6 Fabricacin de equipos de radiacin, electromdicos y electroteraputicos\n',0,0),(333,'2660','Fabricacin de equipos de radiacin, electromdicos y electroteraputicos',4,'26.60 Fabricacin de equipos de radiacin, electromdicos y electroteraputicos\nEsta clase comprende:\n- la fabricacin de aparatos y tubos de radiacin (p. ej., para uso industrial, diagnstico mdico, para uso teraputico,\npara 