lectrodomsticos',4,'27.51 Fabricacin de electrodomsticos\nEsta clase comprende:\n- la fabricacin de mquinas, aparatos y dispositivos domsticos elctricos:\n frigorficos\n congeladores\n lavavajillas\n lavadoras y secadoras\n aspiradoras\n enceradoras de suelos\n trituradoras de basura\n picadoras, licuadoras, exprimidores\n abrelatas\n afeitadoras elctricas, cepillos de dientes elctricos y otros aparatos elctricos de higiene personal\n afiladores\n campanas de ventilacin o reciclaje\n- la fabricacin de aparatos electrotrmicos de uso domstico:\n calentadores de agua elctricos\n mantas elctricas\n secadores, peines, cepillos y rizadores elctricos\n planchas elctricas\n calefactores y ventiladores domsticos porttiles\n hornos elctricos\n hornos de microondas\n cocinas, placas elctricas\n tostadoras\n cafeteras y teteras\n sartenes, asadores, parrillas, campanas\n resistencias elctricas para calefaccin, etc.\n',0,0),(352,'2752','Fabricacin de aparatos domsticos no elctricos',4,'27.52 Fabricacin de aparatos domsticos no elctricos\nEsta clase comprende:\n- la fabricacin de aparatos domsticos no elctricos para calefaccin y cocina:\n aparatos no elctricos para calefaccin, hornillos, hornos, estufas, calentadores de agua, aparatos para cocina y\ncalientaplatos no elctricos\n',0,0),(353,'279','Fabricacin de otro material y equipo elctrico',3,'27.9 Fabricacin de otro material y equipo elctrico\n',1,1),(354,'2790','Fabricacin de otro material y equipo elctrico',4,'27.90 Fabricacin de otro material y equipo elctrico\nEsta clase comprende la fabricacin de aparatos elctricos diversos, con excepcin de motores, generadores y\ntransformadores, bateras y acumuladores, cables y dispositivos de cableado, equipos de iluminacin y aparatos\ndomsticos.\nEsta clase comprende:\n- la fabricacin de cargadores de batera de estado slido\n- la fabricacin de dispositivos elctricos de apertura y cierre de puertas\n- la fabricacin de timbres elctricos\n- la fabricacin de cables de extensin elaborados 