ricacin de maquinaria de lavandera:\n planchas, incluidas las de prensado\n lavadoras y secadoras industriales\n mquinas para la limpieza en seco\n- la fabricacin de mquinas de coser y de agujas de coser y cabezas para las mismas (sean o no para uso\ndomstico)\n- la fabricacin de maquinaria para la fabricacin y el acabado del fieltro o telas no tejidas\n- la fabricacin de mquinas para la industria del cuero:\n mquinas y aparatos para la preparacin, el curtido y el trabajo de los cueros y pieles\n mquinas y aparatos para la fabricacin o reparacin de calzado u otras manufacturas de cuero, piel o peletera\n',0,0),(379,'2895','Fabricacin de maquinaria para la industria del papel y del cartn',4,'28.95 Fabricacin de maquinaria para la industria del papel y del cartn\nEsta clase comprende:\n- la fabricacin de maquinaria empleada en la elaboracin de pasta de papel\n- la fabricacin de maquinaria empleada en la elaboracin de papel y cartn\n- la fabricacin de maquinaria empleada en la produccin de artculos de papel o de cartn\n',0,0),(380,'2896','Fabricacin de maquinaria para las industrias del plstico y del caucho',4,'28.96 Fabricacin de maquinaria para la industria del plstico y el caucho\nEsta clase comprende:\n- la fabricacin de maquinaria para trabajar el caucho y las materias plsticas o para la fabricacin de manufacturas\nde dichas materias:\n extrusoras, moldeadoras, mquinas para la fabricacin o el recauchutado de neumticos, y otras mquinas y\naparatos concebidos para fabricar productos determinados de caucho o de materias plsticas\n',0,0),(381,'2899','Fabricacin de otra maquinaria para usos especficos n.c.o.p.',4,'28.99 Fabricacin de otra maquinaria para usos especficos n.c.o.p.\nEsta clase comprende la fabricacin de maquinaria para usos especficos no clasificada en otros apartados.\nEsta clase comprende:\n- la fabricacin de secadoras de madera, pasta papelera, papel o cartn y otros materiales (excepto productos\nagrcolas y textiles)\n- la fabricacin de mquinas para im