adquiridos en paneles de instrumentos, reguladores de voltaje, etc.\n',0,0),(389,'2932','Fabricacin de otros componentes, piezas y accesorios para vehculos de motor',4,'29.32 Fabricacin de otros componentes, piezas y accesorios para vehculos de motor\nEsta clase comprende:\n- la fabricacin de diversas piezas y accesorios para vehculos de motor:\n frenos, cajas de cambios, ejes, ruedas, amortiguadores de suspensin, radiadores, silenciadores, tubos de\nescape, catalizadores, embragues, volantes, columnas de direccin y cajas de direccin\n- la fabricacin de piezas y accesorios de carroceras para vehculos de motor:\n cinturones de seguridad, airbags, puertas, parachoques\n- la fabricacin de asientos para vehculos\n',0,0),(390,'30','Fabricacin de otro material de transporte',2,'30 Fabricacin de otro material de transporte\nEsta divisin comprende la fabricacin de equipos de transporte, como la construccin de buques y otras\nembarcaciones, la fabricacin de locomotoras y de material rodante para ferrocarriles, y la fabricacin de aeronaves\ny naves espaciales y de componentes para las mismas.\n',1,1),(391,'301','Construccin naval',3,'30.1 Construccin naval\nEste grupo comprende la construccin de barcos y otras estructuras flotantes para el transporte y otros fines\ncomerciales, as como para actividades deportivas y recreativas.\n',0,0),(392,'3011','Construccin de barcos y estructuras flotantes',4,'30.11 Construccin de barcos y estructuras flotantes\nEsta clase comprende la construccin de buques, excepto embarcaciones para deporte o recreo, y la construccin\nde estructuras flotantes.\nEsta clase comprende:\n- la construccin de buques de uso comercial:\n buques de pasajeros, transbordadores, buques cargueros, buques cisterna, remolcadores, etc.\n- la construccin de buques de guerra\n- la construccin de pesqueros y buques-factora\nEsta clase comprende tambin:\n- la construccin de aerodeslizadores (excepto aerodeslizadores de recreo)\n- la construccin de plataformas de perforacin