equipo mecnico y electromecnico de sealizacin, seguridad y control del trfico para\nferrocarriles, tranvas, carreteras, vas de navegacin interiores, aparcamientos, aeropuertos, etc.\n- la fabricacin de asientos para vagones ferroviarios\n',0,0),(396,'303','Construccin aeronutica y espacial y su maquinaria',3,'30.3 Construccin aeronutica y espacial y su maquinaria\n',1,1),(397,'3030','Construccin aeronutica y espacial y su maquinaria',4,'30.30 Construccin aeronutica y espacial y su maquinaria\nEsta clase comprende:\n- la construccin de aeronaves para el transporte de mercancas o pasajeros o para fines militares, deportivos u\notros\n- la construccin de helicpteros\n- la construccin de planeadores, alas delta\n- la construccin de dirigibles y globos de aire caliente\n- la fabricacin de piezas y accesorios de aeronaves de esta clase:\n elementos principales tales como fuselajes, alas, puertas, tableros de mando, trenes de aterrizaje, depsitos de\ncombustible, gndolas, etc.\n hlices de uso aeronutico, rotores de helicpteros y palas para rotores\n motores de uso aeronutico\n componentes de turborreactores y turbohlices para aeronaves\n- la fabricacin de aparatos para prcticas de vuelo en tierra\n- la construccin de naves espaciales y sus vehculos de lanzamiento, satlites, sondas planetarias, estaciones\norbitales, transbordadores espaciales\n- la fabricacin de misiles balsticos intercontinentales\nEsta clase comprende tambin:\n- la revisin o transformacin de aeronaves y motores de aeronaves\n- la fabricacin de asientos para aeronaves\n',1,1),(398,'304','Fabricacin de vehculos militares de combate',3,'30.4 Fabricacin de vehculos militares de combate\n',0,0),(399,'3040','Fabricacin de vehculos militares de combate',4,'30.40 Fabricacin de vehculos militares de combate\nEsta clase comprende:\n- la fabricacin de carros de combate\n- la fabricacin de vehculos militares anfibios blindados\n- la fabricacin de otros vehculos militares de combate\n',0,0),(400,'309','Fabricacin de material de transporte n.c.o.p.',3,'30.9 Fabricacin de otro material de transporte n.c.o.p.\nEste grupo comprende la fabricacin de material de transporte distinto de los vehculos de motor, los equipos de\ntransporte ferroviario, por agua, areo o espacial y los vehculos militares.\n',0,0),(401,'3091','Fabricacin de motocicletas',4,'30.91 Fabricacin de motocicletas\nEsta clase comprende:\n- la fabricacin de motocicletas, ciclomotores y vehculos similares equipados con motor\n- la fabricacin de motores para motocicletas\n- la fabricacin de sidecares\n- la fabricacin de piezas y accesorios de motocicletas\n',0,0),(402,'3092','Fabricacin de bicicletas y de vehculos para personas con discapacidad',4,'30.92 Fabricacin de bicicletas y de vehculos para personas con discapacidad\nEsta clase comprende:\n- la fabricacin de bicicletas no motorizadas y de vehculos similares, incluidos triciclos (de reparto), tndems, y\nbicicletas y triciclos para nios\n- la fabricacin de piezas y accesorios de bicicletas\n- la fabricacin de vehculos, con o sin motor, para discapacitados\n- la fabricacin de piezas y accesorios de vehculos para discapacitados\n- la fabricacin de carritos para nios\n',0,0),(403,'3099','Fabricacin de otro material de transporte n.c.o.p.',4,'30.99 Fabricacin de otro material de transporte n.c.o.p.\nEsta clase comprende:\n- la fabricacin de vehculos impulsados a mano: carritos para equipaje, carros de mano, trineos, carritos para\nsupermercados, etc.\n- la fabricacin de vehculos de traccin animal: sulkys, carretas, carruajes, etc.\n',0,0),(404,'31','Fabricacin de muebles',2,'31 Fabricacin de muebles\nEsta divisin comprende la fabricacin de muebles y productos afines de cualquier material, excepto piedra,\nhormign y cermica. Los procesos utilizados en la fabricacin de muebles son mtodos estndar de elaboracin de\nmateriales y montaje de componentes, incluidos los de corte, moldeo y laminacin. El diseo del artculo, para la\nconsecucin de cualidades tanto estticas como funcionales, constituye un aspecto importante del proceso de\nproduccin.\nAlgunos de los procesos empleados en la fabricacin de muebles son similares a los utilizados en otros segmentos\nde la manufactura. Por ejemplo, se llevan a cabo tareas de corte y montaje en la produccin de vigas trianguladas de\nmadera, que se clasifica en la divisin 16 (Industria de la madera). Sin embargo, el conjunto de procesos aplicados\ndistinguen la fabricacin de muebles de madera de la de productos de la madera. Del mismo modo, en la fabricacin\nde mobiliario metlico se utilizan tcnicas empleadas igualmente en la fabricacin de productos laminados\nclasificados en la divisin 25 (Fabricacin de productos metlicos). El proceso de moldeo del mobiliario de material\nplstico es similar al que se aplica a otros productos de plstico. Sin embargo, la fabricacin de este tipo de muebles\ntiende a ser una actividad especializada.\n',0,0),(405,'310','Fabricacin de muebles',3,'31.0 Fabricacin de muebles\n',0,0),(406,'3101','Fabricacin de muebles de oficina y de establecimientos comerciales',4,'31.01 Fabricacin de muebles de oficina y de establecimientos comerciales\nEn esta clase se incluye la fabricacin de muebles de todo tipo, de cualquier material (excepto piedra, hormign y\ncermica) para cualquier lugar y para diversos usos.\nEsta clase comprende:\n- la fabricacin de sillas y asientos para oficinas, talleres, hoteles, restaurantes y locales pblicos\n- la fabricacin de sillas y asientos para teatros, cines y similares\n- la fabricacin de mobiliario especial para establecimientos comerciales: mostradores, aparadores, estanteras, etc.\n- la fabricacin de muebles de oficina\n- la fabricacin de bancos, taburetes y otros asientos para laboratorio, mobiliario de laboratorio (p. ej., armarios y\nmesas)\n- la fabricacin de muebles para iglesias, centros de enseanza y restaurantes\nEsta clase comprende tambin:\n- la fabricacin de carritos decorativos para restaurantes, como carritos de postres\n',0,0),(407,'3102','Fabricacin de muebles de cocina',4,'31.02 Fabricacin de muebles de cocina\nEsta clase comprende:\n- la fabricacin de mobiliario de cocina\n',0,0),(408,'3103','Fabricacin de colchones',4,'31.03 Fabricacin de colchones\nEsta clase comprende:\n- la fabricacin de colchones:\n colchones de muelles o colchones rellenos o guarnecidos interiormente de cualquier material\n colchones de caucho celular sin cubrir o de materias plsticas\n- la fabricacin de soportes para colchones\n',0,0),(409,'3109','Fabricacin de otros muebles',4,'31.09 Fabricacin de otros muebles\nEsta clase comprende:\n- la fabricacin de sofs, sofs cama y tresillos\n- la fabricacin de sillas y otros asientos para jardn\n- la fabricacin de muebles de dormitorio, saln, jardn, etc.\n- la fabricacin de armarios para mquinas de coser, televisiones, etc.\nEsta clase comprende tambin:\n- los acabados de mobiliario tales como el tapizado de sillas y asientos\n- los acabados de muebles, como lacado, pintado, barnizado con muequilla y tapizado\n',0,0),(410,'32','Otras industrias manufactureras',2,'32 Otras industrias manufactureras\nEsta divisin comprende la fabricacin de diversos artculos no incluidos en otras partidas de la clasificacin. Puesto\nque se trata de una divisin residual, los procesos de produccin, los materiales y el uso de los bienes producidos\npueden variar ampliamente, y no se han aplicado aqu los criterios habituales para agrupar clases en divisiones.\n',0,0),(411,'321','Fabricacin de artculos de joyera, bisutera y similares',3,'32.1 Fabricacin de artculos de joyera, bisutera y similares\nEste grupo comprende la fabricacin de artculos de joyera y de bisutera.\n',0,0),(412,'3211','Fabricacin de monedas',4,'32.11 Fabricacin de monedas\nEsta clase comprende:\n- la fabricacin de monedas, incluida las de curso legal, de metales preciosos o no preciosos\n',0,0),(413,'3212','Fabricacin de artculos de joyera y artculos similares',4,'32.12 Fabricacin de artculos de joyera y artculos similares\nEsta clase comprende:\n- la produccin de perlas trabajadas\n- produccin de piedras preciosas y semipreciosas labradas. Se incluye la produccin de piedras de calidad\nindustrial y de piedras preciosas y semipreciosas sintticas y reconstruidas\n- la talla de diamantes\n- la fabricacin de artculos de joyera de metales preciosos, o de metales comunes chapados con metales\npreciosos, de piedras preciosas o semipreciosas, o de combinaciones de metales preciosos y piedras preciosas o\nsemipreciosas u otros materiales\n- la fabricacin de artculos de orfebrera de materiales preciosos, o de metales comunes chapados con metales\npreciosos:\n servicios de mesa, cuberteras, artculos de tocador, artculos de escritorio o de oficina, artculos para el culto\nreligioso, etc.\n- la fabricacin de artculos de uso tcnico y de laboratorio elaborados con metales preciosos (excepto instrumentos\ny piezas de instrumentos): crisoles, esptulas, nodos de galvanoplastia, etc.\n- la fabricacin de correas de reloj, pulseras y pitilleras de metales preciosos\nEsta clase comprende tambin:\n- el grabado de productos personales de metales preciosos y no preciosos\n',0,0),(414,'3213','Fabricacin de artculos de bisutera y artculos similares',4,'32.13 Fabricacin de artculos de bisutera y artculos similares\nEsta clase comprende:\n- la fabricacin de bisutera:\n anillos, pulseras, collares y artculos similares de joyera fabricados de metales comunes chapados con metales\npreciosos\n artculos de joyera que contienen piedras de imitacin, como gemas y diamantes de imitacin, y similares\n- la fabricacin de correas de relojes de metal (excepto metales preciosos)\n',0,0),(415,'322','Fabricacin de instrumentos musicales',3,'32.2 Fabricacin de instrumentos musicales\n',0,0),(416,'3220','Fabricacin de instrumentos musicales',4,'32.20 Fabricacin de instrumentos musicales\nEsta clase comprende:\n- la fabricacin de instrumentos de cuerda\n- la fabricacin de instrumentos de cuerda con teclado, incluidos los pianos automticos\n- la fabricacin de rganos de tubos, armonios y otros instrumentos similares de teclado y lengetas metlicas libres\n- la fabricacin de acordeones y otros instrumentos similares, incluidas las armnicas\n- la fabricacin de instrumentos de viento\n- la fabricacin de instrumentos musicales de percusin\n- la fabricacin de instrumentos musicales cuyo sonido se produce electrnicamente\n- la fabricacin de cajas de msica, organillos, calopes, etc.\n- la fabricacin de piezas y accesorios de instrumentos:\n metrnomos, diapasones, tarjetas, discos y rollos para instrumentos mecnicos automticos, etc.\nEsta clase comprende tambin:\n- la fabricacin de silbatos, cornetas y otros instrumentos de viento para seales\n',0,0),(417,'323','Fabricacin de artculos de deporte',3,'32.3 Fabricacin de artculos de deporte\n',0,0),(418,'3230','Fabricacin de artculos de deporte',4,'32.30 Fabricacin de artculos de deporte\nEsta clase comprende la fabricacin de artculos de deporte (excepto prendas de vestir y calzado).\nEsta clase comprende:\n- la fabricacin de artculos y equipos de deporte, juegos al aire libre y en recintos cerrados, de cualquier material:\n pelotas duras, blandas e hinchables\n raquetas, bates y palos\n esques, fijaciones para esques y bastones\n botas de esqu\n tablas de vela y de surf\n aparejos para la pesca deportiva, incluidos los salabres\n artculos para la caza, la escalada, etc.\n guantes y gorros de deporte de cuero\n piletas para piscinas, etc.\n patines de hielo y de ruedas, etc.\n arcos y ballestas\n aparatos de gimnasia, musculacin y atletismo\n',0,0),(419,'324','Fabricacin de juegos y juguetes',3,'32.4 Fabricacin de juegos y juguetes\n',0,0),(420,'3240','Fabricacin de juegos y juguetes',4,'32.40 Fabricacin de juegos y juguetes\nEsta clase comprende la fabricacin de muecos, juguetes y juegos (incluidos los juegos electrnicos), maquetas y\nvehculos para nios (excepto bicicletas y triciclos metlicos).\nEsta clase comprende:\n- la fabricacin de muecos y vestidos, componentes y accesorios para muecos\n- la fabricacin de figuras articuladas\n- la fabricacin de animales de juguete\n- la fabricacin de instrumentos musicales de juguete\n- la fabricacin de naipes\n- la fabricacin de juegos de mesa y similares\n- la fabricacin de juegos electrnicos: ajedrez, etc.\n- la fabricacin de maquetas y modelos a escala reducida similares, trenes elctricos, juegos de construccin, etc.\n- la fabricacin de juegos accionados con monedas, mesas de billar, mesas de juego de casino, etc.\n- la fabricacin de artculos para juegos de sociedad y juegos de feria\n- la fabricacin de juguetes con ruedas diseados para montar en ellos, incluidas bicicletas y triciclos de plstico\n- la fabricacin de rompecabezas y artculos similares\n',0,0),(421,'325','Fabricacin de instrumentos y suministros mdicos y odontolgicos',3,'32.5 Fabricacin de instrumentos y suministros mdicos y odontolgicos\n',0,0),(422,'3250','Fabricacin de instrumentos y suministros mdicos y odontolgicos',4,'32.50 Fabricacin de instrumentos y suministros mdicos y odontolgicos\nEsta clase comprende la fabricacin de aparatos de laboratorio, instrumental quirrgico y mdico, aparatos y\nsuministros quirrgicos, equipos y suministros para odontologa, artculos y aparatos de ortodoncia, y dentaduras\npostizas. Tambin est incluida la fabricacin de mobiliario de uso mdico, odontolgico y similares, en los que las\nfuncionalidades especficas aadidas determinan su uso, como las sillas de dentista que incorporan funcionalidades\nhidrulicas.\nEsta clase comprende:\n- la fabricacin de sbanas quirrgicas e hilos y gasas estriles\n- la fabricacin de productos de obturacin dental y cemento dental (excepto adhesivos para dentaduras postizas),\ncera dental y otros preparados de yeso dental\n- la fabricacin de cementos para la reconstruccin de huesos\n- la fabricacin de hornos de laboratorio dental\n- la fabricacin de equipos de limpieza por ultrasonido de laboratorio\n- la fabricacin de esterilizadores de laboratorio\n- la fabricacin de aparatos de destilacin y centrifugadoras de laboratorio\n- la fabricacin de mobiliario de uso mdico, quirrgico, odontolgico o veterinario, como por ejemplo:\n mesas de operaciones\n mesas de reconocimiento\n camas hospitalarias con accesorios mecnicos\n sillas de dentista\n- la fabricacin de placas y tornillos para huesos, jeringas, agujas, catteres, cnulas, etc.\n- la fabricacin de instrumental odontolgico (incluidas sillas de dentista que incorporan equipo odontolgico)\n- la fabricacin de piezas dentales artificiales, puentes, etc. realizada en laboratorios odontolgicos\n- la fabricacin de aparatos ortopdicos y prtesis\n- la fabricacin de ojos de cristal\n- la fabricacin de termmetros mdicos\n- la fabricacin de artculos oftlmicos, gafas, gafas de sol, lentillas graduadas, lentes de contacto, gafas de\nseguridad\n',0,0),(423,'329','Industrias manufactureras n.c.o.p.',3,'32.9 Industrias manufactureras n.c.o.p.\n',0,0),(424,'3291','Fabricacin de escobas, brochas y cepillos',4,'32.91 Fabricacin de escobas, brochas y cepillos\nEsta clase comprende:\n- la fabricacin de escobas, brochas y cepillos (incluidas las escobillas que constituyen elementos de maquinaria),\nbarredoras de suelo mecnicas para operacin manual, fregonas, plumeros, brochas, rodillos para pintar, escobillas\nlimpiacristales de caucho y otros cepillos, escobas, mopas, etc.\n- la fabricacin de cepillos para la ropa y el calzado\n',0,0),(425,'3299','Otras industrias manufactureras n.c.o.p.',4,'32.99 Otras industrias manufactureras n.c.o.p.\nEsta clase comprende:\n- la fabricacin de equipos protectores de seguridad\n la fabricacin de prendas ignfugas y prendas protectoras de seguridad\n la fabricacin de cinturones de suspensin y otros cinturones para uso profesional\n la fabricacin de salvavidas de corcho\n la fabricacin de cascos de plstico y otro equipo de seguridad personal de plstico (p. ej., cascos para\nactividades deportivas)\n la fabricacin de ropa de proteccin para la extincin de incendios\n la fabricacin de cascos metlicos de seguridad y otros dispositivos personales metlicos de seguridad\n la fabricacin de tapones para los odos y la nariz (p. ej., para la prctica de la natacin y la proteccin frente a\nruidos)\n la fabricacin de mscaras de gas\n- la fabricacin de plumas y lpices de todas clases, sean o no mecnicos\n- la fabricacin de minas de lpiz\n- la fabricacin de sellos, numeradores, fechadores, artculos para la impresin o la grabacin manual de etiquetas,\naparatos para la estampacin a mano de textiles, cintas entintadas para mquinas de escribir y tampones\nimpregnados\n- la fabricacin de globos terrqueos\n- la fabricacin de paraguas, sombrillas, bastones, asientos plegables porttiles\n- la fabricacin de botones, corchetes, cierres automticos, broches, cierres de cremallera\n- la fabricacin de encendedores\n- la fabricacin de artculos de uso personal: la fabricacin de pipas, peines, pasadores y artculos similares,\npulverizadores de tocador, termos y recipientes similares de uso domstico o personal, pelucas, barbas y cejas\npostizas, etc.\n- la fabricacin de artculos diversos: velas, cirios y artculos similares, frutas y flores artificiales, artculos de broma y\nartculos promocionales y de regalo, coladores y tamices de mano, maniques para modistos, atades, etc.\n- la fabricacin de centros de flores, ramos, coronas y artculos similares\n- las actividades de taxidermia\n',0,0),(426,'33','Reparacin e instalacin de maquinaria y equipo',2,'33 Reparacin e instalacin de maquinaria y equipo\nEsta divisin comprende la reparacin especializada de bienes producidos en el sector manufacturero con el objetivo\nde procurar que la maquinaria, los equipos y otros productos vuelvan a funcionar. Se incluye asimismo la provisin\nde servicios de mantenimiento general o rutinario de estos productos para garantizar un funcionamiento eficaz y\nevitar las averas y las reparaciones innecesarias.\nEsta divisin slo comprende las actividades de reparacin y mantenimiento especializadas. Una parte sustancial de\nlas reparaciones son efectuadas asimismo por los fabricantes de maquinaria, equipos y otros productos, en cuyo\ncaso, la clasificacin de las unidades dedicadas a estas actividades de reparacin y fabricacin se lleva a cabo de\nconformidad con el principio de valor aadido, que dar lugar con frecuencia a la asignacin de estas actividades\ncombinadas a la fabricacin de artculos. El mismo principio se aplica a la actividad combinada de comercio y\nreparacin.\nLa reconstruccin o refabricacin de maquinaria y equipos se considera una actividad de fabricacin y se clasifica en\notras divisiones de esta seccin.\nLa reparacin y el mantenimiento de artculos que pueden ser utilizados como bienes de capital y como bienes de\nconsumo suele clasificarse como reparacin y mantenimiento de enseres domsticos (p. ej., reparacin de mobiliario\nde oficina y domstico, vase 95.24).\nSe incluye asimismo en esta divisin la instalacin especializada de maquinaria. No obstante, la instalacin de\nequipos que constituyen una parte integral de edificios o estructuras similares, como la instalacin de cableado\nelctrico, escaleras mecnicas o sistemas de aire acondicionado, se clasifica como construccin.\nEsta divisin no comprende:\n- la limpieza de maquinaria industrial (vase 81.22)\n- la reparacin y el mantenimiento de ordenadores y equipos de comunicacin (vase 95.1)\n- la reparacin y el mantenimiento de enseres domsticos (vase 95.2)\n',0,0),(427,'331','Reparacin de productos metlicos, maquinaria y equipo',3,'33.1 Reparacin de productos metlicos, maquinaria y equipo\nEste grupo comprende la reparacin especializada de bienes producidos en el sector manufacturero con el objetivo\nde procurar que estos productos metlicos, maquinaria y equipos vuelvan a funcionar. Se incluye asimismo la\nprovisin de servicios de mantenimiento general o rutinario de tales productos para garantizar un funcionamiento\neficaz y evitar las averas y las reparaciones innecesarias.\nEste grupo no comprende:\n- la reconstruccin o refabricacin de maquinaria y equipos (vase la clase correspondiente en las divisiones 25 a\n',0,0),(428,'3311','Reparacin de productos metlicos',4,'33.11 Reparacin de productos metlicos\nEsta clase comprende la reparacin y el mantenimiento de los productos metlicos de la divisin 25.\nEsta clase comprende:\n- la reparacin de cisternas, grandes depsitos y contenedores de metal\n- la reparacin y el mantenimiento de tubos y tuberas\n- la reparacin mediante soldadura mvil\n- la reparacin de bidones y toneles de acero\n- la reparacin y el mantenimiento de generadores de vapor de agua y otros generadores de vapor\n- la reparacin y el mantenimiento de aparatos auxiliares para generadores de vapor:\n condensadores, economizadores, recalentadores y acumuladores de vapor\n- la reparacin y el mantenimiento de reactores nucleares, excepto separadores de istopos\n- la reparacin y el mantenimiento de piezas para calderas marinas y de potencia\n- la reparacin de chapa de radiadores y calderas para la calefaccin central\n- la reparacin y el mantenimiento de armas de fuego y municin (incluida la reparacin de armas para actividades\ndeportivas y recreativas)\n- la reparacin y el mantenimiento de carros de supermercado\n',0,0),(429,'3312','Reparacin de maquinaria',4,'33.12 Reparacin de maquinaria\nEsta clase comprende la reparacin y el mantenimiento de maquinaria y equipo industrial, como el afilado o la\ninstalacin de hojas y sierras en maquinaria de uso industrial y profesional, o la provisin de servicios de reparacin\nmediante soldadura (p. ej., de automviles); la reparacin de maquinaria y equipos agrcolas, as como de otra\nmaquinaria y equipos pesados e industriales (p. ej., carretillas elevadoras y otros equipos de manejo de materiales,\nmquinas herramienta, equipos de refrigeracin industrial, equipos de construccin y maquinaria de industrias\nextractivas), incluidos la maquinaria y los equipos de la divisin 28.\nEsta clase comprende:\n- la reparacin y el mantenimiento de motores, excepto de automocin\n- la reparacin y el mantenimiento de bombas, compresores y equipos anlogos\n- la reparacin de vlvulas\n- la reparacin de rganos mecnicos de transmisin\n- la reparacin y el mantenimiento de hornos de procesos industriales\n- la reparacin y el mantenimiento de equipos de elevacin y manipulacin\n- la reparacin y el mantenimiento de equipos de refrigeracin industrial y de depuracin del aire\n- la reparacin y el mantenimiento de maquinaria industrial de uso general\n- la reparacin de herramientas manuales elctricas\n- la reparacin y el mantenimiento de mquinas herramienta y sus accesorios empleados en el corte y el trabajo de\nlos metales\n- la reparacin y el mantenimiento de otras mquinas herramienta\n- la reparacin y el mantenimiento de tractores agrcolas\n- la reparacin y el mantenimiento de maquinaria agropecuaria y forestal\n- la reparacin y el mantenimiento de maquinaria para la industria metalrgica\n- la reparacin y el mantenimiento de maquinaria para las industrias extractivas, la construccin y los yacimientos de\npetrleo y gas\n- la reparacin y el mantenimiento de maquinaria para la industria de la alimentacin, bebidas y tabaco\n- la reparacin y el mantenimiento de maquinaria para las industrias textil, de la confeccin y del cuero\n- la reparacin y el mantenimiento de maquinaria para la industria papelera\n- la reparacin y el mantenimiento de maquinaria para la industria del plstico y el caucho\n- la reparacin y el mantenimiento de otra maquinaria para usos especficos de la divisin 28\n- la reparacin y el mantenimiento de equipos para pesar\n- la reparacin y el mantenimiento de mquinas expendedoras automticas\n- la reparacin y el mantenimiento de cajas registradoras\n- la reparacin y el mantenimiento de fotocopiadoras\n- la reparacin de calculadoras, electrnicas o no\n- la reparacin de mquinas de escribir\n',0,0),(430,'3313','Reparacin de equipos electrnicos y pticos',4,'33.13 Reparacin de equipos electrnicos y pticos\nEsta clase comprende la reparacin y el mantenimiento de los bienes producidos en los grupos 26.5, 26.6 y 26.7, a\nexcepcin de aquellos que se consideran enseres domsticos.\nEsta clase comprende:\n- la reparacin y el mantenimiento de los equipos de medicin, comprobacin, navegacin y control del grupo 26.5,\ncomo:\n? instrumentos para motores de aviacin\n? equipos de comprobacin de emisiones de automocin\n? instrumentos meteorolgicos\n? equipos de comprobacin e inspeccin de propiedades fsicas, elctricas y qumicas\n? instrumentos de geodesia\n? instrumentos de deteccin y vigilancia de radiaciones\n- la reparacin de equipos de radiacin, electromdicos y electroteraputicos de la clase 26.60, como:\n? equipos de resonancia magntica\n? equipos mdicos de ultrasonidos\n? marcapasos\n? audfonos\n? electrocardigrafos\n? equipos endoscpicos electromdicos\n? aparatos de radiacin\n- la reparacin de equipos e instrumentos pticos de la clase 26.70, si su uso es principalmente profesional, como:\n? prismticos\n? microscopios (excepto microscopios de electrones y de protones)\n? telescopios\n? prismas y lentes (excepto oftlmicas)\n? equipo fotogrfico\n',0,0),(431,'3314','Reparacin de equipos elctricos',4,'33.14 Reparacin de equipos elctricos\nEsta clase comprende la reparacin y el mantenimiento de los productos de la divisin 27, excepto de aqullos\nincluidos en el grupo 27.5 (aparatos domsticos).\nEsta clase comprende:\n- la reparacin y el mantenimiento de transformadores elctricos y de distribucin\n- la reparacin y el mantenimiento de motores y generadores elctricos y grupos electrgenos\n- la reparacin y el mantenimiento de aparatos y cuadros de conmutacin\n- la reparacin y el mantenimiento de rels y controles industriales\n- la reparacin y el mantenimiento de bateras primarias y de almacenamiento\n- la reparacin y el mantenimiento de equipos de alumbrado elctrico\n- la reparacin y el mantenimiento de dispositivos de cableado portador o no de corriente para circuitos elctricos\n',0,0),(432,'3315','Reparacin y mantenimiento naval',4,'33.15 Reparacin y mantenimiento naval\nEsta clase comprende la reparacin y el mantenimiento de barcos. No obstante, la reconstruccin o revisin de\nembarcaciones en fbrica se clasifica en la divisin 30.\nEsta clase comprende:\n- la reparacin y el mantenimiento rutinario de barcos\n- la reparacin y el mantenimiento de embarcaciones de recreo\n',0,0),(433,'3316','Reparacin y mantenimiento aeronutico y espacial',4,'33.16 Reparacin y mantenimiento aeronutico y espacial\nEsta clase comprende la reparacin y el mantenimiento de aeronaves y naves espaciales.\nEsta clase comprende:\n- la reparacin y el mantenimiento de aeronaves (a excepcin de la transformacin, la revisin o la reconstruccin en\nfbrica)\n- la reparacin y el mantenimiento de motores de aviacin\n',0,0),(434,'3317','Reparacin y mantenimiento de otro material de transporte',4,'33.17 Reparacin y mantenimiento de otro material de transporte\nEsta clase comprende la reparacin y el mantenimiento de otro material de transporte de la divisin 30, a excepcin\nde las motocicletas y bicicletas.\nEsta clase comprende:\n- la reparacin y el mantenimiento de locomotoras y vagones ferroviarios (excepto las tareas de reconstruccin o\ntransformacin en fbrica)\n- la reparacin de calesas y carros de traccin animal\n',0,0),(435,'3319','Reparacin de otros equipos',4,'33.19 Reparacin de otros equipos\nEsta clase comprende la reparacin y el mantenimiento de equipos no incluidos en otros grupos de la presente\ndivisin.\nEsta clase comprende:\n- la reparacin de redes para pescar, incluido su remiendo\n- la reparacin de cuerdas, jarcias, velamen y lonas\n- la reparacin de bolsas para el almacenamiento de fertilizantes y productos qumicos\n- la reparacin o reacondicionamiento de toneles, barriles y palets de madera, as como de artculos anlogos\n- la reparacin de mquinas pinball  y otros juegos accionados con monedas\n- la restauracin de rganos y otros instrumentos musicales histricos\n',0,0),(436,'332','Instalacin de mquinas y equipos industriales',3,'33.2 Instalacin de mquinas y equipos industriales\n',0,0),(437,'3320','Instalacin de mquinas y equipos industriales',4,'33.20 Instalacin de mquinas y equipos industriales\nEsta clase comprende la instalacin especializada de maquinaria. No obstante, la instalacin de equipos que\nconstituyen una parte integral de edificios o estructuras similares, como la instalacin de escaleras mecnicas,\ncableado elctrico, sistemas de alarma contra robos o sistemas de aire acondicionado, se clasifica como\nconstruccin.\nEsta clase comprende:\n- la instalacin de maquinaria industrial en plantas industriales\n- el montaje de equipos de control de procesos industriales\n- la instalacin de otros equipos industriales, por ejemplo:\n- equipos de comunicaciones\n- mainframes y ordenadores similares\n- equipos de radiacin y electromdicos, etc.\n- el desmontaje de maquinaria y equipos de gran escala\n- las actividades de los mecnicos comprobadores de maquinaria\n- el montaje de maquinaria\n- la instalacin de equipos para boleras automticas\n',0,0),(438,'D','Suministro de energa elctrica, gas, vapor y aire acondicionado',1,NULL,1,1),(439,'35','Suministro de energa elctrica, gas, vapor y aire acondicionado',2,'35 Suministro de energa elctrica, gas, vapor y aire acondicionado\n',0,0),(440,'351','Produccin, transporte y distribucin de energa elctrica',3,'35.1 Produccin, transporte y distribucin de energa elctrica\nEste grupo comprende la produccin de energa elctrica, el transporte desde las instalaciones de generacin hasta\nlos centros de distribucin, y la distribucin a los usuarios finales.\n',0,0),(441,'3511','Produccin de energa elctrica',4,'35.11 Produccin de energa elctrica\nEsta clase comprende:\n- la explotacin de las instalaciones de generacin de energa elctrica, incluidas las energas trmica, nuclear,\nhidroelctrica, por turbina de gas, diesel y de fuentes renovables\n',0,0),(442,'3512','Transporte de energa elctrica',4,'35.12 Transporte de energa elctrica\nEsta clase comprende:\n- la explotacin de los sistemas de transporte de la energa elctrica desde la instalacin de generacin a la red de\ndistribucin\n',0,0),(443,'3513','Distribucin de energa elctrica',4,'35.13 Distribucin de energa elctrica\nEsta clase comprende:\n- la explotacin de las redes de distribucin (que constan de lneas, torres, contadores y cableado) que transportan la\nenerga elctrica recibida de la instalacin de generacin o el sistema de transporte hasta el consumidor\n',0,0),(444,'3514','Comercio de energa elctrica',4,'35.14 Comercio de energa elctrica\nEsta clase comprende:\n- la venta al usuario de la energa elctrica\n- las actividades de los intermediarios de la energa elctrica que gestionan la venta de energa elctrica a travs de\nlas redes de distribucin operadas por otros\n- la explotacin de los mercados de electricidad y capacidad de transporte para energa elctrica\n',0,0),(445,'352','Produccin de gas; distribucin por tubera de combustibles gaseosos',3,'35.2 Produccin de gas; distribucin por tubera de combustibles gaseosos\nEste grupo comprende la produccin de gas y la distribucin de gas natural o sinttico hasta el consumidor a travs\nde un sistema de tuberas. Comprende los proveedores o intermediarios de gas que conciertan la venta de gas\nnatural por sistemas de distribucin explotados por terceros.\nLa explotacin independiente de los gasoductos, que suele hacerse en redes de larga distancia, que conectan a\nproductores y distribuidores de gas, o entre centros urbanos, queda excluida de este grupo y se incluye con otras\nactividades de transporte por tubera.\n',0,0),(446,'3521','Produccin de gas',4,'35.21 Produccin de gas\nEsta clase comprende:\n- la produccin de gas con fines de suministro de gas por carbonacin de hulla o a partir de subproductos agrcolas o\nde desechos\n- la produccin de combustibles gaseosos de valor calrico especfico, mediante purificacin, mezcla y otros\nprocesos, a partir de gases de diversos orgenes, incluido el gas natural\n',0,0),(447,'3522','Distribucin por tubera de combustibles gaseosos',4,'35.22 Distribucin por tubera de combustibles gaseosos\nEsta clase comprende:\n- la distribucin y el suministro de combustibles gaseosos de cualquier tipo por un sistema de tuberas\n',0,0),(448,'3523','Comercio de gas por tubera',4,'35.23 Comercio de gas por tubera\nEsta clase comprende:\n- la venta de gas al usuario por tuberas\n- las actividades de los intermediarios de gas que gestionan la venta de gas a travs de las redes de distribucin\noperadas por otros\n- la explotacin de los mercados de gas y capacidad de transporte para combustibles gaseosos\n',0,0),(449,'353','Suministro de vapor y aire acondicionado',3,'35.3 Suministro de vapor y aire acondicionado\n',0,0),(450,'3530','Suministro de vapor y aire acondicionado',4,'35.30 Suministro de vapor y aire acondicionado\nEsta clase comprende:\n- la produccin, captacin y distribucin de vapor y agua caliente para calefaccin, energa u otros fines\n- la produccin y distribucin de aire refrigerado\n- la produccin y distribucin de agua fra con fines de refrigeracin\n- la produccin de hielo, incluyendo tanto para consumo humano como con otros fines (por ejemplo, refrigeracin)\n',0,0),(451,'E','Suministro de agua, actividades de saneamiento, gestin de residuos y descontaminacin',1,NULL,0,0),(452,'36','Captacin, depuracin y distribucin de agua',2,'36 Captacin, depuracin y distribucin de agua\nEsta divisin comprende la captacin, el tratamiento y la distribucin de agua para necesidades domsticas e\nindustriales. Comprende la captacin de agua de diversas fuentes, as como la distribucin por distintos medios.\n',0,0),(453,'360','Captacin, depuracin y distribucin de agua',3,'36.0 Captacin, depuracin y distribucin de agua\n',0,0),(454,'3600','Captacin, depuracin y distribucin de agua',4,'36.00 Captacin, depuracin y distribucin de agua\nEsta clase comprende la captacin, el tratamiento y la distribucin de agua para necesidades domsticas e\nindustriales. Comprende la captacin de agua de diversas fuentes, as como la distribucin por distintos medios.\nComprende tambin la explotacin de canales de riego; ahora bien, no comprende la prestacin de servicios de\nriego por aspersin automtica y otros servicios de apoyo a la agricultura similares.\nEsta clase comprende:\n- la captacin de agua de ros, lagos, pozos, etc.\n- la captacin de agua de lluvia\n- la purificacin de aguas para el suministro de agua\n- el tratamiento de aguas para uso industrial y otros usos\n- la desalinizacin de agua de mar o de aguas subterrneas para obtener agua como producto principal\n- la distribucin de agua por tuberas, realizada en camin u otros medios\n- la explotacin de canales de riego\n',0,0),(455,'37','Recogida y tratamiento de aguas residuales',2,'37 Recogida y tratamiento de aguas residuales\nEsta divisin comprende la explotacin de sistemas de alcantarillado o instalaciones de tratamiento de aguas\nresiduales que recogen, tratan y eliminan stas\n',0,0),(456,'370','Recogida y tratamiento de aguas residuales',3,'37.0 Recogida y tratamiento de aguas residuales\n',0,0),(457,'3700','Recogida y tratamiento de aguas residuales',4,'37.00 Recogida y tratamiento de aguas residuales\nEsta clase comprende:\n- la explotacin de sistemas de alcantarillado o instalaciones de tratamiento de aguas residuales\n- la recogida y transporte de aguas residuales urbanas e industriales, as como del agua de lluvia por medio de redes\nde alcantarillado, colectores, cisternas y otros medios de transporte (vehculos para aguas residuales, etc.)\n- el vaciado y limpieza de fosas y pozos spticos, cloacas y fosos de aguas residuales, utilizacin de retretes\nqumicos\n- el tratamiento de aguas residuales (incluyendo aguas residuales urbanas, industriales, de piscinas, etc.) mediante\nprocesos fsicos, qumicos y biolgicos, como la dilucin, cribado, filtrado, sedimentacin, etc.\n- el mantenimiento y la limpieza de alcantarillas y sumideros, incluyendo el desatasco de alcantarillas\n',0,0),(458,'38','Recogida, tratamiento y eliminacin de residuos; valorizacin',2,'38 Recogida, tratamiento y eliminacin de residuos; valorizacin\nEsta divisin comprende la recogida, el tratamiento y la eliminacin de materiales de desecho. Comprende tambin\nllos servicios de recogida de basuras y la explotacin de los centros de valorizacin de materiales (es decir, los que\nseparan los materiales recuperables del conjunto de residuos).\n',0,0),(459,'381','Recogida de residuos',3,'38.1 Recogida de residuos\nEste grupo comprende la recogida de residuos procedentes de hogares y empresas por medio de cubos de basura,\ncontenedores, etc. Comprende la recogida de residuos peligrosos y no peligrosos, por ejemplo, los procedentes de\nlos hogares, las pilas gastadas, los aceites y grasas para cocinar usados, el aceite usado de barcos y de garajes, as\ncomo los desechos de las actividades de construccin y demolicin.\n',0,0),(460,'3811','Recogida de residuos no peligrosos',4,'38.11 Recogida de residuos no peligrosos\nEsta clase comprende:\n- la recogida de residuos slidos no peligrosos (es decir, basuras) en un rea local, como por ejemplo la recogida de\nresiduos procedentes de hogares y empresas por medio de cubos de basura, contenedores, etc. Puede incluir\nmateriales recuperables mezclados.\n- la recogida de materiales reciclables\n- la recogida de la basura de los contenedores y papeleras colocados en lugares pblicos\nEsta clase comprende tambin:\n- la recogida de residuos de construccin y demolicin\n- la recogida y retirada de residuos como hojarasca y escombros\n- la recogida de los residuos de productos en las fbricas textiles\n- la explotacin de los centros de transferencia de residuos no peligrosos\n',0,0),(461,'3812','Recogida de residuos peligrosos',4,'38.12 Recogida de residuos peligrosos\nEsta clase comprende la recogida de residuos peligrosos slidos o no, es decir, que contienen substancias o\npreparados explosivos, oxidantes, inflamables, txicos, irritantes, cancergenos, corrosivos, infecciosos o de otro tipo\nque sean perjudiciales para la salud humana y el medio ambiente. Puede conllevar tambin la identificacin, el\ntratamiento, el embalaje y el etiquetado de los residuos para su transporte.\nEsta clase comprende:\n- la recogida de residuos peligrosos, como:\n el aceite usado de barcos o garajes\n los residuos biolgicos peligrosos\n los residuos nucleares\n las pilas gastadas, etc.\n- la explotacin de centros de transferencia de residuos peligrosos\n',0,0),(462,'382','Tratamiento y eliminacin de residuos',3,'38.2 Tratamiento y eliminacin de residuos\nSe incluye en este grupo la eliminacin y el tratamiento previo a sta de diversos tipos de residuos por distintos\nmedios, como el tratamiento de residuos orgnicos con el fin de eliminarlos; el tratamiento y la eliminacin de\nanimales txicos vivos o muertos y otros residuos contaminados; el tratamiento y la eliminacin de residuos\nradiactivos de transicin procedentes de hospitales, etc.; el vertido de desperdicios en tierra o en el mar; su\nenterramiento; la eliminacin de bienes usados, como frigorficos, con el fin de eliminar los residuos nocivos; la\neliminacin de residuos por incineracin o combustin. Comprende tambin la recuperacin de la energa producida\nen el proceso de incineracin de residuos.\nEste grupo no comprende:\n- el tratamiento y la eliminacin de aguas residuales (vase 37.00)\n- las actividades de valorizacin (vase 38.3)\n',0,0),(463,'3821','Tratamiento y eliminacin de residuos no peligrosos',4,'38.21 Tratamiento y eliminacin de residuos no peligrosos\nEsta clase comprende la eliminacin y el tratamiento previo a sta de los residuos no peligrosos slidos o no:\n- la explotacin de vertederos para la eliminacin de residuos no peligrosos\n- la eliminacin de residuos no peligrosos por combustin, incineracin u otros medios, con o sin produccin de\nelectricidad o vapor, compost, combustibles de sustitucin, biogases, cenizas u otros subproductos para uso ulterior,\netc.\n- el tratamiento de residuos orgnicos para su eliminacin\n',0,0),(464,'3822','Tratamiento y eliminacin de residuos peligrosos',4,'38.22 Tratamiento y eliminacin de residuos peligrosos\nEsta clase comprende la eliminacin y el tratamiento previo a sta de residuos peligrosos slidos o no, incluidos los\nque contienen substancias o preparados explosivos, oxidantes, inflamables, txicos, irritantes, cancergenos,\ncorrosivos, infecciosos o de otro tipo que sean perjudiciales para la salud humana y el medio ambiente.\nEsta clase comprende:\n- la explotacin de instalaciones de tratamiento de residuos peligrosos\n- el tratamiento y la eliminacin de animales txicos vivos o muertos u otros residuos contaminados\n- la incineracin de residuos peligrosos\n- la eliminacin de bienes usados, como frigorficos, con el fin de eliminar los residuos nocivos\n- el tratamiento, la eliminacin y el almacenamiento de residuos nucleares radiactivos, incluidos:\n el tratamiento y la eliminacin de residuos radiactivos de transicin, es decir, que se degradan durante el\ntransporte desde los hospitales\n la encapsulacin, preparacin y otro tipo de tratamiento de los residuos nucleares para su almacenamiento\n',0,0),(465,'383','Valorizacin',3,'38.3 Valorizacin\n',0,0),(466,'3831','Separacin y clasificacin de materiales',4,'38.31 Separacin y clasificacin de materiales\nEsta clase comprende el desguace de todo tipo de equipos (automviles, barcos, ordenadores, televisores, etc.)\npara la recuperacin de materiales.\n',0,0),(467,'3832','Valorizacin de materiales ya clasificados',4,'38.32 Valorizacin de materiales ya clasificados\nEsta clase comprende el procesado de residuos y chatarra metlicos y no metlicos para su transformacin en\nmaterias primas secundarias, generalmente mediante un proceso mecnico o qumico.\nTambin comprende la recuperacin de materiales procedentes de los ciclos de tratamiento de residuos por medio\nde (1) la separacin y clasificacin de materiales recuperables procedentes de los ciclos de tratamiento de residuos\nno peligrosos (es decir, basura) o (2) la separacin y clasificacin de materiales recuperables mezclados, como\npapel, plsticos, latas de bebidas usadas y metales, en distintas categoras.\nAlgunos ejemplos de procesos de transformacin mecnica o qumica que se efectan son:\n- el molido mecnico de los residuos metlicos procedentes de vehculos usados, lavadoras, bicicletas, etc.\n- la reduccin mecnica de grandes piezas de hierro, como vagones de ferrocarril\n- la trituracin de residuos de metal, vehculos para desguace, etc.\n- otros mtodos de tratamiento mecnico, como el corte y la compresin para reducir el volumen\n- la regeneracin de metales a partir de los residuos fotogrficos, por ejemplo, del bao fijador o las pelculas y el\npapel fotogrficos.\n- la recuperacin del caucho, por ejemplo, neumticos usados, para producir materias primas secundarias\n- la clasificacin y prensado de plsticos para producir materias primas secundarias para tubos, tiestos, paletas y\nsimilares\n- la transformacin (limpieza, fundicin, trituracin) de residuos de plstico o caucho en granulos\n- la trituracin, lavado y clasificacin de vidrio\n- la trituracin, lavado y clasificacin de otros residuos, como los de demolicin, para obtener materias primas\nsecundarias\n- el procesado de aceites y grasas usados para cocinar para su transformacin en materias primas secundarias\n- la transformacin de otros residuos procedentes de alimentos, bebidas y tabaco en materias primas secundarias\n',0,0),(468,'39','Actividades de descontaminacin y otros servicios de gestin de residuos',2,'39 Actividades de descontaminacin y otros servicios de gestin de residuos\nEsta divisin comprende la prestacin de servicios de descontaminacin, es decir, la limpieza de lugares, edificios,\nsuelos, superficies o aguas subterrneas contaminados.\n',0,0),(469,'390','Actividades de descontaminacin y otros servicios de gestin de residuos',3,'39.0 Actividades de descontaminacin y otros servicios de gestin de residuos\n',0,0),(470,'3900','Actividades de descontaminacin y otros servicios de gestin de residuos',4,'39.00 Actividades de descontaminacin y otros servicios de gestin de residuos\nEsta clase comprende:\n- la descontaminacin de suelos y aguas subterrneas en el lugar de la contaminacin, bien in situ, bien ex situ, con\nmtodos mecnico-qumicos o biolgicos\n- la descontaminacin de centros o plantas industriales, incluidas las plantas y centrales nucleares\n- la descontaminacin y limpieza de aguas superficiales tras una contaminacin accidental, por ejemplo mediante\nrecogida de contaminantes o aplicacin de sustancias qumicas\n- la limpieza de vertidos de petrleo en tierra, aguas superficiales, ocanos y mares (incluidas las costas)\n- la eliminacin de amianto, pintura con plomo y otros materiales txicos\n- otras actividades especializadas de control de la contaminacin\n',0,0),(471,'F','Construccin',1,NULL,1,1),(472,'41','Construccin de edificios',2,'41 Construccin de edificios\nEsta divisin comprende la construccin general de edificios de todo tipo. Comprende las obras nuevas, la\nreparacin, las ampliaciones y reformas, la construccin in situ de edificios y estructuras prefabricados, as como las\nconstrucciones de carcter temporal.\nComprende tambin la construccin de viviendas, edificios de oficinas, y establecimientos comerciales completos,\nas como de otros edificios pblicos, construcciones agrarias, etc.\n',0,0),(473,'411','Promocin inmobiliaria',3,'41.1 Promocin inmobiliaria\n',0,0),(474,'4110','Promocin inmobiliaria',4,'41.10 Promocin inmobiliaria\nEsta clase comprende:\n- la promocin de proyectos de construccin de edificios residenciales y no residenciales mediante la consecucin de\nlos medios financieros, tcnicos y fsicos necesarios para la realizacin de tales proyectos con vistas a su venta\nposterior\n',0,0),(475,'412','Construccin de edificios',3,'41.2 Construccin de edificios\nEste grupo comprende la construccin de edificios residenciales y no residenciales completos, por cuenta propia\npara su venta o por cuenta de terceros. Puede subcontratarse partes del trabajo, e incluso el proceso de\nconstruccin en su totalidad. Si slo se llevan a cabo partes especializadas del proceso de construccin, la actividad\nse clasifica en la divisin 43.\n',0,0),(476,'4120','Construccin de edificios',4,'41.20 Construccin de edificios\nEsta clase comprende:\n- la construccin de todo tipo de edificios residenciales:\n viviendas unifamiliares\n edificios de varias viviendas, incluidos rascacielos\n- la construccin de todo tipo de edificios no residenciales:\n edificios para la produccin industrial, como fbricas, talleres, plantas de montaje, etc.\n hospitales, centros de enseanza, edificios de oficinas\n hoteles, establecimientos y centros comerciales, restaurantes\n edificios aeroportuarios\n instalaciones deportivas cubiertas\n aparcamientos, incluidos los subterrneos\n almacenes\n edificios religiosos\n- el montaje in situ de construcciones prefabricadas\nEsta clase comprende tambin:\n- la remodelacin y la renovacin de estructuras residenciales ya existentes\n',0,0),(477,'42','Ingeniera civil',2,'42 Ingeniera civil\nEsta divisin comprende la construccin general de obras de ingeniera civil. Comprende las obras nuevas, la\nreparacin, las ampliaciones y reformas, la construccin in situ de estructuras prefabricadas, as como las\nconstrucciones de carcter temporal.\nComprende la construccin de grandes obras como autopistas, carreteras, calles, puentes, tneles, lneas frreas,\naeropuertos, puertos y otras obras hidrulicas, sistemas de riego y alcantarillado, instalaciones industriales,\noleoductos, gasoductos y lneas elctricas, instalaciones deportivas al aire libre, etc. Estas obras pueden realizarse\npor cuenta propia o por cuenta de terceros. Pueden subcontratarse partes del trabajo e incluso, en ocasiones, el\ntrabajo en su integridad.\n',0,0),(478,'421','Construccin de carreteras y vas frreas, puentes y tneles',3,'42.1 Construccin de carreteras y vas frreas, puentes y tneles\n',0,0),(479,'4211','Construccin de carreteras y autopistas',4,'42.11 Construccin de carreteras y autopistas\nEsta clase comprende:\n- la construccin de autopistas, calles, carreteras y otras vas de circulacin de vehculos y peatones\n- las obras de superficie en calles, carreteras, autopistas, puentes y tneles:\n asfaltado de carreteras\n pintura y otra sealizacin de carreteras\n la instalacin de quitamiedos, seales de trfico y similares\n- la construccin de pistas de aterrizaje\n',0,0),(480,'4212','Construccin de vas frreas de superficie y subterraneas',4,'42.12 Construccin de vas frreas de superficie y subterrneas\nEsta clase comprende:\n- la construccin de vas frreas de superficie y subterrneas\n',0,0),(481,'4213','Construccin de puentes y tneles',4,'42.13 Construccin de puentes y tneles\nEsta clase comprende:\n- la construccin de puentes, incluidos los que soportan carreteras elevadas\n- la construccin de tneles\n',0,0),(482,'422','Construccin de redes',3,'42.2 Construccin de redes\n',0,0),(483,'4221','Construccin de redes para fluidos',4,'42.21 Construccin de redes para fluidos\nEsta clase comprende la construccin de redes de distribucin para el transporte de fluidos y de los edificios y\nestructuras que son parte integral de estos sistemas.\nEsta clase comprende:\n- la construccin de obras de ingeniera civil para:\n gasoductos y oleoductos de larga distancia y redes urbanas para la distribucin de gas o petrleo\n redes de suministro de agua\n sistemas de riego (canales)\n grandes depsitos\n- la construccin de:\n sistemas de alcantarillado, incluida su reparacin\n plantas de tratamiento de aguas residuales\n estaciones de bombeo\nEsta clase comprende tambin:\n- la perforacin de pozos hidrulicos\n',0,0),(484,'4222','Construccin de redes elctricas y de telecomunicaciones',4,'42.22 Construccin de redes elctricas y de telecomunicaciones\nEsta clase comprende la construccin de redes de distribucin de electricidad y de telecomunicaciones y de edificios\ny estructuras que son parte integral de estos sistemas.\nEsta clase comprende:\n- la construccin de obras de ingeniera civil para:\n redes elctricas y de comunicacin urbanas y de larga distancia\n centrales de elctricas\n',0,0),(485,'429','Construccin de otros proyectos de ingeniera civil',3,'42.9 Construccin de otros proyectos de ingeniera civil\n',0,0),(486,'4291','Obras hidrulicas',4,'42.91 Obras hidrulicas\nEsta clase comprende:\n- la construccin de:\n canales navegables, puertos, obras fluviales, puertos deportivos, esclusas, etc.\n presas y diques\n- dragado de vas navegables\n',0,0),(487,'4299','Construccin de otros proyectos de ingeniera civil n.c.o.p.',4,'42.99 Construccin de otros proyectos de ingeniera civil n.c.o.p.\nEsta clase comprende:\n- la construccin de instalaciones industriales, excepto edificios, como:\n refineras\n plantas qumicas\n- las obras de construccin, excepto de edificios, como:\n instalaciones deportivas al aire libre\nEsta clase comprende tambin:\n- la parcelacin con mejora de terrenos (p. ej., adicin de carreteras, infraestructuras para redes de abastecimiento,\netc.)\n',0,0),(488,'43','Actividades de construccin especializada',2,'43 Actividades de construccin especializada\nEsta divisin comprende las actividades de construccin especializada, es decir, la preparacin y la construccin de\npartes de edificios y obras de ingeniera civil. Estas actividades suelen estar especializadas en un aspecto comn a\ndiferentes estructuras y requieren la utilizacin de tcnicas y equipos especiales. Se trata de actividades tales como\nla hinca de pilotes, la cimentacin, la ereccin de estructuras de edificios, el hormigonado, la colocacin de ladrillo y\npiedra, la instalacin de andamios, la construccin de cubiertas, etc. Se incluye la construccin de estructuras de\nacero, siempre que sus partes no sean fabricadas por la misma unidad. Las actividades de construccin\nespecializada se realizan en su mayora mediante subcontratacin, pero cuando se trata de trabajos de construccin\ndestinados a la reparacin se suele realizar directamente para el propietario.\nSe incluyen asimismo las actividades de acabado de edificios.\nEsta seccin comprende adems la instalacin de todo tipo de equipos que permiten que la construccin funcione\ncomo tal. Normalmente estas actividades se realizan a pie de obra, aunque algunas partes del trabajo pueden\nllevarse a cabo en talleres especializados. Se incluyen actividades como la fontanera, la instalacin de sistemas de\ncalefaccin y aire acondicionado, antenas, sistemas de alarma y otras instalaciones elctricas, sistemas de\naspersin automtica contra incendios, ascensores y escaleras mecnicas, etc. Tambin se incluyen los trabajos de\naislamiento (trmico, sonoro y de humedad), chapistera, refrigeracin industrial, la instalacin de sistemas de\niluminacin y sealizacin de carreteras, ferrocarriles, aeropuertos, puertos, etc. Tambin se incluye la reparacin\ncorrespondiente a las actividades mencionadas.\nLas actividades de acabado de edificios y obras son las que contribuyen al acabado o terminacin de la\nconstruccin, como el acristalamiento, revocamiento, pintura, embaldosado y alicatado o el revestimiento con otros\nmateriales como el parqu, moqueta, papel pintado, etc., pulido de suelos, carpintera, sistemas acsticos, limpieza\nexterior, etc. Tambin se incluye la reparacin correspondiente a las actividades mencionadas.\nEl alquiler de equipos con operario se clasifica como la actividad de construccin asociada a dichos equipos.\n',0,0),(489,'431','Demolicin y preparacin de terrenos',3,'43.1 Demolicin y preparacin de terrenos\nEste grupo comprende las actividades de preparacin de un terreno para la realizacin posterior de actividades de\nconstruccin, incluida la retirada de estructuras preexistentes.\n',0,0),(490,'4311','Demolicin',4,'43.11 Demolicin\nEsta clase comprende:\n- la demolicin y derribo de edificios y otras estructuras\n',0,0),(491,'4312','Preparacin de terrenos',4,'43.12 Preparacin de terrenos\nEsta clase comprende:\n- la limpieza de escombros\n- el movimiento de tierras: excavacin, rellenado y nivelacin de emplazamientos de obras, excavacin de zanjas,\nretirada de rocas, voladuras, etc.\n- la preparacin de explotaciones mineras:\n el destape de minas y otras actividades de preparacin y desarrollo de los terrenos y las propiedades mineros,\nexcepto yacimientos de petrleo y gas\nEsta clase comprende tambin:\n- el drenaje de emplazamientos de obras\n- el drenaje de terrenos agrcolas y forestales\n',0,0),(492,'4313','Perforaciones y sondeos',4,'43.13 Perforaciones y sondeos\nEsta clase comprende:\n- las perforaciones, sondeos y muestreos para la construccin, geofsicos, geolgicos u otros fines similares\n',0,0),(493,'432','Instalaciones elctricas, de fontanera y otras instalaciones en obras de construccin',3,'43.2 Instalaciones elctricas, de fontanera y otras instalaciones en obras de construccin\nEste grupo comprende las actividades de instalacin que permiten el funcionamiento de un edificio como tal, incluida\nla instalacin de sistemas elctricos, fontanera (agua, gas y sistemas de aguas residuales), sistemas de calefaccin\ny aire acondicionado, ascensores, etc.\n',0,0),(494,'4321','Instalaciones elctricas',4,'43.21 Instalaciones elctricas\nEsta clase comprende la instalacin de sistemas elctricos en todo tipo de edificios y estructuras de ingeniera civil.\nEsta clase comprende:\n- la instalacin de:\n cables elctricos y sus accesorios\n cables de telecomunicacin\n cables para redes informticas y de televisin por cable, incluidos los de fibra ptica\n antenas parablicas\n sistemas de iluminacin\n alarmas contra incendios\n sistemas de alarma de proteccin contra robos\n alumbrado y seales elctricas en calles\n alumbrado de pistas aeroportuarias\nEsta clase comprende tambin:\n- la conexin de aparatos elctricos y equipos domsticos, incluida la calefaccin radiante\n',0,0),(495,'4322','Fontanera, instalaciones de sistemas de calefaccin y aire acondicionado',4,'43.22 Fontanera, instalaciones de sistemas de calefaccin y aire acondicionado\nEsta clase comprende la instalacin de fontanera y sistemas de calefaccin y aire acondicionado, incluidas las\nampliaciones, las reformas, el mantenimiento y la reparacin.\nEsta clase comprende:\n- la instalacin en edificios y otras obras de construccin de:\n sistemas de calefaccin (elctrica, de gas o de petrleo)\n hornos, torres de refrigeracin\n colectores no elctricos de energa solar\n fontanera y sanitarios\n equipos y conducciones de ventilacin y aire acondicionado\n instalaciones de gas\n conducciones de vapor\n sistemas de aspersin automtica contra incendios\n sistemas de aspersin automtica para riego\n- instalacin de canalizaciones\n',0,0),(496,'4329','Otras instalaciones en obras de construccin',4,'43.29 Otras instalaciones en obras de construccin\nEsta clase comprende la instalacin de equipos distintos de los sistemas elctricos, de fontanera, de calefaccin y\nde aire acondicionado, y de maquinaria industrial en edificios y estructuras de ingeniera civil.\nEsta clase comprende:\n- la instalacin en edificios y otras obras de construccin de:\n ascensores y escaleras mecnicas, incluyendo la reparacin y el mantenimiento\n puertas automticas y giratorias\n pararrayos\n sistema de limpieza por aspirado\n aislamientos trmicos, de sonido o de vibraciones\n',0,0),(497,'433','Acabado de edificios',3,'43.3 Acabado de edificios\n',0,0),(498,'4331','Revocamiento',4,'43.31 Revocamiento\nEsta clase comprende:\n- la aplicacin en edificios y otras obras de construccin de yeso y estuco interior y exterior, incluidos los materiales\nde listonado correspondientes\n',0,0),(499,'4332','Instalacin de carpintera',4,'43.32 Instalacin de carpintera\nEsta clase comprende:\n- la instalacin de puertas (excepto automatizadas y giratorias), ventanas y sus marcos de madera u otros materiales\n- la instalacin de cocinas, 