n transformacin) de bienes nuevos y usados principalmente al pblico\nen general para su consumo o utilizacin personal o domstica, en tiendas, grandes almacenes, puestos, empresas\nde venta por correo, vendedores a domicilio, vendedores ambulantes, economatos, etc.\nEl comercio al por menor se clasifica en primer lugar segn el punto de venta (comercio al por menor en\nestablecimientos: grupos 47.1 a 47.7; comercio al por menor no realizado en establecimientos: grupos 47.8 y 47.9).\nEl comercio al por menor en establecimientos comprende la venta al por menor de bienes de segunda mano\n(clase 47.79). Dentro del comercio al por menor en establecimientos se hace otra distincin entre el realizado en\nestablecimientos especializados (grupos 47.2 a 47.7) y el realizado en establecimientos no especializados\n(grupo 47.1). Los grupos mencionados a su vez se subdividen segn la gama de productos vendidos. El comercio\nque no se realiza en establecimientos se subdivide de acuerdo con el tipo de comercio, como el realizado en puestos\nde venta y en mercadillos (grupo 47.8) y otro comercio al por menor no realizado en establecimientos, por ejemplo,\npor correo, a domicilio, en mquinas expendedoras, etc. (grupo 47.9).\nLos bienes vendidos en esta divisin se limitan a los denominados en general bienes de consumo o mercancas al\npor menor.\nEn consecuencia, se excluyen los bienes que no suelen incluirse en el comercio al por menor, como los cereales, los\nminerales, la maquinaria y equipos industriales, etc. Esta divisin comprende tambin las unidades que se dedican\nfundamentalmente a la venta al pblico en general, a partir de la exposicin de la mercanca, de productos como los\nordenadores personales, material de escritorio, pintura o madera, aunque tales ventas pueden no ser para uso\npersonal o domstico. La manipulacin que suele realizarse vinculado a la actividad comercial no afecta al carcter\nbsico de los productos y puede incluir, por ejemplo, la clasificacin, la separacin, la mezcla y el empaquetado.\nEsta divisin comprende tambin el comercio al por menor realizado por intermediarios y las actividades de las\nempresas de subastas al por menor.\nEsta divisin no comprende:\n- la venta de productos agrarios por el responsable de la explotacin (vase la divisin 01)\n- la fabricacin y venta de mercancas, que est clasificada por lo general como fabricacin en las divisiones 10-32\n- la venta de vehculos de motor, motocicletas y sus repuestos (vase la divisin 45)\n- el comercio de cereales, minerales, crudo de petrleo, productos qumicos industriales, hierro y acero y la\nmaquinaria y equipo industriales (vase la divisin 46)\n- la venta de alimentos y bebidas para su consumo en el mismo local y venta de comida para llevar (vase la\ndivisin 56)\n- el alquiler de artculos de uso personal y domstico al pblico en general (vase 77.2)\n',0,0),(576,'471','Comercio al por menor en establecimientos no especializados',3,'47.1 Comercio al por menor en establecimientos no especializados\nEste grupo comprende el comercio al por menor de diversas lneas de productos en la misma unidad\n(establecimientos no especializados), como supermercados y grandes almacenes.\n',0,0),(577,'4711','Comercio al por menor en establecimientos no especializados, con predominio en productos alimenticios, bebidas y tabaco',4,'47.11 Comercio al por menor en establecimientos no especializados, con predominio en productos\nalimenticios, bebidas y tabaco\nEsta clase comprende:\n- el comercio al por menor de una gran variedad de artculos con predominio, sin embargo, de los productos\nalimenticios, bebidas o tabaco:\n las actividades de las grandes superficies que, aparte de vender principalmente alimentos, bebidas y tabaco,\nofrecen otras mercancas tales como prendas de vestir, muebles, electrodomsticos, artculos de ferretera,\ncosmticos, etc.\n',0,0),(578,'4719','Otro comercio al por menor en establecimientos no especializados',4,'47.19 Otro comercio al por menor en establecimientos no e