ernet, a\ndomicilio, en mquinas expendedoras, etc.\n',0,0),(620,'4791','Comercio al por menor por correspondencia o Internet',4,'47.91 Comercio al por menor por correspondencia o Internet\nEsta clase comprende las actividades de comercio al por menor por correspondencia o por Internet, es decir, el\ncomercio al por menor en el que el comprador elige los productos a partir de anuncios publicitarios, catlogos de\ninformacin facilitada en un sitio web, muestrarios o cualquier otro tipo de oferta, y efecta su pedido por correo,\ntelfono o Internet (suele hacerse por medios especiales que facilita un sitio web). Los productos comprados pueden\ndescargarse directamente de Internet o entregarse fsicamente al cliente.\nEsta clase comprende:\n- el comercio al por menos de cualquier tipo de producto por correo\n- el comercio al por menos de cualquier tipo de producto por medio de Internet\nEsta clase comprende tambin:\n- la venta directa a travs de la televisin, la radio o el telfono\n- las subastas por Internet (al por menor)\n',0,0),(621,'4799','Otro comercio al por menor no realizado ni en establecimientos, ni en puestos de venta ni en mercadillos',4,'47.99 Otro comercio al por menor no realizado ni en establecimientos, ni en puestos de venta ni en\nmercadillos\nEsta clase comprende:\n- el comercio al por menor de cualquier tipo de producto realizado de una forma que no est comprendida en\nninguna de las clases anteriores:\n por medio de venta directa o vendedores a domicilio\n por medio de mquinas expendedoras, etc.\n- venta directa de combustible (combustible para calefaccin, lea, etc.) entregada en las instalaciones del cliente\n- las actividades de las subastas no realizadas en establecimientos (al por menor, excepto por Internet)\n- el comercio al por menor por intermediarios no realizada en establecimientos\n',0,0),(622,'H','Transporte y almacenamiento',1,NULL,0,0),(623,'49','Transporte terrestre y por tubera',2,'49 Transporte terrestre y por tubera\nEsta divisin com