cio al aeropuerto o la estacin\n- la explotacin de funiculares, telefricos, etc. si forman parte de los sistemas de trnsito urbanos o suburbanos.\n',0,0),(630,'4932','Transporte por taxi',4,'49.32 Transporte por taxi\nEsta clase comprende tambin:\n- el alquiler de vehculos privados con conductor\n',0,0),(631,'4939','Otros tipos de transporte terrestre de pasajeros n.c.o.p.',4,'49.39 Otros tipos de transporte terrestre de pasajeros n.c.o.p\nEsta clase comprende:\n- otro transporte de pasajeros por carretera\n los servicios regulares de autobuses de largo recorrido\n los servicios discrecionales de autocares, para excursiones, etc.\n los servicios de los autobuses dentro de los aeropuertos\n- la explotacin de funiculares, telefricos, telesillas, etc. si no forman parte de los sistemas de trnsito urbanos o\nsuburbanos.\nEsta clase comprende tambin:\n- la explotacin de autobuses escolares y autobuses para el transporte de empleados\n- el transporte de pasajeros en vehculos de traccin animal o manual\n',0,0),(632,'494','Transporte de mercancas por carretera y servicios de mudanza',3,'49.4 Transporte de mercancas por carretera y servicios de mudanza\nEste grupo comprende todas las actividades de transporte terrestre de mercancas, salvo el transporte por ferrocarril\n',0,0),(633,'4941','Transporte de mercancas por carretera',4,'49.41 Transporte de mercancas por carretera\nEsta clase comprende:\n- todos los servicios de transporte de mercancas por carretera:\n transporte de troncos\n transporte de animales\n transporte frigorfico\n transporte pesado\n transporte de mercancas a granel, incluido el transporte en camiones cisterna, como la recogida de leche en las\nexplotaciones\n transporte de automviles\n transporte de residuos y materiales de desecho, sin incluir la recogida y la eliminacin\nEsta clase comprende tambin:\n- el alquiler de camiones con conductor\n- el transporte de mercancas en vehculos de traccin animal o manual\n',0,0),(634,'4942','Servicios de mudanza',4,'49.42 Servicios de mudanza\nEsta clase comprende:\n- los servicios de mudanza por carretera para empresas y hogares\n',0,0),(635,'495','Transporte por tubera',3,'49.5 Transporte por tubera\n',0,0),(636,'4950','Transporte por tubera',4,'49.50 Transporte por tubera\nEsta clase comprende:\n- el transporte de gases, lquidos, agua, lodos y otros productos por tuberas\nEsta clase comprende tambin:\n- las actividades de las estaciones de bombeo\n',0,0),(637,'50','Transporte martimo y por vas navegables interiores',2,'50 Transporte martimo y por vas navegables interiores\nEsta divisin comprende el transporte martimo y por vas de navegacin interiores de pasajeros o mercancas, sea\nregular o no. Comprende tambin el transporte por remolque o impulso de barcazas, los barcos de excursin,\ntursticos o cruceros, los transbordadores, las embarcaciones taxi, etc. Aunque la ubicacin es un factor para la\nseparacin entre transporte martimo y por vas de navegacin interior, el factor principal es el tipo de embarcacin\nque se utilice. El transporte en buques de altura se clasifica en los grupos 50.1 y 50.2, mientras que el transporte que\nutiliza otros tipos de embarcacin se clasifica en los grupos 50.3 y 50.4.\nEsta divisin no comprende las actividades de servicio de bar y restaurante a bordo de embarcaciones (vase 56.10\ny 56.30), prestadas por unidades independientes.\n',0,0),(638,'501','Transporte martimo de pasajeros',3,'50.1 Transporte martimo de pasajeros\nEste grupo comprende el transporte de pasajeros en embarcaciones diseadas para navegar por aguas marinas,\nincluidas las costeras. Comprende tambin el transporte de pasajeros en grandes lagos, etc. cuando se utilizan los\nmismos tipos de embarcaciones.\n',0,0),(639,'5010','Transporte martimo de pasajeros',4,'50.10 Transporte martimo de pasajeros\nEsta clase comprende:\n- el transporte martimo (incluido el costero) de pasajeros, regular o no:\n las actividades de los barcos de excursin, tursticos o cruceros\n las actividades de los transbordadores, embarcaciones taxi, etc.\nEsta clase comprende tambin:\n- el alquiler de embarcaciones de recreo con tripulacin para transporte martimo (incluido el costero) (por ejemplo,\npara cruceros de pesca)\n',0,0),(640,'502','Transporte martimo de mercancas',3,'50.2 Transporte martimo de mercancas\nEste grupo comprende el transporte de mercancas en embarcaciones diseadas para navegar por aguas marinas,\nincluidas las costeras. Comprende tambin el transporte de mercancas en grandes lagos, etc. cuando se utilizan los\nmismos tipos de embarcaciones.\n',0,0),(641,'5020','Transporte martimo de mercancas',4,'50.20 Transporte martimo de mercancas\nEsta clase comprende:\n- el transporte martimo (incluido el costero) de mercancas, regular o no\n- el transporte por remolque o impulso de barcazas, plataformas petrolferas, etc.\nEsta clase comprende tambin:\n- el alquiler de embarcaciones con tripulacin para el transporte martimo (incluido el costero) de mercancas\n',0,0),(642,'503','Transporte de pasajeros por vas navegables interiores',3,'50.3 Transporte de pasajeros por vas navegables interiores\nEste grupo comprende el transporte de pasajeros por vas de navegacin interior, realizado por embarcaciones que\nno son adecuadas para el transporte martimo\n',0,0),(643,'5030','Transporte de pasajeros por vas navegables interiores',4,'50.30 Transporte de pasajeros por vas navegables interiores\nEsta clase comprende:\n- el transporte de pasajeros por ros, canales, lagos y otras vas navegables, incluidos puertos y drsenas\nEsta clase comprende tambin:\n- el alquiler de embarcaciones de recreo con tripulacin para transporte por vas de navegacin interior\n',0,0),(644,'504','Transporte de mercancas por vas navegables interiores',3,'50.4 Transporte de mercancas por vas navegables interiores\nEste grupo comprende el transporte de mercancas por vas de navegacin interior, realizado por embarcaciones\nque no son adecuadas para el transporte martimo\n',0,0),(645,'5040','Transporte 