iales\n- el transporte espacial de mercancas y pasajeros\n',0,0),(652,'52','Almacenamiento y actividades anexas al transporte',2,'52 Almacenamiento y actividades anexas al transporte\nEsta divisin comprende el almacenamiento y las actividades complementarias para el transporte, como la\nexplotacin de la infraestructura de transporte (por ejemplo, aeropuertos, puertos, tneles, puentes, etc.), las\nactividades de las agencias de transporte y la manipulacin de mercancas.\n',0,0),(653,'521','Depsito y almacenamiento',3,'52.1 Depsito y almacenamiento\n',0,0),(654,'5210','Depsito y almacenamiento',4,'52.10 Depsito y almacenamiento\nEsta clase comprende:\n- la explotacin de instalaciones de almacenamiento y depsito de todo tipo de mercancas:\n la explotacin de silos, almacenes generales para mercancas, almacenes frigorficos, tanques de\nalmacenamiento, etc.\nEsta clase comprende tambin:\n- el almacenamiento de mercancas en zonas francas\n- los servicios de ultracongelacin\n',0,0),(655,'522','Actividades anexas al transporte',3,'52.2 Actividades anexas al transporte\nEste grupo comprende las actividades complementarias para el transporte de pasajeros o mercancas, como la\nexplotacin de partes de la infraestructura de transporte o las actividades relacionadas con la manipulacin de\nmercancas inmediatamente antes o despus o entre segmentos de transporte. Comprende la explotacin y el\nmantenimiento de todas las instalaciones de transporte.\n',0,0),(656,'5221','Actividades anexas al transporte terrestre',4,'52.21 Actividades anexas al transporte terrestre\nEsta clase comprende:\n- las actividades relacionadas con el transporte terrestre de pasajeros, animales o mercancas:\n la explotacin de servicios de terminales, como estaciones de ferrocarril y de autobs, estaciones para las\noperaciones de carga\n la explotacin de infraestructura ferroviaria\n la explotacin de carreteras, puentes, tneles, estacionamientos o garajes, estacionamientos de bicicletas,\nalmacenamiento invernal de caravanas\n- las operaciones de cambios de agujas y cambios de va\n- el remolque y la asistencia en carretera\nEsta clase comprende tambin:\n- la licuefaccin de gas para su transporte\n',0,0),(657,'5222','Actividades anexas al transporte martimo y por vas navegables interiores',4,'52.22 Actividades anexas al transporte martimo y por vas navegables interiores\nEsta clase comprende:\n- las actividades relacionadas con el transporte martimo y fluvial de pasajeros, animales o mercancas:\n la explotacin de servicios de terminales, como puertos y muelles\n la explotacin de esclusas de canales, etc.\n las actividades de navegacin, pilotaje y atraque\n las actividades de descarga en gabarras desde el buque hasta tierra y las actividades de salvamento martimo\n las actividades de los faros\n',0,0),(658,'5223','Actividades anexas al transporte areo',4,'52.23 Actividades anexas al transporte areo\nEsta clase comprende:\n- las actividades anexas al transporte areo de pasajeros, animales o mercancas:\n la explotacin de servicios de terminales, como aeropuertos, etc.\n las actividades de control de trfico areo y aeropuertos\n las actividades de servicios de tierra en aeropuertos, etc.\nEsta clase comprende tambin:\n- los servicios de prevencin y extincin de incendios en aeropuertos\n',0,0),(659,'5224','Manipulacin de mercancas',4,'52.24 Manipulacin de mercancas\nEsta clase comprende:\n- la carga y descarga de mercancas o equipaje de pasajeros independientemente del modo de transporte utilizado\n- las operaciones de estiba\n- la carga y descarga de los vagones de mercancas ferroviarios\n',0,0),(660,'5229','Otras actividades anexas al transporte',4,'52.29 Otras actividades anexas al transporte\nEsta clase comprende:\n- la expedicin de mercancas\n- la planificacin y organizacin de las operaciones de transporte por ferrocarril, carretera, mar o aire\n- la organizacin de remesas individuales o de grupos (incluidas la recogida y el reparto de las mercancas y la\nagrupacin de las remesas)\n- la obtencin y emisin de documentos de transporte y hojas de ruta\n- las actividades de los agentes de aduanas\n- las actividades de las agencias de transporte de mercancas por mar y por aire\n- actividades de intermediacin para espacio de embarcaciones y aeronaves\n- las operaciones de manipulacin de mercancas, como el embalaje temporal de las mercancas con el nico\npropsito de protegerlas durante el transporte, su desembalaje, la extraccin de muestras y el pesaje de mercancas\n',0,0),(661,'53','Actividades postales y de correos',2,'53 Actividades postales y de correos\nEsta divisin comprende las actividades postales y de correos, como la recogida, el transporte y el reparto de cartas\ny paquetes. Comprende tambin el reparto local y los servicios de mensajera.\n',0,0),(662,'531','Actividades postales sometidas a la obligacin del servicio universal',3,'53.1 Actividades postales sometidas a la obligacin del servicio universal\n',0,0),(663,'5310','Actividades postales sometidas a la obligacin del servicio universal',4,'53.10 Actividades postales sometidas a la obligacin del servicio universal\nEsta clase comprende las actividades de los servicios postales que funcionan con arreglo a la obligacin de servicio\nuniversal. Las actividades incluyen el uso de la estructura de servicio universal, incluidos los puntos minoristas, las\ninstalaciones de clasificacin y tramitacin, y las rutas de transporte para recoger y entregar el correo. El reparto\npuede incluir correspondencia, es decir, cartas, tarjetas postales, papel impreso (peridicos, publicaciones\nperidicas, artculos publicitarios, etc.), paquetes pequeos, mercancas o documentos. Se incluyen tambin otros\nservicios necesarios para dar apoyo a la obligacin de servicio universal.\nEsta clase comprende:\n- la recogida, la clasificacin, el transporte y el reparto (nacional o internacional) de correspondencia y pequeos\npaquetes (adecuados para su envo por correo) por parte de los servicios postales que funcionan con arreglo a la\nobligacin de servicio universal. Pueden utilizarse una o ms medios de transporte, y la actividad puede realizarse\nmediante transporte propio (privado) o mediante transporte pblico.\n- la recogida de correspondencia y de paquetes en los buzones y las estafetas de correos\n',0,0),(664,'532','Otras actividades postales y de correos',3,'53.2 Otras actividades postales y de correos\n',0,0),(665,'5320','Otras actividades postales y de correos',4,'53.20 Otras actividades postales y de correos\nEsta clase comprende:\n- la recogida, la clasificacin, el transporte y la reparto (nacional o internacional) de correspondencia y pequeos\npaquetes (adecuados para su envo por correo) por parte de empresas que no funcionan con arreglo a la obligacin\nde servicio universal. Pueden utilizarse uno o ms medios de transporte, y la actividad puede realizarse mediante\ntransporte propio (privado) o mediante transporte pblico.\nEsta clase comprende tambin:\n- los servicios de entrega a domicilio\n',0,0),(666,'I','Hostelera',1,NULL,0,0),(667,'55','Servicios de alojamiento',2,'55 Servicios de alojamiento\nEsta divisin comprende la prestacin de alojamiento para estancias cortas a turistas y viajeros. Comprende tambin\nla provisin de alojamiento para estancias largas a estudiantes, trabajadores y similares. Algunas unidades ofrecen\nslo alojamiento, mientras que otras ofrecen, adems de alojamiento, comidas y/o servicios recreativos.\nEsta divisin no comprende las actividades relacionadas con la provisin de residencias principales a largo plazo en\ninstalaciones como apartamentos, que suelen alquilarse por meses o aos, y que estn clasificadas en Actividades\ninmobiliarias (seccin L).\n',1,1),(668,'551','Hoteles y alojamientos similares',3,'55.1 Hoteles y alojamientos similares\n',0,0),(669,'5510','Hoteles y alojamientos similares',4,'55.10 Hoteles y alojamientos similares\nEsta clase comprende la provisin de alojamiento, normalmente por das o semanas, principalmente para estancias\ncortas de turistas. Comprende la provisin de alojamiento en habitaciones o suites amuebladas. El servicio\ncomprende la limpieza y el arreglo diario de la habitacin. Pueden ofrecer otros servicios como servicios de comida y\nbebida, estacionamiento, lavandera, piscina y gimnasio, instalaciones recreativas as como salas de conferencias y\nconvenciones.\nEsta clase comprende el alojamiento que ofrecen:\n- hoteles\n- complejos tursticos\n- aparthoteles\n- moteles\n',0,0),(670,'552','Alojamientos tursticos y otros alojamientos de corta estancia',3,'55.2 Alojamientos tursticos y otros alojamientos de corta estancia\n',1,1),(671,'5520','Alojamientos tursticos y otros alojamientos de corta estancia',4,'55.20 Alojamientos tursticos y otros alojamientos de corta estancia\nEsta clase comprende la provisin de alojamiento, normalmente por das o semanas, principalmente para estancias\ncortas de turistas, en espacios con entrada independiente que constan de habitaciones amuebladas o zonas para\nestar, comer y dormir, con instalaciones para cocinar o con cocinas totalmente equipadas. Puede tratarse de pisos o\napartamentos en pequeos edificios o grupos de edificios, de varias plantas e independientes, o bien de bungalows,\nchalets o casas de campo y cabaas de una sola planta. Los servicios complementarios que se ofrecen son mnimos\no nulos.\nEsta clase comprende el alojamiento que ofrecen:\n- campamentos y otras casas de vacaciones\n- apartamentos y bungalows\n- casas de campo y cabaas sin servicios de limpieza y similares\n- albergues juveniles y refugios de montaa\n',0,0),(672,'553','Camping y aparcamientos para caravanas',3,'55.3 Campings y aparcamientos para caravanas\n',0,0),(673,'5530','Camping y aparcamientos para caravanas',4,'55.30 Campings y aparcamientos para caravanas\nEsta clase comprende:\n- la provisin de alojamiento en campings, campamentos para caravanas, campamentos recreativos y campamentos\nde caza y pesca, para estancias de corta duracin\n- la provisin de espacio e instalaciones para vehculos recreativos\nEsta clase comprende tambin el alojamiento que ofrecen:\n- refugios o vivaques donde instalar tiendas de campaa o sacos de dormir\n',0,0),(674,'559','Otros alojamientos',3,'55.9 Otros alojamientos\n',0,0),(675,'5590','Otros alojamientos',4,'55.90 Otros alojamientos\nEsta clase comprende la provisin de alojamiento temporal o de ms larga duracin en habitaciones individuales o\ncompartidas, o en residencias de estudiantes, albergues para trabajadores migrantes (temporeros) y similares.\nEsta clase comprende:\n- residencias de estudiantes\n- residencias escolares\n- albergues para trabajadores\n- pensiones y casas de huspedes\n- coches-cama\n',0,0),(676,'56','Servicios de comidas y bebidas',2,'56 Servicios de comidas y bebidas\nEsta divisin comprende las actividades de prestacin de servicios de comidas y bebidas que ofrecen comidas o\nbebidas completas listas para su consumo inmediato, bien en restaurantes tradicionales, autoservicios o de comida\npara llevar, o bien en puestos permanentes o temporales con plazas para sentarse o sin ellas. Lo decisivo es que se\nofrezcan comidas listas para su consumo inmediato, y no el tipo de instalacin que presta el servicio.\nSe excluye la produccin de comidas no listas para su consumo inmediato o no pensadas para su consumo\ninmediato, o bien de productos alimenticios preparados que no se considera que constituyan una comida (vanse las\ndivisiones 10 y 11). Tambin se excluye la venta de productos alimenticios que no sean de produccin propia que se\nconsidere que no constituyen una comida o de comidas no aptas para su consumo inmediato (vase la seccin G).\n',0,0),(677,'561','Restaurantes y puestos de comidas',3,'56.1 Restaurantes y puestos de comidas\n',0,0),(678,'5610','Restaurantes y puestos de comidas',4,'56.10 Restaurantes y puestos de comidas\nEsta clase comprende la prestacin de servicios de comida a clientes, ya servicio de mesa o sirvindose ellos\nmismos de un surtido de productos, bien consumiendo la comida en el mismo local, llevndosela o a domicilio. Se\nincluyen en este apartado las comidas preparadas y servidas para su consumo inmediato que se adquieren en\nvehculos con motor o en carritos sin motor.\nEsta clase comprende las actividades de:\n- restaurantes\n- cafeteras\n- restaurantes de comida rpida\n- lugares que ofrecen comida para llevar\n- vendedores de helados en carrito\n- carritos ambulantes de comida\n- preparacin de comida en puestos de mercadillo\nEsta clase comprende tambin:\n- actividades de restaurantes y bares relacionadas con el transporte, prestadas por unidades independientes\n',0,0),(679,'562','Provisin de comidas preparadas para eventos y otros servicios de comidas',3,'56.2 Provisin de comidas preparadas para eventos y otros servicios de comidas\nEste grupo comprende las actividades de provisin de comidas preparadas para eventos o durante un periodo\ndeterminado, y la explotacin de concesiones del servicio de restauracin en instalaciones como las deportivas o\nsimilares.\n',0,0),(680,'5621','Provisin de comidas preparadas para eventos',4,'56.21 Provisin de comidas preparadas para eventos\nEsta clase comprende la provisin de comidas en funcin de unos acuerdos contractuales con el cliente, en el lugar\nque ste especifique y para un evento determinado.\n',0,0),(681,'5629','Otros servicios de comidas',4,'56.29 Otros servicios de comidas\nEsta clase comprende la provisin industrial de comidas preparadas, es decir, la provisin de servicios de comida en\nfuncin de unos acuerdos contractuales con el cliente y durante un periodo determinado.\nComprende tambin la explotacin de concesiones del servicio de restauracin en instalaciones como las deportivas\no similares. La comida suele prepararse en una unidad central.\nEsta clase comprende:\n- las actividades de los contratistas de servicios de restauracin (por ejemplo para compaas de transporte)\n- la explotacin de concesiones del servicio de restauracin en instalaciones como las deportivas o similares.\n- la explotacin de cantinas o cafeteras (por ejemplo, en fbricas, oficinas, hospitales o escuelas) en rgimen de\nconcesin\n',0,0),(682,'563','Establecimientos de bebidas',3,'56.3 Establecimientos de bebidas\n',0,0),(683,'5630','Establecimientos de bebidas',4,'56.30 Establecimientos de bebidas\nEsta clase comprende la preparacin y el servicio de bebidas para su consumo inmediato en el mismo local.\nEsta clase comprende las actividades de:\n- bares\n- tabernas\n- bares de copas\n- discobares y discopubs (donde la actividad predominante es servir bebidas)\n- cerveceras\n- cafs\n- bares de zumos de frutas\n- vendedores ambulantes de bebidas\n',0,0),(684,'J','Informacin y comunicaciones',1,NULL,0,0),(685,'58','Edicin',2,'58 Edicin\nEsta divisin comprende la edicin de libros, folletos informativos, folletos publicitarios, diccionarios, enciclopedias,\natlas, mapas y planos; edicin de peridicos, revistas y publicaciones peridicas; directorios y listas de direcciones\npostales y otras publicaciones, as como edicin de programas informticos.\nLa edicin incluye la adquisicin de los derechos de autor de los contenidos (productos de informacin) y la puesta\nde stos a disposicin del pblico en general mediante la participacin en (o el encargo de) la reproduccin y\ndistribucin de los mismos en diversas formas. Esta divisin comprende todos los formatos de edicin posibles\n(impreso, electrnico o de audio, por Internet, en productos multimedia como los libros de consulta en CD-ROM,\netc.), excepto la edicin de pelculas.\nEsta divisin no comprende la edicin de pelculas, cintas de vdeo y pelculas en DVD o medios similares (vase la\ndivisin 59) y la produccin de copias maestras para discos o material de audio (divisn 59). Tampoco comprende la\nimpresin (vanse 18.11 y 18.12) y la reproduccin masiva de soportes grabados (vase 18.20).\n',1,1),(686,'581','Edicin de libros, peridicos y otras actividades editoriales',3,'58.1 Edicin de libros, peridicos y otras actividades editoriales\nEste grupo comprende las actividades de edicin de libros, peridicos, revistas y otras publicaciones peridicas,\ndirectorios y listas de direcciones postales, as como otros trabajos como fotografas, grabados, tarjetas postales,\nhorarios, formularios, carteles y reproducciones de obras de arte. Estas obras se caracterizan por la creatividad\nintelectual que requiere su desarrollo y suelen estar protegidas por derechos de autor.\n',0,0),(687,'5811','Edicin de libros',4,'58.11 Edicin de libros\nEsta clase comprende las actividades de edicin de libros en formato impreso, electrnico (CD, pantallas\nelectrnicas, etc.), de audio o por Internet.\nComprende:\n- la edicin de libros, folletos y publicaciones similares, incluida la edicin de diccionarios y enciclopedias\n- la edicin de atlas, mapas y planos\n- edicin de libros de audio\n- la edicin de enciclopedias, etc. en CD-ROM\n',0,0),(688,'5812','Edicin de directorios y guias de direcciones postales',4,'58.12 Edicin de directorios y guas de direcciones postales\nEsta clase comprende la edicin de listas de datos/informacin (bases de datos), cuyo formato est sujeto a\nproteccin, pero no su contenido. Estas listas pueden editarse en formato impreso o electrnico.\nEsta clase comprende:\n- la edicin de listas de direcciones postales\n- la edicin de guas telefnicas\n- la edicin de otros tipos de directorios y compilaciones, como jurisprudencia, vademcums farmacuticos, etc.\n',0,0),(689,'5813','Edicin de peridicos',4,'58.13 Edicin de peridicos\nEsta clase comprende edicin de peridicos, incluidos los publicitarios, con una periodicidad mnima de cuatro veces\npor semana. Esta edicin puede hacerse en formato impreso o electrnico, incluido Internet.\n',0,0),(690,'5814','Edicin de revistas',4,'58.14 Edicin de revistas\nEsta clase comprende la edicin de diarios y otras publicaciones peridicas, con una periodicidad inferior a cuatro\nveces por semana. Esta edicin puede hacerse en formato impreso o electrnico, incluido Internet. Se incluye en\neste apartado la edicin de las programaciones de radio y televisin.\n',0,0),(691,'5819','Otras actividades editoriales',4,'58.19 Otras actividades editoriales\nEsta clase comprende:\n- la edicin (incluida la edicin on-line) de:\n catlogos\n fotografas, grabados y postales\n tarjetas de felicitacin\n formularios\n carteles, reproducciones de obras de arte\n material publicitario\n otros materiales impresos\n- la edicin on-line de estadsticas y otra informacin\n',0,0),(692,'582','Edicin de programas informticos',3,'58.2 Edicin de programas informticos\n',1,1),(693,'5821','Edicin de videojuegos',4,'58.21 Edicin de videojuegos\nEsta clase comprende:\n- la edicin de juegos de ordenador para todo tipo de plataforma\n',0,0),(694,'5829','Edicin de otros programas informticos',4,'58.29 Edicin de otros programas informticos\nEsta clase comprende:\n- la edicin de programas informticos estndar (no personalizados), incluida la traduccin o adaptacin a un\nmercado particular, por cuenta propia, de los programas no personalizados.\n los sistemas operativos\n aplicaciones empresariales y de otro tipo\n',0,0),(695,'59','Actividades cinematogrficas, de video y de programas de televisin, grabacin de sonido y edicin musical',2,'59 Actividades cinematogrficas, de vdeo y de programas de televisin, grabacin de sonido y edicin\nmusical\nEsta divisin comprende la produccin de pelculas, sean o no de ficcin, utilizando pelcula de celuloide, cinta de\nvdeo o disco para su proyeccin directa en salas de proyeccin o para su emisin por televisin; actividades\nauxiliares, tales como la edicin, el montaje, el doblaje de pelculas, etc.; la distribucin de pelculas y otras\nproducciones cinematogrficas a otros sectores industriales, as como la proyeccin de stas. Comprende asimismo\nla compra y la venta de los derechos de distribucin de pelculas y otras producciones cinematogrficas.\nEsta divisin comprende tambin las actividades de grabacin de sonido, es decir, la produccin de grabaciones\nsonoras originales, la edicin, promocin y distribucin de stas, las actividades de edicin de msica as como los\nservicios de grabacin de sonido en un estudio u otro lugar.\n',0,0),(696,'591','Actividades cinematogrficas, de video y de programas de televisin',3,'59.1 Actividades cinematogrficas, de vdeo y de programas de televisin\nEste reunin comprende la produccin de pelculas, sean o no de ficcin, utilizando pelcula de celuloide, cinta de\nvdeo, DVD u otro soporte, incluida la distribucin digital, para su proyeccin directa en salas de proyeccin o para\nsu emisin por televisin; actividades auxiliares, tales como la edicin, el montaje, el doblaje de pelculas, etc.; la\ndistribucin de pelculas u otras producciones cinematogrficas (cintas de vdeo, DVD, etc.) a otros sectores\nindustriales; as como la proyeccin de stas. Comprende tambin la compra y la venta de los derechos de\ndistribucin de pelculas y otras producciones cinematogrficas.\n',0,0),(697,'5911','Actividades de produccin cinematogrficas, de vdeo y de programas de televisin',4,'59.11 Actividades de produccin cinematogrfica, de vdeo y de programas de televisin\nEsta clase comprende:\n- la produccin cinematogrfica, de vdeo y de programas de televisin (series, documentales, etc.), o de anuncios\npublicitarios para la TV.\n',0,0),(698,'5912','Actividades de postproduccin cinematogrfica, de vdeo y de programas de televisin',4,'59.12 Actividades de postproduccin cinematogrfica, de vdeo y de programas de televisin\nEsta clase comprende las actividades de post-produccin como la edicin, la transferencia de pelculas/cintas, la\nadicin de texto, los subttulos, los crditos, los subttulos ocultos, los grficos generados por ordenador, la\nanimacin y los efectos especiales, el positivado y revelado de pelculas de celuloide, las actividades de los\nlaboratorios de pelculas de celuloide y las actividades de los laboratorios especializados en pelculas de dibujos\nanimados.\nEsta clase comprende tambin:\n- las filmotecas con archivo de imgenes, etc.\n',0,0),(699,'5913','Actividades de distribucin cinematogrfica, de vdeo y de programas de televisin',4,'59.13 Actividades de distribucin cinematogrfica, de vdeo y de programas de televisin\nEsta clase comprende:\n- la distribucin de pelculas de celuloide, cintas de vdeo, DVD y productos similares a salas de proyeccin, cadenas\ny canales de televisin y empresas de exhibicin.\nEsta clase comprende tambin:\n- la adquisicin de los derechos de distribucin de las pelculas de celuloide, las cintas de vdeo y los DVD.\n',0,0),(700,'5914','Actividades de exhibicin cinematogrfica',4,'59.14 Actividades de exhibicin cinematogrfica\nEsta clase comprende:\n- las actividades de proyeccin de pelculas o vdeos en salas cinematogrficas, al aire libre o en otras salas de\nproyeccin\n- las actividades de los cineclubes.\n',0,0),(701,'592','Actividades de grabacin de sonido y edicin musical',3,'59.2 Actividades de grabacin de sonido y edicin musical\n',0,0),(702,'5920','Actividades de grabacin de sonido y edicin musical',4,'59.20 Actividades de grabacin de sonido y edicin musical\nEsta clase comprende las actividades de produccin de grabaciones sonoras originales, como cintas o CD; as como\nla publicacin, promocin y distribucin de las grabaciones a los mayoristas, minoristas o directamente al pblico.\nEstas actividades pueden o no estar integradas en la misma unidad que la produccin de grabaciones originales. Si\nno lo estn, la unidad que realiza estas actividades tiene que obtener los derechos de reproduccin y distribucin de\nlas grabaciones originales. Esta clase comprende tambin los servicios de grabacin de sonido en un estudio o en\notro lugar, incluida la produccin de programas grabados de radio (es decir, no en directo).\nComprende asimismo las actividades de edicin musical, es decir, las actividades de adquisicin y registro de los\nderechos de autor para las composiciones musicales; la promocin, autorizacin y utilizacin de estas\ncomposiciones en grabaciones, en la radio, la televisin y el cine, los espectculos en directo y los soportes\nimpresos o de otro tipo. Las unidades que participan en estas actividades pueden ser propietarias de los derechos o\nactuar como administradoras de los derechos musicales, en nombre de los titulares de los mismos. Se incluye en\neste apartado la edicin de msica y partituras musicales.\n',0,0),(703,'60','Actividades de programacin y emisin de radio y televisin',2,'60 Actividades de programacin y emisin de radio y televisin\nEsta divisin comprende las actividades de creacin de contenidos o adquisicin de derechos de distribucin de\ncontenidos y, posteriormente, la emisin de tales contenidos, por ejemplo, radio, televisin y programas de datos de\nespectculos, noticias, debates y similares. Comprende tambin emisin de datos, que suele estar integrada con la\nemisin radiofnica o televisiva. La emisin puede efectuarse utilizando distintas tecnologas: por ondas, por satlite,\npor cable o por Internet. Esta divisin comprende tambin la produccin de programas por lo general limitados en su\nnaturaleza (con un formato limitado, como noticias, deportes, educacin y programas dirigidos a los jvenes), en\nrgimen de suscripcin o de pago, a un tercero, para su emisin posterior al pblico.\nEsta divisin no comprende la distribucin de programas por cable y otros tipos de programas por suscripcin (vase\nla divisin 61).\n',0,0),(704,'601','Actividades de radiodifusin',3,'60.1 Actividades de radiodifusin\n',0,0),(705,'6010','Actividades de radiodifusin',4,'60.10 Actividades de radiodifusin\nEsta clase comprende:\n- las actividades de emisin de seales de audio a travs de instalaciones y estudios de radiodifusin para la\ntransmisin de programas orales al pblico, los abonados o los suscriptores.\nEsta clase comprende tambin:\n- las actividades de las cadenas radiofnicas, es decir, el montaje y la transmisin de programas orales a los\nabonados o suscriptores a emisiones por ondas, por cable o por satlite.\n- las actividades de radiodifusin por Internet (emisoras de radio en Internet).\n- la emisin de datos integrada con la emisin radiofnica.\n',0,0),(706,'602','Actividades de programacin y emisin de televisin',3,'60.2 Actividades de programacin y emisin de televisin\n',0,0),(707,'6020','Actividades de programacin y emisin de televisin',4,'60.20 Actividades de programacin y emisin de televisin\nEsta clase comprende la creacin del programa completo de una cadena de televisin, desde la compra de\ncomponentes del programa (por ejemplo, pelculas, documentales, etc.) hasta la produccin propia de los\ncomponentes (por ejemplo, noticias locales, reportajes en directo) o una combinacin de las dos opciones.\nEste programa completo de televisin puede ser emitido por las unidades de produccin o bien producirse para su\ntransmisin por terceros distribuidores, como compaas de emisin por cable o proveedores de televisin por\nsatlite.\nLa programacin puede ser de carcter general o especializado (por ejemplo formatos limitados como noticias,\ndeportes, programacin educativa u orientada a los jvenes). Esta clase comprende la programacin puesta a\ndisposicin de los usuarios de forma gratuita, as como la programacin disponible nicamente por suscripcin. La\nprogramacin de los canales de vdeo bajo demanda tambin est incluida aqu.\nEsta clase comprende tambin la distribucin de datos integrada con la difusin de televisin.\n',0,0),(708,'61','Telecomunicaciones',2,'61 Telecomunicaciones\nEsta divisin comprende las actividades de prestacin de servicios de telecomunicacin y similares, es decir, la\ntransmisin de voz, datos, texto, sonido y vdeo. Las instalaciones de transmisin que llevan a cabo estas\nactividades pueden realizarlas con una sola o varias tecnologas. Las actividades clasificadas en esta divisin tienen\nen comn la transmisin de contenidos, sin participar en su creacin. El desglose en esta divisin se basa en el tipo\nde infraestructura que se explote.\nEn el caso de la transmisin de seales de televisin, esto puede incluir la agrupacin de programas completos de\nun canal (producidos en la divisin 60) en paquetes de programas para su distribucin.\n',0,0),(709,'611','Telecomunicaciones por cable',3,'61.1 Telecomunicaciones por cable\n',0,0),(710,'6110','Telecomunicaciones por cable',4,'61.10 Telecomunicaciones por cable\nEsta clase comprende las actividades de explotacin, mantenimiento o concesin de acceso a instalaciones para la\ntransmisin de voz, datos, texto, sonido y vdeo utilizando una infraestructura de telecomunicaciones por cable:\n- la explotacin y el mantenimiento de instalaciones de conmutacin y transmisin para ofrecer comunicaciones\npunto a punto a travs de lneas terrestres, microondas o una mezcla de lneas terrestres y enlaces por satlite\n- la explotacin de sistemas de distribucin por cable (por ejemplo, distribucin de datos y seales de televisin)\n- la oferta de comunicaciones telegrficas y otras de tipo no vocal utilizando sus propias instalaciones.\nLas instalaciones de transmisin que llevan a cabo estas actividades pueden realizarlas con una sola o varias\ntecnologas\nEsta clase comprende tambin:\n- la compra de acceso y capacidad de red concedida por los propietarios y operadores de las redes, as como la\nprestacin de servicios de telecomunicaciones que utilizan esta capacidad a empresas y hogares\n- la provisin de acceso a Internet por parte del operador de la infraestructura de cable\n',0,0),(711,'612','Telecomunicaciones inalmbricas',3,'61.2 Telecomunicaciones inalmbricas\n',0,0),(712,'6120','Telecomunicaciones inalmbricas',4,'61.20 Telecomunicaciones inalmbricas\nEsta clase comprende:\n- las actividades de explotacin, mantenimiento o concesin de acceso a instalaciones para la transmisin de voz,\ndatos, texto, sonido y vdeo utilizando una infraestructura de telecomunicaciones inalmbrica\n- las actividades de mantenimiento y explotacin de redes de telecomunicacin inalmbricas como los localizadores,\nlos mviles, etc.\nEstos servicios ofrecen una transmisin unidireccional a travs de las ondas, y pueden estar basadas en una sola o\nen varias tecnologas.\nEsta clase comprende tambin:\n- la compra de acceso y capacidad de red concedida por los propietarios y operadores de las redes, as como la\nprestacin de servicios de telecomunicacin inalmbrica (excepto por satlite) que utilizan esta capacidad a\nempresas y hogares\n- la provisin de acceso a Internet por parte del operador de la infraestructura inalmbrica\n',0,0),(713,'613','Telecomunicaciones por satlite',3,'61.3 Telecomunicaciones por satlite\n',0,0),(714,'6130','Telecomunicaciones por satlite',4,'61.30 Telecomunicaciones por satlite\nEsta clase comprende:\n- las actividades de explotacin, mantenimiento o concesin de acceso a instalaciones para la transmisin de voz,\ndatos, texto, sonido y vdeo utilizando una infraestructura de telecomunicaciones por satlite\n- la oferta de programacin visual, oral o textual recibida de redes por cable, estaciones de televisin locales o redes\nde radio, a los consumidores a travs de sistemas de transmisin por satlite directo a casa (las unidades\nclasificadas en este apartado no suelen tener material de programacin propio).\nEsta clase comprende tambin:\n- la provisin de acceso a Internet por parte del operador de la infraestructura de comunicacin por satlite.\n',0,0),(715,'619','Otras actividades de telecomunicaciones',3,'61.9 Otras actividades de telecomunicaciones\n',0,0),(716,'6190','Otras actividades de telecomunicaciones',4,'61.90 Otras actividades de telecomunicaciones\nEsta clase comprende:\n- la provisin de aplicaciones de telecomunicaciones especializadas, como las operaciones de seguimiento por\nsatlite, telemetra y radar.\n- la explotacin de estaciones terminales de telecomunicacin por satlite e instalaciones asociadas, conectadas con\nuno o ms sistemas de comunicacin terrestre y capaces de transmitir o recibir telecomunicaciones a/de sistemas de\ntransmisin por satlite.\n- la provisin de acceso a Internet a travs de redes entre el cliente y el proveedor de servicios de Internet que no\nson propiedad de ste ni estn bajo su control, tales como el acceso a Internet por marcacin, etc.\n- la provisin de telefona y acceso a Internet en instalaciones abiertas al pblico\n- prestacin de servicios de telecomunicaciones a travs de las lneas ya existentes:\n provisin de VOIP (protocolo de voz a travs de Internet)\n- revendedores de telecomunicaciones (es decir, compra y venta de capacidad de red sin prestar otros servicios)\n',0,0),(717,'62','Programacin, consultora y otras actividades relacionadas con la informtica',2,'62 Programacin, consultora y otras actividades relacionadas con la informtica\nEsta divisin comprende las siguientes actividades de oferta de conocimientos tcnicos en el campo de las\ntecnologas de la informacin: escritura, modificacin, comprobacin y servicio de asistencia de programas\ninformticos; planificacin y diseo de los sistemas informticos que integran los equipos informticos, los\nprogramas informticos y las tecnologas de comunicacin; gestin y explotacin in situ de los sistemas informticos\nde los clientes y/o de los servicios de tratamiento de datos; y otras actividades profesionales y tcnicas relacionadas\ncon la informtica.\n',2,2),(718,'620','Programacin, consultora y otras actividades relacionadas con la informtica',3,'62.0 Programacin, consultora y otras actividades relacionadas con la informtica\n',2,2),(719,'6201','Actividades de programacin informtica',4,'62.01 Actividades de programacin informtica\nEsta clase comprende la escritura, modificacin, comprobacin y servicio de asistencia de programas informticos.\nEsta clase comprende:\n- el diseo de la estructura y el contenido, y/o la escritura del cdigo informtico necesario para crear e implantar:\n programas para sistemas (incluidos los parches y las actualizaciones)\n aplicaciones informticas (incluidos los parches y las actualizaciones)\n bases de datos\n pginas web\n- personalizacin de programas informticos, es decir, la modificacin y configuracin de una aplicacin existente\npara que funcione en el entorno del sistema informtico del cliente\n',2,2),(720,'6202','Actividades de consultora  informtica',4,'62.02 Actividades de consultora informtica\nEsta clase comprende la planificacin y el diseo de los sistemas informticos que integran equipos informticos,\nprogramas informticos y tecnologas de la comunicacin. Estos servicios pueden incluir la formacin de los usuarios\ndel mismo.\n',0,0),(721,'6203','Gestin de recursos informticos',4,'62.03 Gestin de recursos informticos\nEsta clase comprende los servicios de gestin y explotacin in situ de los sistemas informticos del cliente y/o las\ninstalaciones de tratamiento de datos, as como otros servicios de apoyo relacionados.\n',0,0),(722,'6209','Otros servicios relacionados con las tecnologas de la informacin y la informtica',4,'62.09 Otros servicios relacionados con las tecnologas de la informacin y la informtica\nEsta clase comprende otras actividades relacionadas con la informtica y la tecnologa de la informacin no incluidas\nen otros apartados, como:\n- los servicios de recuperacin de desastres informticos\n- la instalacin (montaje) de ordenadores personales\n- los servicios de instalacin de programas informticos.\n',0,0),(723,'63','Servicio de informacin',2,'63 Servicios de informacin\nEsta divisin comprende las actividades de los portales de bsqueda web, el proceso de datos y el hosting, as como\notras actividades cuyo principal fin es ofrecer informacin.\n',1,1),(724,'631','Proceso de datos, hosting y actividades relacionadas; portales web',3,'63.1 Proceso de datos, hosting y actividades relacionadas; portales web\nEste grupo comprende la provisin de infraestructura para los servicios de hosting y proceso de datos, y otras\nactividades relacionadas con stos, as como la provisin de servicios de bsqueda y otros portales para Internet.\n',1,1),(725,'6311','Proceso de datos, hosting y actividades  relacionadas',4,'63.11 Proceso de datos, hosting y actividades relacionadas\nEsta clase comprende:\n- la provisin de infraestructura para los servicios de hosting y proceso de datos, y otras actividades relacionadas\ncon stos\n- los servicios de h hosting especializado, como:\n hosting de pginas web\n servicios de transferencia continua de imagen y sonido a travs de Internet\n hosting de aplicaciones\n- la prestacin de servicios de aplicaciones\n- los servicios generales a clientes de utilizacin compartida de mainframes\n- el proceso de datos:\n el proceso completo de los datos suministrados por los clientes\n la generacin de informes especializados a partir de los datos suministrados por los clientes\n los servicios de entrada de datos\n',1,1),(726,'6312','Portales web',4,'63.12 Portales web\nEsta clase comprende:\n- la explotacin de sitios web que utilizan un motor de bsqueda para generar y mantener amplias bases de datos de\ndirecciones y contenidos de Internet en un formato que facilita la bsqueda.\n- la explotacin de otros sitios web que actan como portales para Internet, como los sitios de los medios de\ncomunicacin, que actualizan peridicamente sus contenidos.\n',1,1),(727,'639','Otros servicios de informacin',3,'63.9 Otros servicios de informacin\nEste grupo comprende las actividades de las agencias de noticias y del resto de servicios de informacin.\nEste grupo no comprende:\n- las actividades de las bibliotecas y archivos (vase 91.01)\n',0,0),(728,'6391','Actividades de las agencias de noticias',4,'63.91 Actividades de las agencias de noticias\nEsta clase comprende:\n- las actividades de consorcios y agencias de noticias que proporcionan material de noticias, fotografas y artculos a\nlos medios de comunicacin\n',0,0),(729,'6399','Otros servicios de informacin n.c.o.p.',4,'63.99 Otros servicios de informacin n.c.o.p.\nEsta clase comprende otras actividades de prestacin de servicios de informacin no recogidas en otras categoras,\ncomo:\n- los servicios de informacin telefnica basados en la informtica\n- los servicios de bsqueda de informacin realizados por cuenta de terceros\n- servicios de resmenes de noticias, servicios de resmenes de prensa, etc.\n',0,0),(730,'K','Actividades financieras y de seguros',1,NULL,0,0),(731,'64','Servicios financieros, excepto seguros y fondos de pensiones',2,'64 Servicios financieros, excepto seguros y fondos de pensiones\nEsta divisin comprende las actividades de obtencin y redistribucin de fondos, distintas de los seguros, fondos de\npensiones o la seguridad social obligatoria.\nNota: Es probable que la organizacin institucional de cada Estado influya de manera decisiva a la hora de\nestablecer la clasificacin en esta divisin.\n',0,0),(732,'641','Intermediacin monetaria',3,'64.1 Intermediacin monetaria\nEste grupo comprende la obtencin de fondos en forma de depsitos transferibles, es decir, fondos con un valor\nmonetario fijo que se obtienen cotidianamente y que, excepto en el caso del Banco Central, proceden de fuentes no\nfinancieras.\n',0,0),(733,'6411','Banco central',4,'64.11 Banco central\nEsta clase comprende:\n- la emisin y administracin de la moneda nacional\n- la supervisin y control de la masa monetaria\n- la recepcin de depsitos para operaciones de compensacin entre instituciones financieras\n- la supervisin de las operaciones bancarias\n- el mantenimiento de las reservas internacionales del pas\n- el ejercicio de la funcin de banco del gobierno\nLas actividades de los bancos centrales pueden variar por razones institucionales.\n',0,0),(734,'6419','Otra intermediacin monetaria',4,'64.19 Otra intermediacin monetaria\nEsta clase comprende la recepcin de depsitos y/o sustitutos prximos a los mismos, as como la concesin de\ncrditos y prstamos. La concesin de un crdito puede adoptar diversas formas: prstamos, hipotecas, tarjetas de\ncrdito, etc. Estas actividades son realizadas generalmente por instituciones monetarias distintas de los bancos\ncentrales, tales como:\n- bancos\n- cajas de ahorros\n- cooperativas de crdito\nEsta clase comprende tambin:\n- las actividades de las cajas postales de ahorro y los giros postales\n- la concesin de crditos para compra de vivienda por instituciones especializadas que captan recursos en forma de\ndepsitos\n- las actividades de transferencia de dinero\n',0,0),(735,'642','Actividades de las sociedades holding',3,'64.2 Actividades de las sociedades holding\n',0,0),(736,'6420','Actividades de las sociedades holding',4,'64.20 Actividades de las sociedades holding\nEsta clase comprende las actividades de sociedades holding, es decir, de unidades que se dedican a la tenencia de\nlos activos (manteniendo la propiedad de participaciones dominante) de un grupo de sociedades filiales, cuya\nactividad principal es la propiedad del grupo. Las sociedades holding de esta clase no prestan ningn otro servicio a\nlas empresas en las que mantienen una participacin, es decir, no administran ni gestionan otras unidades.\n',0,0),(737,'643','Inversin colectiva, fondos y entidades financieras similares',3,'64.3 Inversin colectiva, fondos y entidades financieras similares\n',0,0),(738,'6430','Inversin colectiva, fondos y entidades financieras similares',4,'64.30 Inversin colectiva, fondos y entidades financieras similares\nEsta clase comprende las personas jurdicas constituidas para la mancomunidad de valores u otros activos\nfinancieros, sin gestionarlos, en nombre de accionistas o beneficiarios. Las carteras se adaptan para obtener\ncaractersticas de inversin especficas, como diversificacin, riesgo, tasa de rentabilidad y volatilidad de precios.\nEstas entidades obtienen intereses, dividendos y otras rentas de la propiedad, pero su nmero de empleados es\nescaso o nulo, y no obtienen ingresos por la venta de servicios.\nEsta clase comprende:\n- fondos de inversin abiertos (open-end)\n- fondos de inversin cerrados (close-end)\n- fondos de inversin colectiva (unit investment trust funds)\n- fideicomisos, herencias o cuentas de agencia, administrados en nombre de los beneficiarios bajo un contrato de\nfideicomiso, testamento o contrato de agencia\n- entidades que piden fondos prestados con el nico objetivo de prestarlos a su matriz directa o indirecta (conduits)\n',0,0),(739,'649','Otros servicios financieros, excepto seguros y fondos de pensiones',3,'64.9 Otros servicios financieros, excepto seguros y fondos de pensiones\nEste grupo comprende los servicios financieros distintos de los prestados por instituciones monetarias.\nEste grupo no comprende:\n- los seguros y fondos de pensiones (vase la divisin 65)\n',0,0),(740,'6491','Arrendamiento financiero',4,'64.91 Arrendamiento financiero\nEsta clase comprende:\n- arrendamientos financieros, con un plazo aproximadamente igual a la vida til esperada del bien, gozando el\narrendatario prcticamente de todas las ventajas de su utilizacin, e incurriendo en todos los riesgos vinculados a la\npropiedad. No es preciso que llegue a efectuarse la transferencia final del bien en cuestin. Estas operaciones de\narrendamiento financiero cubren todos o casi todos los costes, incluidos los intereses.\n',0,0),(741,'6492','Otras actividades crediticias',4,'64.92 Otras actividades crediticias\nEsta clase comprende:\n- las actividades de servicios financieros relacionados fundamentalmente con la concesin de prstamos por\ninstituciones no dedicadas a la intermediacin monetaria en los que el crdito puede adoptar diversas formas, como\nlas de un prstamo, una hipoteca, una tarjeta de crdito, etc., prestando  los siguientes tipos de servicios:\n- la concesin de crditos al consumo\n- la financiacin del comercio internacional\n- el suministro de fondos a largo plazo a la industria por parte de bancos industriales\n- los prstamos monetarios fuera del sistema bancario\n- el otorgamiento de crdito para la adquisicin de vivienda por instituciones especializadas que no reciben depsitos\n- las casas de empeos y prestamistas\n',0,0),(742,'6499','Otros servicios financieros, excepto seguros y fondos de pensiones n.c.o.p.',4,'64.99 Otros servicios financieros, excepto seguros y fondos de pensiones n.c.o.p\nEsta clase comprende:\n- otros servicios financieros consistentes fundamentalmente en la distribucin de fondos por mtodos diferentes al de\nla concesin de prstamos:\n actividades de factoring\n contratacin de swaps, emisin de opciones u otras operaciones de cobertura\n actividades de sociedades especializadas en convenios de liquidacin por adelantado (viatical settlements)\n- actividades de inversin por cuenta propia, como por compaas de capital-riesgo, clubes de inversin, etc.\n',0,0),(743,'65','Seguros, reaseguros y fondos de pensiones, excepto Seguridad Social obligatoria',2,'65 Seguros, reaseguros y fondos de pensiones, excepto Seguridad Social obligatoria\nEsta divisin comprende las anualidades por suscripcin, as como las plizas de seguro y primas de inversin que\nconstituyen una cartera de activos financieros para su utilizacin frente a obligaciones futuras. Se incluye la provisin\ndirecta de seguros y reaseguros.\n',0,0),(744,'651','Seguros',3,'65.1 Seguros\nEste grupo comprende los seguros de vida, contengan o no un elemento importante de ahorro, y los seguros\ndistintos de seguros de vida.\n',0,0),(745,'6511','Seguros de vida',4,'65.11 Seguros de vida\nEsta clase comprende:\n- anualidades por suscripcin y plizas de seguro de vida, plizas de seguro de los ingresos en caso de\ndiscapacidad y plizas de seguro en caso de prdida de miembros o muerte por accidente (contengan o no un\nelemento importante de ahorro).\n',0,0),(746,'6512','Seguros distintos de los seguros de vida',4,'65.12 Seguros distintos de los seguros de vida\nEsta clase comprende:\n- la provisin de servicios de seguros distintos del seguro de vida:\n seguros de accidente y contra incendios\n seguro de enfermedad\n seguros de viaje\n seguro sobre propiedades cosas\n seguro de automviles, embarcaciones, aeronaves y transporte\n seguros sobre prdidas monetarias y de responsabilidad civil\n',0,0),(747,'652','Reaseguros',3,'65.2 Reaseguros\n',0,0),(748,'6520','Reaseguros',4,'65.20 Reaseguros\nEsta clase comprende:\n- las actividades de asuncin de la totalidad o de una parte del riesgo asociado a las plizas de seguro vigentes\nsuscritas originalmente por otros aseguradores.\n',0,0),(749,'653','Fondos de pensiones',3,'65.3 Fondos de pensiones\n',0,0),(750,'6530','Fondos de pensiones',4,'65.30 Fondos de pensiones\nEsta clase comprende las personas jurdicas (es decir, fondos, planes o programas) constituidas para proveer\nprestaciones de renta de jubilacin en exclusiva a los empleados del promotor o miembros. Se incluyen aqu los\nplanes de pensiones con prestaciones definidas, as como los planes individuales en los que las prestaciones se\ndefinen simplemente mediante la contribucin de los miembros.\nEsta clase comprende:\n- los planes de prestaciones para empleados\n- los fondos y planes de pensiones\n- los planes de jubilacin\n',0,0),(751,'66','Actividades auxiliares a los servicios  financieros y a los seguros',2,'66 Actividades auxiliares a los servicios financieros y a los seguros\nEsta divisin comprende el suministro de servicios que forman parte de o estn ntimamente vinculados a los\nservicios financieros, sin que constituyan por s mismos un servicio financiero. El desglose fundamental de esta\ndivisin se realiza conforme al tipo de operacin financiera o provisin de fondos efectuada.\n',0,0),(752,'661','Actividades auxiliares a los servicios  financieros, excepto seguros y fondos de pensiones',3,NULL,0,0),(753,'6611','Administracin de mercados financieros',4,'66.11 Administracin de mercados financieros\nEsta clase comprende la administracin y la supervisin de mercados financieros por corporaciones independientes\nde las autoridades pblicas, como:\n- los mercados de contratos de productos bsicos\n- los mercados de contratos de futuros sobre mercancas\n- los mercados de valores\n- los mercados de acciones\n- los mercados de opciones sobre acciones o productos bsicos\n',0,0),(754,'6612','Actividades de intermediacin en operaciones con valores y otros activos',4,'66.12 Actividades de intermediacin en operaciones con valores y otros activos\nEsta clase comprende:\n- las operaciones en los mercados financieros por cuenta de terceros (por ejemplo, corredores de bolsa) y otras\nactividades afines\n- la corredura de bolsa\n- la intermediacin en operaciones con contratos de productos bsicos\n- las actividades de oficinas de cambio de moneda, etc.\n',0,0),(755,'6619','Otras actividades auxiliares a los servicios  financieros, excepto seguros y fondos de pensiones',4,'66.19 Otras actividades auxiliares a los servicios financieros, excepto seguros y fondos de pensiones\nEsta clase comprende las actividades auxiliares a los servicios financieros, no incluidas en otra parte:\n- las actividades de tramitacin y liquidacin de operaciones financieras, incluidas las operaciones de tarjetas de\ncrdito\n- los servicios de asesoramiento en materia de inversin\n- las actividades de asesores e intermediarios hipotecarios\nEsta clase comprende tambin:\n- los servicios de fideicomisarios, fiduciarios y de custodia prestados por cuenta de terceros\n',0,0),(756,'662','Actividades auxiliares a seguros y fondos de pensiones',3,'66.2 Actividades auxiliares a seguros y fondos de pensiones\nEste grupo comprende el ejercicio como agentes o como corredores en la venta de plizas de seguro y la prestacin\nde otros servicios relacionados con pensiones, seguros y prestaciones a empleados, como la tasacin de daos y la\nadministracin por terceros.\n',0,0),(757,'6621','Evaluacin de riesgos y daos',4,'66.21 Evaluacin de riesgos y daos\nEsta clase comprende la prestacin de servicios de administracin de seguros, como la tasacin y la liquidacin de\nsiniestros:\n- evaluacin de las solicitudes de indemnizacin por siniestro\n tasacin de daos\n valoracin de riesgos\n evaluacin de riesgos y daos\n tasacin de averas y prdidas\n- liquidacin de las solicitudes de indemnizacin por siniestro\n',0,0),(758,'6622','Actividades de agentes y corredores de seguros',4,'66.22 Actividades de agentes y corredores de seguros\nEsta clase comprende:\n- las actividades de agentes y corredores de seguros (intermediarios de seguros) en la venta, negociacin o\nintermediacin de plizas de seguro y de reaseguro.\n',0,0),(759,'6629','Otras actividades auxiliares a seguros y fondos de pensiones',4,'66.29 Otras actividades auxiliares a seguros y fondos de pensiones\nEsta clase comprende:\n- las actividades estrechamente relacionadas con seguros y fondos de pensiones (excepto las de intermediacin\nfinanciera, la tasacin de daos y las actividades de agentes y corredores de seguros):\n administracin del salvamento\n servicios actuariales\n',0,0),(760,'663','Actividades de gestin de fondos',3,'66.3 Actividades de gestin de fondos\n',0,0),(761,'6630','Actividades de gestin de fondos',4,'66.30 Actividades de gestin de fondos\nEsta clase comprende las actividades de gestin de cartera y de fondos realizadas por cuenta de terceros para\nindividuos, empresas y otros, como:\n- la gestin de fondos de inversin\n- la gestin de otras instituciones de inversin colectiva\n- la gestin de fondos de pensiones\n',0,0),(762,'L','Actividades inmobiliarias',1,NULL,0,0),(763,'68','Actividades inmobiliarias',2,'68 Actividades inmobiliarias\n',0,0),(764,'681','Compraventa de bienes inmobiliarios por cuenta propia',3,'68.1 Compraventa de bienes inmobiliarios por cuenta propia\n',0,0),(765,'6810','Compraventa de bienes inmobiliarios por cuenta propia',4,'68.10 Compraventa de bienes inmobiliarios por cuenta propia\nEsta clase comprende:\n- la compraventa de bienes inmobiliarios propios o arrendados:\n edificios de pisos y casas\n edificios no residenciales, incluidos salas de exposicin, almacenes y centros comerciales\n terrenos\nEsta clase comprende tambin:\n- la parcelacin de terrenos, sin mejora de los mismos\n',0,0),(766,'682','Alquiler de bienes inmobiliarios por cuenta propia',3,'68.2 Alquiler de bienes inmobiliarios por cuenta propia\n',0,0),(767,'6820','Alquiler de bienes inmobiliarios por cuenta propia',4,'68.20 Alquiler de bienes inmobiliarios por cuenta propia\nEsta clase comprende:\n- el alquiler y la gestin de bienes inmobiliarios propios o arrendados:\n edificios de pisos y casas\n edificios no destinados a vivienda, incluidos salas de exposicin y almacenes\n terrenos\n- la provisin de casas y apartamentos amueblados o sin amueblar, de uso ms permanente, normalmente por\nmeses o aos\nEsta clase comprende tambin:\n- el desarrollo de proyectos de construccin de edificios (promocin inmobiliaria) para explotacin propia\n- la explotacin de zonas residenciales para viviendas mviles\n',0,0),(768,'683','Actividades inmobiliarias por cuenta de terceros',3,'68.3 Actividades inmobiliarias por cuenta de terceros\n',0,0),(769,'6831','Agentes de la propiedad inmobiliaria',4,'68.31 Agentes de la propiedad inmobiliaria\nEsta clase comprende las actividades de los agentes de la propiedad inmobiliaria:\n- la intermediacin en la compra, la venta y el alquiler de bienes inmuebles por cuenta de terceros\n- las actividades de asesoramiento y los servicios de tasacin en relacin con la compra, la venta o el alquiler de\nbienes inmuebles, por cuenta de terceros\n- las actividades de agentes inmobiliarios neutrales que garantizan el cumplimiento de todas las condiciones de una\ntransaccin inmobiliaria\n',0,0),(770,'6832','Gestin y administracin de la propiedad inmobiliaria',4,'68.32 Gestin y administracin de la propiedad inmobiliaria\n',0,0),(771,'M','Actividades profesionales, cientficas y tcnicas',1,NULL,0,0),(772,'69','Actividades jurdicas y de contabilidad',2,'69 Actividades jurdicas y de contabilidad\nEsta divisin comprende la representacin jurdica de los intereses de una parte contra los de otra, sea o no ante\ntribunales u otros rganos judiciales, ejercida o supervisada por letrados pertenecientes al colegio de abogados,\ncomo la representacin y asistencia letrada ejercida en causas civiles, penales o en relacin con conflictos laborales.\nComprende tambin la preparacin de documentos jurdicos como estatutos sociales, escrituras de constitucin y\notros documentos similares relacionados con la constitucin de sociedades, patentes y derechos de autor,\npreparacin de escrituras, testamentos, fideicomisos, etc., as como otras actividades de fedatarios pblicos,\nnotarios de derecho civil, rbitros y mediadores.\nComprende tambin los servicios de contabilidad y tenedura de libros, como la auditora de documentos contables,\nla preparacin de balances y la tenedura de libros.\n',0,0),(773,'691','Actividades jurdicas',3,'69.1 Actividades jurdicas\n',0,0),(774,'6910','Actividades jurdicas',4,'69.10 Actividades jurdicas\nEsta clase comprende:\n- la representacin jurdica de los intereses de una parte contra los de otra, sea o no ante tribunales u otros rganos\njudiciales, ejercida o supervisada por letrados pertenecientes al colegio de abogados:\n el asesoramiento y la representacin en acciones civiles\n el asesoramiento y la representacin en acciones penales\n el asesoramiento y la representacin en relacin con conflictos laborales\n- el asesoramiento jurdico de carcter general y la preparacin de documentos jurdicos:\n estatutos sociales, escrituras de constitucin y otros documentos similares relacionados con la constitucin de\nsociedades\n patentes y derechos de autor\n preparacin de escrituras, testamentos, fideicomisos, etc.\n- otras actividades de fedatarios pblicos, notarios de derecho civil, rbitros y mediadores\n',0,0),(775,'692','Actividades de contabilidad, tenedura de libros, auditora y asesora fiscal',3,'69.2 Actividades de contabilidad, tenedura de libros, auditora y asesora fiscal\n',0,0),(776,'6920','Actividades de contabilidad, tenedura de libros, auditora y asesora fiscal',4,'69.20 Actividades de contabilidad, tenedura de libros, auditora y asesora fiscal\nEsta clase comprende:\n- el registro contable de las transacciones comerciales de empresas u otras entidades\n- la preparacin o auditora de cuentas financieras\n- la inspeccin de cuentas financieras y la certificacin de su exactitud\n- la preparacin de declaraciones del impuesto sobre la renta de las personas fsicas y del impuesto sobre\nsociedades\n- las actividades de asesoramiento y representacin ejercidas ante la administracin tributaria en nombre de sus\nclientes\n',0,0),(777,'70','Actividades de las sedes centrales; actividades de consultora de gestin empresarial',2,'70 Actividades de las sedes centrales; actividades de consultora de gestin empresarial\nEsta divisin comprende los servicios de asesoramiento y asistencia prestados a empresas y otras organizaciones\nen materia de administracin, como la planificacin estratgica u organizativa; la planificacin financiera y\npresupuestaria; los objetivos y polticas de marketing; las polticas, prcticas y planificacin de recursos humanos;\nlos planes de produccin y la planificacin de control. Comprende tambin la supervisin y gestin de otras unidades\nde la misma compaa o empresa, es decir, las actividades de las oficinas centrales.\n',0,0),(778,'701','Actividades de las sedes centrales',3,'70.1 Actividades de las sedes centrales\n',0,0),(779,'7010','Actividades de las sedes centrales',4,'70.10 Actividades de las sedes centrales\nEsta clase comprende la supervisin y gestin de otras unidades de la compaa o empresa, asumiendo la\nplanificacin estratgica y organizativa y la funcin de toma de decisiones de la compaa o empresa, ejerciendo el\ncontrol operativo y gestionando las operaciones diarias de sus unidades relacionadas.\nEsta clase comprende las actividades de:\n- las sedes centrales\n- las oficinas administrativas centralizadas\n- las oficinas corporativas\n- las sedes zonales y regionales\n- las oficinas subsidiarias de gestin\n',0,0),(780,'702','Actividades de consultora de gestin empresarial',3,'70.2 Actividades de consultora de gestin empresarial\n',0,0),(781,'7021','Relaciones pblicas y comunicacin',4,'70.21 Relaciones pblicas y comunicacin\nEsta clase comprende los servicios de asesoramiento, orientacin y asistencia, incluidas las actividades de los\ngrupos de presin (lobbies), prestados a las empresas y otras organizaciones en materia de relaciones pblicas y\ncomunicacin.\n',0,0),(782,'7022','Otras actividades de consultora de gestin empresarial',4,'70.22 Otras actividades de consultora de gestin empresarial\nEsta clase comprende los servicios de asesoramiento, orientacin y asistencia prestados a las empresas y otras\norganizaciones en materia de administracin, como la planificacin organizativa y estratgica de la empresa,\nreingeniera de procesos empresariales, gestin de cambios en la empresa, reduccin de costes y otras cuestiones\nfinancieras; los objetivos y polticas de marketing; las polticas, las prcticas y la planificacin de recursos humanos;\nlas estrategias de indemnizacin y jubilacin; los planes de produccin y la planificacin de control.\nEsta prestacin de servicios empresariales puede comprender el asesoramiento, orientacin y asistencia prestados\na las empresas y los organismos pblicos en relacin con:\n- el diseo de sistemas de contabilidad, de programas de contabilidad de los costes y de procedimientos de control\npresupuestario\n- el asesoramiento y ayuda a las empresas y organismos pblicos para la planificacin, la organizacin, la eficacia y\nel control, la informtica de gestin, etc.\n',0,0),(783,'71','Servicios tcnicos de arquitectura e ingeniera; ensayos y anlisis tcnicos',2,'71 Servicios tcnicos de arquitectura e ingeniera; ensayos y anlisis tcnicos\nEsta divisin comprende la prestacin de servicios de arquitectura, ingeniera, delineacin, inspeccin de edificios,\ntopografa y cartografa. Comprende tambin los servicios que realizan ensayos fsicos, qumicos y otros ensayos\nanalticos.\n',0,0),(784,'711','Servicios tcnicos de arquitectura e ingeniera y otras actividades relacionadas con el asesoramiento tcnico',3,'71.1 Servicios tcnicos de arquitectura e ingeniera y otras actividades relacionadas con el\nasesoramiento tcnico\nEsta divisin comprende la prestacin de servicios de arquitectura, ingeniera, delineacin, inspeccin de edificios,\ntopografa y cartografa.\n',0,0),(785,'7111','Servicios tcnicos de arquitectura',4,'71.11 Servicios tcnicos de arquitectura\nEsta clase comprende:\n- los servicios de asesoramiento de arquitectura:\n la proyeccin de edificios y la delineacin\n la ordenacin urbana y la planificacin paisajstica\n',0,0),(786,'7112','Servicios tcnicos de ingeniera y otras actividades relacionadas con el asesoramiento tcnico',4,'71.12 Servicios tcnicos de ingeniera y otras actividades relacionadas con el asesoramiento tcnico\nEsta clase comprende:\n- las actividades de diseo (es decir, la aplicacin de las leyes fsicas y los principios de la ingeniera al diseo de\nmquinas, materiales, instrumentos, estructuras, procesos y sistemas) y asesoramiento de ingeniera para:\n maquinaria, procesos industriales y plantas industriales\n proyectos que requieren ingeniera civil, hidrulica o de trfico\n proyectos de gestin de aguas\n elaboracin y realizacin de proyectos relativos a ingeniera elctrica y electrnica, de minas, qumica, mecnica,\nindustrial, de sistemas y de seguridad\n- elaboracin de proyectos que requieran ingeniera de acondicionamiento de aire, refrigeracin, saneamiento,\ncontrol de la contaminacin, ingeniera acstica, etc.\n- los estudios geofsicos, geolgicos o ssmicos\n- la realizacin de estudios geodsicos:\n las actividades de topografa\n la realizacin de estudios hidrolgicos\n la realizacin de estudios sobre el subsuelo\n las actividades de informacin cartogrfica y espacial\n',0,0),(787,'712','Ensayos y anlisis tcnicos',3,'71.2 Ensayos y anlisis tcnicos\n',0,0),(788,'7120','Ensayos y anlisis tcnicos',4,'71.20 Ensayos y anlisis tcnicos\nEsta clase comprende la realizacin de ensayos fsicos, qumicos y otros ensayos analticos de todo tipo de\nmateriales y productos, como:\n las pruebas acsticas y de vibracin\n las pruebas de composicin y pureza de los minerales, etc.\n la realizacin de ensayos en el mbito de la higiene alimentaria, incluidos los ensayos veterinarios y el control\nrelacionado con la produccin alimentaria\n las pruebas relativas a las caractersticas fsicas y propiedades de los materiales, como la resistencia, el grosor,\ndurabilidad, radiactividad, etc.\n las pruebas de cualificacin y fiabilidad\n las pruebas de rendimiento de maquinaria completa: motores, automviles, equipos electrnicos, etc.\n pruebas radiogrficas de soldaduras y piezas de unin\n anlisis de fallos\n pruebas y medicin de los indicadores medioambientales: contaminacin del aire y del agua, etc.\n- la certificacin de productos, incluidos bienes de consumo, vehculos motorizados, aeronaves, contenedores\npresurizados, plantas nucleares, etc.\n- la inspeccin tcnica de vehculos\n- las pruebas con modelos a escala o simuladores (p. ej., aeronaves, embarcaciones, presas, etc.)\n- explotacin de laboratorios policiales\n',0,0),(789,'72','Investigacin y desarrollo',2,'72 Investigacin y desarrollo\nEsta divisin comprende tres tipos de actividades relativas a la investigacin y el desarrollo: 1) la investigacin\nbsica: trabajo experimental o terico emprendido con el fin primordial de adquirir nuevos conocimientos sobre las\ncausas profundas de fenmenos y hechos observables, sin pretender una aplicacin o utilizacin determinada, 2) la\ninvestigacin aplicada: investigacin original emprendida con objeto de adquirir nuevos conocimientos y encaminada\nfundamentalmente hacia una finalidad u objetivo prctico especfico, y 3) el desarrollo experimental: trabajo\nsistemtico basado en conocimientos previos obtenidos por investigacin o por experiencia prctica, encaminado a\nla produccin de nuevos materiales, productos o aparatos, a la implantacin de nuevos procesos, sistemas y\nservicios y a la mejora sustancial de lo que ya se produce o est utilizndose.\nLas actividades de investigacin y desarrollo experimental de este apartado se subdividen en dos categoras:\nciencias naturales y tcnicas; ciencias sociales y humanidades.\nEsta divisin no comprende:\n- los estudios de mercado (vase 73.20)\n',0,0),(790,'721','Investigacin y desarrollo experimental en ciencias naturales y tcnicas',3,'72.1 Investigacin y desarrollo experimental en ciencias naturales y tcnicas\nEste grupo comprende la investigacin bsica, la investigacin aplicada y el desarrollo experimental en ciencias\nnaturales y tcnicas.\n',0,0),(791,'7211','Investigacin y desarrollo experimental en biotecnologa',4,'72.11 Investigacin y desarrollo experimental en biotecnologa\nEsta clase comprende la investigacin y el desarrollo experimental en biotecnologa:\n-ADN/ARN: genmica, farmacogenmica, sondas gnicas, ingeniera gentica, secuenciacin, sntesis y\namplificacin de ADN y ARN, patrones de expresin gnica y el uso de tecnologa antisense.\n-protenas y otras molculas: secuenciacin, sntesis e ingeniera de protenas y pptidos (que incluye hormonas de\ngran tamao molecular), mejora de mtodos de liberacin de drogas de gran tamao, protemica, aislamiento y\npurificacin de protenas, sealizacin e identificacin de receptores celulares.\n-cultivos e ingeniera celulares y de tejidos: cultivos celulares y de tejidos, ingeniera tisular (que incluye implantes de\ntejido e ingeniera biomdica), fusin celular, vacunas/ estimulantes del sistema inmune, manipulacin embrionaria.\n-tcnicas de procesos biotecnolgicos: fermentacin mediante el uso de biorreactores, procesado biolgico,\nbiodecantacin, biopulping, bioblanqueo, biodesulfurizacin, biorremediacin, biofiltracin y fitorremediacin\n-vectores gnicos y de ARN: terapia gnica y vectores virales.\n-bioinformtica: construccin de bases de datos genmicas, secuencias de protenas, modelizacin de procesos\nbiolgicos complejos que incluyen biologa de sistemas.\n-nanobiotecnologia: aplicacin de tcnicas y procesos de nano/microfabricacin para la construccin de aparatos\npara el estudio de biosistemas y aplicaciones en liberacin de drogas, diagnsticos etc\n',0,0),(792,'7219','Otra investigacin y desarrollo experimental en ciencias naturales y tcnicas',4,'72.19 Otra investigacin y desarrollo experimental en ciencias naturales y tcnicas\nEsta clase comprende:\n- investigacin y desarrollo experimental en ciencias naturales y tcnicas distintos de la investigacin y el desarrollo\nexperimental en biotecnologa:\n investigacin y desarrollo en ciencias naturales\n investigacin y desarrollo en ingeniera y tecnologa\n investigacin y desarrollo en ciencias mdicas\n investigacin y desarrollo en ciencias agrcolas\n Investigacin y desarrollo interdisciplinares, predominantemente en ciencias naturales y tcnicas\n',0,0),(793,'722','Investigacin y desarrollo experimental en ciencias sociales y humanidades',3,'72.2 Investigacin y desarrollo experimental en ciencias sociales y humanidades\n',0,0),(794,'7220','Investigacin y desarrollo experimental en ciencias sociales y humanidades',4,'72.20 Investigacin y desarrollo experimental en ciencias sociales y humanidades\nEsta clase comprende:\n- la investigacin y el desarrollo en ciencias sociales\n- la investigacin y el desarrollo en humanidades\n- la investigacin y el desarrollo interdisciplinares, predominantemente en ciencias naturales y humanidades\n',0,0),(795,'73','Publicidad y estudios de mercado',2,'73 Publicidad y estudios de mercado\nEsta divisin comprende la creacin de campaas publicitarias y la colocacin de los anuncios en revistas,\nperidicos, radio, televisin y otros medios, as como el diseo de estructuras y lugares de exposicin publicitaria.\n',0,0),(796,'731','Publicidad',3,'73.1 Publicidad\n',0,0),(797,'7311','Agencias de publicidad',4,'73.11 Agencias de publicidad\nEsta clase comprende la prestacin de toda una serie de servicios de publicidad (es decir, con recursos propios o\nmediante subcontratacin), incluidos el asesoramiento, los servicios de creativos, la produccin y compra de material\npublicitario. Comprende:\n- la creacin y realizacin de campaas publicitarias:\n creacin y colocacin de publicidad en peridicos, revistas, radio, televisin, Internet y otros medios de\ncomunicacin.\n la creacin y colocacin de publicidad exterior en carteles, vallas publicitaria y tablones de anuncios, la decoracin\nde escaparates, el diseo de salas de muestras, la colocacin de anuncios en automviles y autobuses, etc.\n la publicidad area\n la distribucin o entrega de material publicitario o de muestras\n la creacin de stands y otras estructuras y lugares de exposicin\n- la realizacin de campaas de marketing y otros servicios publicitarios destinados a atraer y conservar clientes\n la promocin de productos\n el marketing en el punto de venta\n la publicidad por correspondencia directa\n el asesoramiento en marketing\n',0,0),(798,'7312','Servicios de representacin de medios de comunicacin',4,'73.12 Servicios de representacin de medios de comunicacin\nEsta clase comprende:\n- la representacin de los medios de comunicacin: la venta o reventa de tiempo y espacio publicitarios en los\nmedios de comunicacin que lo soliciten\n',0,0),(799,'732','Estudios de mercado y realizacin de encuestas de opinin pblica',3,'73.2 Estudio de mercado y realizacin de encuestas de opinin pblica\n',0,0),(800,'7320','Estudios de mercado y realizacin de encuestas de opinin pblica',4,'73.20 Estudio de mercado y realizacin de encuestas de opinin pblica\nEsta clase comprende:\n- los estudios sobre las posibilidades de comercializacin, la notoriedad, la aceptacin y el grado de difusin de los\nproductos y servicios, y sobre los hbitos de compra de los consumidores, con objeto de promover las ventas y\ndesarrollar nuevos productos y servicios, incluidos los anlisis estadsticos de los resultados\n- las encuestas de opinin pblica sobre cuestiones polticas, econmicas y sociales, as como sus anlisis\nestadsticos\n',0,0),(801,'74','Otras actividades profesionales, cientficas y tcnicas',2,'74 Otras actividades profesionales, cientficas y tcnicas\nEsta divisin comprende la prestacin de servicios profesionales cientficos y tcnicos (excepto las actividades\njurdicas y contables; las relacionadas con la arquitectura y la ingeniera; los ensayos y anlisis tcnicos; las\nrelacionadas con el asesoramiento sobre direccin y gestin empresarial; las dedicadas a la investigacin y el\ndesarrollo, y las publicitarias).\n',0,0),(802,'741','Actividades de diseo especializado',3,'74.1 Actividades de diseo especializado\n',0,0),(803,'7410','Actividades de diseo especializado',4,'74.10 Actividades de diseo especializado\nEsta clase comprende:\n- el diseo de moda textil, de prendas de vestir, calzado, joyas, mobiliario y otros artculos de decoracin interior, as\ncomo otros objetos de moda, bienes personales o para el hogar\n- el diseo industrial, es decir, la creacin y el desarrollo de diseos y especificaciones que optimizan el uso, el valor\ny la apariencia de los productos, incluyendo las decisiones sobre materiales, mecanismos, formas, colores y\nacabado de las superficies del producto, teniendo en cuenta las caractersticas y necesidades de los clientes, la\nseguridad, la demanda del mercado y la distribucin, el uso y el mantenimiento\n- el diseo grfico\n- la decoracin de interiores\n',0,0),(804,'742','Actividades de fotografa',3,'74.2 Actividades de fotografa\n',0,0),(805,'7420','Actividades de fotografa',4,'74.20 Actividades de fotografa\nEsta clase comprende:\n- la produccin de fotografas comerciales y profesionales:\n la realizacin de fotografas para pasaportes, colegios, bodas, etc.\n la fotografa para anuncios, editoriales, actividades relacionadas con la moda y para anuncios inmobiliarios o\ntursticos\n la fotografa area\n la grabacin en vdeo de acontecimientos como bodas, reuniones, etc.\n- el revelado de pelculas:\n el positivado, la impresin y la ampliacin de negativos de los clientes y de pelculas cinematogrficas\n los laboratorios de positivado e impresin fotogrfica\n las tiendas de revelado en una hora (que no pertenecen a establecimientos de cmaras fotogrficas)\n el montaje de diapositivas\n la copia y la restauracin o retoque de fotografas\n- las actividades de los reporteros grficos\nEsta clase comprende tambin:\n- la microfilmacin de documentos\n',0,0),(806,'743','Actividades de traduccin e interpretacin',3,'74.3 Actividades de traduccin e interpretacin\n',0,0),(807,'7430','Actividades de traduccin e interpretacin',4,'74.30 Actividades de traduccin e interpretacin\n',0,0),(808,'749','Otras actividades profesionales, cientficas y tcnicas n.c.o.p.',3,'74.9 Otras actividades profesionales, cientficas y tcnicas n.c.o.p.\n',0,0),(809,'7490','Otras actividades profesionales, cientficas y tcnicas n.c.o.p.',4,'74.90 Otras actividades profesionales, cientficas y tcnicas n.c.o.p.\nEsta clase comprende una gran variedad de actividades de servicios prestados por lo general a clientes comerciales.\nComprende las actividades para las que se exigen unos niveles ms elevados de competencias profesionales,\ncientficas y tcnicas, pero no comprende funciones comerciales corrientes y rutinarias que suelen ser de corta\nduracin.\nEsta clase comprende:\n- las actividades de los intermediarios comerciales, como la preparacin de operaciones mercantiles de compra y\nventa de pequeas y medianas empresas, incluida la prestacin de servicios profesionales y excluidas las\nactividades de intermediacin inmobiliaria\n- las actividades de los intermediarios de patentes (preparacin de la compra y venta de patentes)\n- las actividades de tasacin distintas de la tasacin de inmuebles y de la relacionada con los seguros (de\nantigedades, joyas, etc.)\n- la auditora de facturas y la informacin de tarifas de transporte de mercancas\n- las actividades de previsin meteorolgica\n- el asesoramiento sobre seguridad\n- el asesoramiento sobre agronoma\n- el asesoramiento sobre medio ambiente\n- otro asesoramiento tcnico\n- el asesoramiento distinto del relacionado con la arquitectura, la ingeniera y la administracin de empresas\n- las actividades de certificacin de obras\nEsta clase comprende tambin:\n- los servicios realizados por agentes en nombre de particulares encaminados a obtener contratos para actuar en\npelculas cinematogrficas, obras teatrales y otros espectculos culturales o deportivos, as como a ofrecer a\neditores, productores, etc., libros, guiones, obras de arte, fotografas, etc.\n',0,0),(810,'75','Actividades veterinarias',2,'75 Actividades veterinarias\nEsta divisin comprende la realizacin de actividades de control y cuidados mdicos dispensados a animales de\ncompaa o de granja. Estas actividades las realizan veterinarios titulados en clnicas veterinarias, as como en\nvisitas a establecimientos agropecuarios, perreras o a domicilio, en consultas y salas de operaciones o en otros\nlugares. Comprende tambin los servicios de ambulancia para animales.\n',0,0),(811,'750','Actividades veterinarias',3,'75.0 Actividades veterinarias\n',0,0),(812,'7500','Actividades veterinarias',4,'75.00 Actividades veterinarias\nEsta clase comprende:\n- las actividades de control y cuidados mdicos dispensados a animales de granja\n- las actividades de control y cuidados mdicos dispensados a animales de compaa\nEstas actividades las realizan veterinarios titulados en clnicas veterinarias, as como en visitas a establecimientos\nagropecuarios, perreras o a domicilio, en consultas y salas de operaciones o en otros lugares.\nEsta clase comprende tambin:\n- las actividades de los auxiliares de veterinaria u otro personal de apoyo en veterinaria\n- las actividades clnico-patolgicas y otras actividades diagnsticas relacionadas con los animales\n- los servicios de ambulancia para animales\n',0,0),(813,'N','Actividades administrativas y servicios auxiliares',1,NULL,0,0),(814,'77','Actividades de alquiler',2,'77 Actividades de alquiler\nEsta divisin comprende el alquiler y arrendamiento de bienes tangibles e intangibles no financieros, incluida una\namplia variedad de bienes tangibles como los automviles, los ordenadores, los bienes de consumo y los equipos y\nmaquinaria industrial, realizado con los clientes a cambio de un pago peridico en concepto de alquiler o\narrendamiento. Se subdivide en: (1) el alquiler de vehculos de motor, (2) el alquiler de equipos deportivos y\nrecreativos, y equipos personales y domsticos, (3) el arrendamiento de otros equipos y mquinas similares que\nsuelen utilizarse para las operaciones empresariales, incluidos otros equipos para transporte y (4) el arrendamiento\nde la propiedad intelectual y productos similares.\nEn esta divisin se incluye slo la prestacin de arrendamientos operativos.\nEsta divisin no comprende:\n- el arrendamiento financiero (vase 64.91)\n- el alquiler de propiedades inmobiliarias (vase la seccin L)\n- el alquiler de equipos con operario (vanse las clases correspondientes a las actividades realizadas con el equipo\nen cuestin, por ejemplo, construccin (seccin F), transporte (seccin H).\n',0,0),(815,'771','Alquiler de vehculos de motor',3,'77.1 Alquiler de vehculos de motor\n',0,0),(816,'7711','Alquiler de automviles y vehculos de motor ligeros',4,'77.11 Alquiler de automviles y vehculos de motor ligeros\nEsta clase comprende:\n- el alquiler de los siguientes tipos de vehculos:\n automviles y otros vehculos de motor ligeros sin conductor (de menos de 3,5 toneladas)\n',0,0),(817,'7712','Alquiler de camiones',4,'77.12 Alquiler de camiones\nEsta clase comprende:\n- el alquiler de los siguientes tipos de vehculos:\n camiones, camionetas y vehculos de motor pesados (de ms de 3,5 toneladas)\n vehculos recreativos\n',0,0),(818,'772','Alquiler de efectos perasonales y artculos de uso domstico',3,'77.2 Alquiler de efectos personales y artculos de uso domstico\nEste grupo comprende el alquiler de artculos de uso personal y domstico, as como el alquiler de equipos\ndeportivos y recreativos, y de cintas de vdeo. Las actividades