prende:\n- el alquiler de maquinaria y equipo para construccin e ingeniera civil sin operarios:\n camiones gra\n andamios y plataformas de trabajo sin su montaje y desmontaje\n',0,0),(825,'7733','Alquiler de maquinaria y equipo de oficina, incluidos ordenadores',4,'77.33 Alquiler de maquinaria y equipo de oficina, incluidos ordenadores\nEsta clase comprende:\n- el alquiler de mquinas y equipos para oficina, sin operario:\n ordenadores y perifricos\n fotocopiadoras, mquinas de escribir y de tratamiento de textos\n mquinas y equipos de contabilidad cajas registradoras, calculadoras electrnicas, etc.\n mobiliario de oficina\n',0,0),(826,'7734','Alquiler de medios de navegacin',4,'77.34 Alquiler de medios de navegacin\nEsta clase comprende:\n- el alquiler de medios de navegacin sin tripulacin:\n barcos y buques comerciales\n',0,0),(827,'7735','Alquiler de medios de transporte areo',4,'77.35 Alquiler de medios de transporte areo\nEsta clase comprende:\n- el alquiler de medios de transporte areo sin tripulacin:\n aeronaves\n globos aerostticos\n',0,0),(828,'7739','Alquiler de otra maquinaria, equipos y bienes tangibles n.c.o.p.',4,'77.39 Alquiler de otra maquinaria, equipos y bienes tangibles n.c.o.p.\nEsta clase comprende:\n- el alquiler, sin operarios, de otros tipos de maquinaria y equipos utilizados por lo general como bienes de capital por\nla industria:\n motores y turbinas\n mquinas herramienta\n equipos de extraccin minera y petrolfera\n equipos de radio, televisin y comunicacin\n equipos profesionales de produccin cinematogrfica\n equipos de medicin y control\n otra maquinaria de uso cientfico, comercial o industrial\n- el alquiler de equipos de transporte terrestre (excepto vehculos de motor) sin conductor:\n motocicletas, caravanas remolcables y autocaravanas, etc.\n vehculos ferroviarios\nEsta clase comprende tambin:\n- el alquiler de construcciones mviles temporales para alojamiento u oficinas\n- el alquiler de animales (por ejemplo, rebaos, caballos de carreras)\n- el alquiler de contenedores\n- el alquiler de palets\n',0,0),(829,'774','Arrendamiento de la propiedad intelectual y productos similares, excepto trabajos protegidos por los derechos de autor',3,'77.4 Arrendamiento de la propiedad intelectual y productos similares, excepto trabajos protegidos por\nlos derechos de autor\n',0,0),(830,'7740','Arrendamiento de la propiedad intelectual y productos similares, excepto trabajos protegidos por los derechos de autor',4,'77.40 Arrendamiento de la propiedad intelectual y productos similares, excepto trabajos protegidos por\nlos derechos de autor\nEsta clase comprende las actividades destinadas a permitir a terceros usar la propiedad intelectual y otros productos\nsimilares por los que se paga un canon o una cuota de licencia al propietario del producto (es decir, al titular del\nactivo). El arrendamiento de estos productos puede adoptar diversas formas, como el permiso de reproduccin, el\nuso en procesos o productos posteriores, la explotacin de una empresa en rgimen de franquicia, etc. Los\npropietarios pueden o no haber creado tales productos.\nEsta clase comprende:\n- el arrendamiento de la propiedad intelectual (excepto las obras sujetas a derechos de autor, como los libros o los\nprogramas informticos)\n- la recepcin de cnones o cuotas de licencia por la utilizacin de:\n entidades patentadas\n marcas comerciales o marcas de servicio\n nombres de marca\n prospeccin y evaluacin mineral\n acuerdos de franquicia\n',0,0),(831,'78','Actividades relacionadas con el empleo',2,'78 Actividades relacionadas con el empleo\nEsta divisin comprende los servicios dedicados a informar sobre las ofertas de empleo disponibles y a seleccionar o\ncolocar a los candidatos a un empleo siempre que stos no sean empleados de las agencias de colocacin, y a\ndotar de trabajadores a las empresas de los clientes por un periodo de tiempo limitado para completar su plantilla,\nas como las actividades de provisin de otros recursos humanos.\nEsta divisin comprende:\n- las actividades de bsqueda y colocacin de ejecutivos\n- las actividades de las agencias de casting teatral\nEsta divisin no comprende:\n- las actividades de los agentes de artistas individuales (vase 74.90)\n',0,0),(832,'781','Actividades de las agencias de colocacin',3,'78.1 Actividades de las agencias de colocacin\n',0,0),(833,'7810','Actividades de las agencias de colocacin',4,'78.10 Actividades de las agencias de colocacin\nEsta clase comprende los servicios de informacin sobre ofertas de empleo disponibles y la seleccin o colocacin\nde los candidatos a un empleo, siempre que stos no sean empleados de las agencias de colocacin\nEsta clase comprende:\n- las actividades de bsqueda, seleccin y colocacin de personal, incluida la colocacin o bsqueda de ejecutivos\n- las actividades de las agencias y oficinas de casting de actores, como las agencias de casting teatral\n- las actividades de las agencias de colocacin a travs de Internet\n',0,0),(834,'782','Actividades de las empresas de trabajo temporal',3,'78.2 Actividades de las empresas de trabajo temporal\n',0,0),(835,'7820','Actividades de las empresas de trabajo temporal',4,'78.20 Actividades de las empresas de trabajo temporal\nEsta clase comprende las actividades de dotacin de trabajadores a las empresas de los clientes por periodos de\ntiempo limitados para sustituir temporalmente o complementar su plantilla, siempre que no sean empleados de la\nempresa de trabajo temporal. Ahora bien, las unidades clasificadas en este apartado no se encargan de la\nsupervisin de sus empleados en los centros de trabajo de los clientes.\n',0,0),(836,'783','Otra provisin de recursos humanos',3,'78.3 Otra provisin de recursos humanos\n',0,0),(837,'7830','Otra provisin de recursos humanos',4,'78.30 Otra provisin de recursos humanos\nEsta clase comprende las actividades de provisin de recursos humanos para las empresas de los clientes. Las\nunidades clasificadas aqu representan al empleador ante los empleados en cuestiones relativas a nminas,\nimpuestos y otros asuntos fiscales y de recursos humanos, aunque no son responsables ni de dirigir ni de supervisar\na los empleados.\nLa provisin de recursos humanos suele hacerse a largo plazo o de manera permanente, y las unidades clasificadas\naqu llevan a cabo una amplia variedad de tareas de gestin de personal y recursos humanos asociadas a esta\nprovisin.\n',0,0),(838,'79','Actividades de agencias de viajes, operadores tursticos, servicios de reservas y actividades relacionadas con los mismos',2,'79. 90 Otros servicios de reservas y actividades relacionadas con los mismos\nEsta clase comprende:\n- otros servicios de reservas relacionados con los viajes:\n reservas para transportes, hoteles, restaurantes, alquiler de vehculos, espectculos y eventos deportivos, etc.\n- los servicios de intercambio de multipropiedad\n- las actividades de venta de entradas para teatros, eventos deportivos y otros espectculos y entretenimientos\n- los servicios de asistencia a los turistas:\n la provisin de informacin sobre viajes a los turistas\n las actividades de los guas tursticos\n- las actividades de promocin turstica\n',0,0),(839,'791','Actividades de agencias de viajes y operadores tursticos',3,'79.1 Actividades de agencias de viajes y operadores tursticos\nEste grupo comprende las actividades de las agencias cuya dedicacin principal es vender servicios de viajes,\nrecorridos tursticos, transporte y alojamiento al pblico en general y a clientes comerciales, as como la actividad de\nplanificacin y organizacin de recorridos tursticos cuya venta se realiza a travs de agencias de viaje o\ndirectamente de los agentes, como los operadores tursticos.\n',0,0),(840,'7911','Actividades de las agencias de viajes',4,'79.11 Actividades de las agencias de viajes\nEsta clase comprende:\n- las actividades de las agencias cuya dedicacin principal es vender servicios de viajes, recorridos tursticos,\ntransporte y alojamiento, al por mayor o al por menor, al pblico en general y a clientes comerciales.\n',0,0),(841,'7912','Actividades de los operadores tursticos',4,'79.12 Actividades de los operadores tursticos\nEsta clase comprende:\n- la planificacin y organizacin de recorridos tursticos cuya venta se realiza a travs de agencias de viaje o\ndirectamente de los operadores tursticos. Los recorridos pueden incluir la totalidad o parte de lo siguiente:\n- transporte\n- alojamiento\n- comidas\n- visitas a museos, lugares histricos o centros culturales, espectculos teatrales, musicales o deportivos.\n',0,0),(842,'799','Otros servicios de reservas y actividades relacionadas con los mismos',3,'79.9 Otros servicios de reservas y actividades relacionadas con los mismos\n',0,0),(843,'7990','Otros servicios de reservas y actividades relacionadas con los mismos',4,NULL,0,0),(844,'80','Actividades de seguridad e investigacin',2,'80 Actividades de seguridad e investigacin\nEsta divisin comprende servicios relacionados con la seguridad, como: los servicios de vigilancia y de detectives;\nlos servicios de proteccin y patrullaje; la recogida y entrega de dinero, recibos u otros artculos valiosos con\npersonal y equipos para proteger esas propiedades mientras estn en trnsito; la explotacin de sistemas\nelectrnicos de alarma de seguridad, como las alarmas contra robos o incendios, en los que la actividad se centra en\nla vigilancia a distancia de estos sistemas, aunque es frecuente que incluyan tambin servicios de venta, instalacin\ny reparacin. Si estos ltimos componentes se suministran por separado, quedan excluidos de esta divisin y se\nclasifican en las de comercio al por menor, construccin, etc.\n',0,0),(845,'801','Actividades de seguridad privada',3,'80.1 Actividades de seguridad privada\n',0,0),(846,'8010','Actividades de seguridad privada',4,'80.10 Actividades de seguridad privada\nEsta clase comprende la prestacin de uno o ms de los siguientes servicios: servicios de vigilancia y patrullaje, la\nrecogida y entrega de dinero, recibos u otros artculos valiosos con personal y equipos para proteger esas\npropiedades mientras estn en trnsito.\nEsta clase comprende:\n- servicios de vehculos blindados\n- servicios de guardaespaldas\n- servicios de polgrafos\n- servicios de identificacin de huellas dactilares\n- servicios de guardas jurados\n',0,0),(847,'802','Servicios de sistemas de seguridad',3,'80.2 Servicios de sistemas de seguridad\n',0,0),(848,'8020','Servicios de sistemas de seguridad',4,'80.20 Servicios de sistemas de seguridad\nEsta clase comprende:\n- la vigilancia a distancia o no de sistemas electrnicos de seguridad, como alarmas contra robos o incendios,\nincluida su instalacin y su mantenimiento\n- la instalacin, la reparacin, la reconstruccin y el ajuste mecnico o electrnico de dispositivos de cierre, cajas\nfuertes y cmaras acorazadas en relacin con una posterior vigilancia, a distancia o no.\nLas unidades que llevan a cabo estas actividades pueden dedicarse tambin a la venta de estos sistemas de\nseguridad, dispositivos de cierre mecnicos o electrnicos, cajas fuertes y cmaras acorazadas.\n',0,0),(849,'803','Actividades de investigacin',3,'80.3 Actividades de investigacin\n',0,0),(850,'8030','Actividades de investigacin',4,'80.30 Actividades de investigacin\nEsta clase comprende:\n- los servicios de detectives y vigilancia\n-  las actividades de todos los investigadores privados, sea cual sea el tipo de cliente o el propsito de la\ninvestigacin.\n',0,0),(851,'81','Servicios a edificios y actividades de jardinera',2,'81 Servicios a edificios y actividades de jardinera\nEsta divisin comprende la prestacin de una serie de servicios generales de apoyo, tales como la prestacin de una\ncombinacin de servicios de apoyo en las instalaciones del cliente, las actividades de limpieza exterior e interior de\nedificios de todo tipo; la limpieza de maquinaria industrial; la limpieza de trenes, autobuses, aviones, etc.; la limpieza\ninterior de camiones y buques cisterna; los servicios de desinfeccin, desratizacin y desinsectacin de edificios,\nbarcos, trenes, etc.; el lavado de botellas; el barrido y la retirada de hielo y nieve de las calles; la prestacin de\nservicios de jardinera y la prestacin de estos servicios junto con el diseo de la planificacin paisajstica y/o la\nconstruccin (es decir, la instalacin) de pasarelas, muros de contencin, plataformas, vallas, estanques y\nestructuras similares.\n',0,0),(852,'811','Servicios integrales a edificios e instalaciones',3,'81.1 Servicios integrales a edificios e instalaciones\n',0,0),(853,'8110','Servicios integrales a edificios e instalaciones',4,'81.10 Servicios integrales a edificios e instalaciones\nEsta clase comprende la provisin de una serie de servicios de apoyo en las instalaciones del cliente. Estos servicios\nincluyen la limpieza general de interiores, el mantenimiento, la eliminacin de la basura, la proteccin y la seguridad,\nel despacho del correo, los servicios de recepcin, lavandera, y los servicios de apoyo para el funcionamiento de los\nedificios. Estas actividades son llevadas a cabo por personal que no participa ni es responsable de las actividades\nempresariales del cliente.\n',0,0),(854,'812','Actividades de limpieza',3,'81.2 Actividades de limpieza\nEste grupo comprende las actividades de limpieza general de interiores de todo tipo de edificios; la limpieza exterior\nde edificios; las actividades de limpieza especializada de edificios u otros tipos de limpieza especializada; la limpieza\nde maquinaria industrial; la limpieza interior de camiones y buques cisterna; la desinfeccin, desratizacin y\ndesinsectacin de edificios y maquinaria industrial; el lavado de botellas; el barrido y la retirada de hielo y nieve de\nlas calles.\nEste grupo no comprende:\n- el control de plagas agropecuarias (vase 01.61)\n- la limpieza al vapor, con chorro de arena o similares del exterior de los edificios (vase 43.99)\n- el lavado de alfombras y tapices con espuma y la limpieza de cortinas (vase 96.01)\n- la limpieza de los edificios despus de su construccin (vase 43.39)\n',0,0),(855,'8121','Limpieza general de edificios',4,'81.21 Limpieza general de edificios\nEsta clase comprende:\n- las actividades de limpieza general (no especializada) de todo tipo de edificios, como:\n? oficinas\n? casas y apartamentos\n? fbricas\n? comercios\n? edificios oficiales\n- las actividades de limpieza general (no especializada) de otros establecimientos empresariales y profesionales, as\ncomo de bloques residenciales.\nEstas actividades se refieren sobre todo a la limpieza de interiores, aunque pueden incluir la limpieza de zonas\nexteriores asociadas, como las ventanas o pasajes.\n',0,0),(856,'8122','Otras actividades de limpieza industrial y de edificios',4,'81.22 Otras actividades de limpieza industrial y de edificios\nEsta clase comprende:\n- la limpieza exterior de todo tipo de edificios, incluidas oficinas, fbricas, comercios, edificios oficiales y otros\nestablecimientos empresariales y profesionales, as como los bloques residenciales\n- las actividades de limpieza especializada de edificios, como la limpieza de ventanas, chimeneas, hogares de\nchimenea, hornos, incineradores, calderas, conductos de ventilacin y extractores de aire\n- la limpieza de maquinaria industrial\n- otras actividades de limpieza industrial y de edificios n.c.o.p.\n',0,0),(857,'8129','Otras actividades de limpieza',4,'81.29 Otras actividades de limpieza\nEsta clase comprende:\n- los servicios de limpieza y mantenimiento de piscinas\n- la limpieza de trenes, autobuses, aviones, etc.\n- la limpieza interior de camiones y buques cisterna\n- las actividades de desinfeccin, desratizacin y desinsectacin\n- el lavado de botellas\n- el barrido y la retirada de hielo y nieve de las calles\n- otras actividades de limpieza n.c.o.p.\n',0,0),(858,'813','Actividades de jardinera',3,'81.3 Actividades de jardinera\n',0,0),(859,'8130','Actividades de jardinera',4,'81.30 Actividades de jardinera\nEsta clase comprende:\n- la plantacin, el cuidado y el mantenimiento de:\n parques y jardines para:\n viviendas privadas y pblicas\n edificios pblicos y semipblicos (centros de enseanza, hospitales, edificios administrativos, construcciones\nreligiosas, etc.)\n terrenos municipales (parques, zonas verdes, cementerios, etc.)\n plantas para carreteras, lneas de ferrocarril y tranva, vas navegables y puertos\n edificios industriales y comerciales\n plantas para:\n edificios (jardines en azoteas y fachadas, jardines interiores, etc.)\n terrenos deportivos (campos de ftbol, campos de golf, etc.), campos de juego, praderas para tomar el sol y\notros parques recreativos\n extensiones y cursos de agua (estanques, zonas hmedas variables, lagunas, piscinas, canales, cursos de\nagua, sistemas de aguas residuales)\n- plantas para la proteccin contra el ruido, el viento, la erosin, la visibilidad y el deslumbramiento\n',0,0),(860,'82','Actividades administrativas de oficina y otras actividades auxiliares a las empresas',2,'82 Actividades administrativas de oficina y otras actividades auxiliares a las empresas\nEsta divisin comprende la prestacin de una serie de servicios administrativos diarios de oficina, as como las\nfunciones corrientes y rutinarias de apoyo empresarial por cuenta de terceros.\nEsta divisin comprende tambin todos los servicios complementarios que suelen prestarse a las empresas y que no\nestn clasificados en otros apartados.\nLas unidades clasificadas en esta divisin no ofrecen dotacin de personal para la realizacin de todas las\noperaciones de una empresa.\n',0,0),(861,'821','Actividades administrativas y auxiliares de oficina',3,'82.1 Actividades administrativas y auxiliares de oficina\nEste grupo comprende la prestacin de una serie de servicios administrativos diarios de oficina, como la planificacin\nfinanciera, la facturacin y el archivo, la distribucin de personal y fsica, y la logstica.\nEste grupo comprende tambin las actividades de apoyo por cuenta de terceros, para funciones corrientes y\nrutinarias de apoyo empresarial de las que suelen encargarse las propias empresas y organizaciones.\nLas unidades clasificadas en este grupo no ofrecen dotacin de personal para la realizacin de todas las\noperaciones de una empresa. Las unidades que intervienen en una aspecto concreto de estas actividades estn\nclasificadas segn ese tipo de actividad.\n',0,0),(862,'8211','Servicios administrativos combinados',4,'82.11 Servicios administrativos combinados\nEsta clase comprende la prestacin de una serie de servicios administrativos diarios de oficina, como la recepcin, la\nplanificacin financiera, la facturacin y el archivo, los servicios de personal y de correo, etc. por cuenta de terceros.\n',0,0),(863,'8219','Actividades de fotocopiado, preparacin de documentos y otras actividades especializadas de oficina',4,'82.19 Actividades de fotocopiado, preparacin de documentos y otras actividades especializadas de\noficina\nEsta clase comprende una serie de actividades como realizacin de fotocopias, preparacin de documentos y\nfunciones especializadas de apoyo a oficinas. Las actividades de fotocopia/impresin de documentos incluidas en\neste apartado se refieren slo a las actividades de impresin de orden menor.\nEsta clase comprende:\n- la preparacin de documentos\n- la edicin de documentos y la correccin de pruebas\n- la mecanografa y el tratamiento de textos\n- los servicios complementarios de secretara\n- la trascripcin de documentos y otros servicios de secretara\n- la redaccin de cartas y curriculums\n- la prestacin de servicios de alquiler de apartados de correos y otros servicios postales y de despacho de\ncorrespondencia, como la preclasificacin, la asignacin de direcciones, etc.\n- la realizacin de fotocopias\n- la realizacin de duplicados\n- la cianocopia\n- otros servicios de copia de documentos que no presten servicio de impresin, como la impresin offset, la\nimpresin rpida, la impresin digital y los servicios preimpresin.\n',0,0),(864,'822','Actividades de los centros de llamadas',3,'82.2 Actividades de los centros de llamadas\n',0,0),(865,'8220','Actividades de los centros de llamadas',4,'82.20 Actividades de los centros de llamadas\nEsta clase comprende:\n- los centros de recepcin de llamadas, que responden a llamadas de los clientes con operadores, distribucin\nautomtica de llamadas, integracin ordenador-telfono, sistemas de respuesta vocal interactiva o mtodos similares\npara recibir pedidos, facilitar informacin sobre productos, ocuparse de las solicitudes de asistencia de los clientes o\natender sus quejas.\n- centros de emisin de llamadas que usan mtodos similares para vender o promocionar mercancas o servicios a\nposibles clientes, realizar estudios de mercado o encuestas de opinin pblica y actividades similares para los\nclientes.\n',0,0),(866,'823','Organizacin de convenciones y ferias de muestras',3,'82.3 Organizacin de convenciones y ferias de muestras\n',0,0),(867,'8230','Organizacin de convenciones y ferias de muestras',4,'82.30 Organizacin de convenciones y ferias de muestras\nEsta clase comprende la organizacin, promocin y/o gestin de eventos como ferias empresariales y comerciales,\nconvenciones, conferencias y reuniones, incluyan o no la gestin y dotacin de personal para que realice sus\nfunciones en las instalaciones en las que tiene lugar el evento.\n',0,0),(868,'829','Actividades de apoyo a las empresas n.c.o.p.',3,'82.9 Actividades de apoyo a las empresas n.c.o.p.\nEste grupo comprende las actividades de las agencias de cobros, las oficinas que facilitan informacin sobre la\nsolvencia de terceros y todas las actividades complementarias que suelen prestarse a las empresas y que no estn\nrecogidas en otros apartados.\n',0,0),(869,'8291','Actividades de las agencias de cobros y de informacin comercial',4,'82.91 Actividades de las agencias de cobros y de informacin comercial\nEsta clase comprende:\n- las empresas especializadas en el cobro de pagos por reclamaciones y la transferencia a los clientes de los pagos\ncobrados, como los servicios de cobro de deudas o facturas.\n- las actividades de recopilacin de informacin, como los historiales de solvencia o empleo de particulares y el\nhistorial de solvencia de las empresas; de suministro de informacin a instituciones financieras, minoristas, etc. que\nnecesiten evaluar la solvencia de esas personas o empresas.\n',0,0),(870,'8292','Actividades de envasado y empaquetado',4,'82.92 Actividades de envasado y empaquetado\nEsta clase comprende:\n- las actividades de envasado y empaquetado por cuenta de terceros, con intervencin o no de procesos\nautomatizados:\n el embotellado de lquidos, incluidos alimentos y bebidas\n el empaquetado de slidos (al vaco, con papel de aluminio, etc.)\n el envasado de seguridad de preparados farmacuticos\n el etiquetado, la estampacin y la impresin\n el embalaje de paquetes y la envoltura de regalos\n',0,0),(871,'8299','Otras actividades de apoyo a las empresas n.c.o.p.',4,'82.99 Otras actividades de apoyo a las empresas n.c.o.p.\nEsta clase comprende:\n- la elaboracin de informes literales y la reproduccin por esteneotipia de los procesos jurdicos, mientras tienen\nlugar, y la posterior trascripcin a formatos grabados, como:\n los servicios de elaboracin de transcripciones judiciales o de reproduccin por estenotipia\n los servicios de estenografa\n- la subtitulacin en tiempo real (es decir, simultnea) de las reuniones, conferencias, etc. que se emiten en directo\npor televisin\n- los servicios de cdigos de barras para direcciones postales\n- los servicios de impresin de cdigos de barras\n- los servicios de las organizaciones de recaudacin de fondos realizados por cuenta de terceros\n- los servicios de recuperacin de bienes impagados\n- los servicios de recaudacin de monedas de los parqumetros\n- las actividades de los subastadores independientes\n- la administracin de programas de bonificacin por fidelidad\n- otras actividades complementarias que suelen prestarse a las empresas y que no se han clasificado en otros\napartados.\n',0,0),(872,'O','Administracin Pblica y defensa; Seguiridad Social obligatoria',1,NULL,0,0),(873,'84','Administracin Pblica y defensa; Seguiridad Social obligatoria',2,'84 Administracin Pblica y defensa; Seguridad Social obligatoria\n',0,0),(874,'841','Administracin Pblica y de la poltica econmica y social',3,'84.1 Administracin Pblica y de la poltica econmica y social\nEste grupo comprende la administracin general (de carcter ejecutivo, legislativo, financiero, etc., a todos los\nniveles de la administracin) y la supervisin en el mbito de la vida social y econmica.\n',0,0),(875,'8411','Actividades generales de la Administracin Pblica',4,'84.11 Actividades generales de la Administracin Pblica\nEsta clase comprende:\n- la administracin ejecutiva y legislativa central, regional y local\n- la administracin y supervisin de asuntos fiscales:\n la administracin tributaria\n la recaudacin de impuestos o derechos sobre los productos y la investigacin de las infracciones fiscales\n la administracin de aduanas\n- la aplicacin del presupuesto y la gestin de los fondos pblicos y de la deuda pblica:\n la obtencin y recepcin de fondos y la fiscalizacin de su gasto\n- la administracin de la poltica de investigacin y desarrollo general (civil) y administracin de los fondos\npertinentes\n- la gestin y administracin de servicios estadsticos y de planificacin social y econmica global a distintos niveles\nde la Administracin Pblica\n',0,0),(876,'8412','Regulacin de las actividades sanitarias, educativas y culturales y otros servicios sociales, excepto Seguridad Social',4,'84.12 Regulacin de las actividades sanitarias, educativas y culturales y otros servicios sociales, excepto\nSeguridad Social\nEsta clase comprende:\n- la administracin pblica de programas destinados a mejorar el bienestar de los ciudadanos:\n salud\n educacin\n cultura\n deporte\n servicios recreativos\n medio ambiente\n vivienda\n servicios sociales\n- la administracin pblica de las polticas de investigacin y desarrollo y administracin de los fondos pertinentes\nEsta clase comprende tambin:\n- el patrocinio de actividades recreativas y culturales\n- la concesin de becas pblicas a artistas\n- la administracin de programas de suministro de agua potable\n- la administracin de servicios de recoleccin y eliminacin de residuos\n- la administracin de programas de proteccin ambiental\n- la administracin de programas de vivienda\n',0,0),(877,'8413','Regulacin de la actividad econmica y contribucin a su mayor eficiencia',4,'84.13 Regulacin de la actividad econmica y contribucin a su mayor eficiencia\nEsta clase comprende:\n- la administracin pblica y regulacin, incluso concesin de subvenciones, de los distintos sectores econmicos:\n agricultura\n ordenacin territorial\n recursos energticos y mineros\n infraestructuras\n transportes\n comunicaciones\n hoteles y turismo\n comercio al por mayor y al por menor\n- la administracin de las polticas de investigacin y desarrollo y de los fondos pertinentes para mejorar los\nresultados econmicos\n- la administracin de la poltica laboral\n- la administracin de polticas de desarrollo regional, por ejemplo para reducir el desempleo\n',0,0),(878,'842','Prestacin de servicios a la comunidad en general',3,'84.2 Prestacin de servicios a la comunidad en general\nEste grupo comprende las actividades de asuntos exteriores, defensa y orden pblico y seguridad.\n',0,0),(879,'8421','Asuntos exteriores',4,'84.21 Asuntos exteriores\nEsta clase comprende:\n- la administracin y el funcionamiento del Ministerio de Asuntos Exteriores y de las representaciones diplomticas y\nconsulares acreditadas en el extranjero o ante organizaciones internacionales.\n- la administracin, el funcionamiento y el apoyo de los servicios de informacin y cultura destinados a prestarse en\nel extranjero.\n- la concesin de ayuda econmica a terceros pases, est o no canalizada a travs de organizaciones\ninternacionales\n- la prestacin de ayuda militar a otros pases\n- la organizacin del comercio exterior, la financiacin internacional y cuestiones de carcter tcnico\n',0,0),(880,'8422','Defensa',4,'84.22 Defensa\nEsta clase comprende:\n- la administracin, supervisin y funcionamiento de la defensa y de las fuerzas armadas de tierra, mar y aire, como:\n los ejrcitos de tierra, mar y aire\n la ingeniera, transportes, comunicaciones, servicios de inteligencia, material, personal y otras fuerzas y mandos\nque no sean de combate\n las fuerzas auxiliares y de reserva\n la logstica militar (el suministro de equipo, estructuras, suministros, etc.)\n la asistencia sanitaria al personal militar en campaa\n- la administracin, la gestin y el apoyo de las fuerzas de defensa civil\n- la prestacin de apoyo a la elaboracin de planes de emergencia y a la realizacin de ejercicios en que intervengan\npoblacin e instituciones civiles\n- la administracin de las polticas de investigacin y desarrollo en materia de defensa y administracin de los fondos\npertinentes\n',0,0),(881,'8423','Justicia',4,'84.23 Justicia\nEsta clase comprende:\n- la administracin y funcionamiento de tribunales civiles, administrativos y penales, de tribunales militares y del\nsistema judicial en general, incluso el desempeo de funciones de representacin y asistencia letrada en nombre del\nEstado\n- la emisin de fallos judiciales e interpretacin de la ley\n- el arbitraje en casos civiles\n- la administracin de establecimientos penitenciarios y medidas de privacin de libertad, incluso servicios de\nrehabilitacin, tanto si su administracin y explotacin la realizan unidades oficiales o privadas por cuenta de\nterceros\n',0,0),(882,'8424','Orden pblico y seguridad',4,'84.24 Orden pblico y seguridad\nEsta clase comprende:\n- la direccin y el funcionamiento de cuerpos de polica regulares y auxiliares que dependen de las autoridades\npblicas, de fuerzas de vigilancia portuaria, fronteriza y costera y otros cuerpos especiales, incluyendo la regulacin\ndel trfico, el registro de extranjeros y el mantenimiento de registros de detenidos\n- el abastecimiento de suministros para su utilizacin en situaciones de emergencia en territorio nacional causadas\npor catstrofes en tiempos de paz\n',0,0),(883,'8425','Proteccin civil',4,'84.25 Proteccin civil\nEsta clase comprende:\n- la prevencin y extincin de incendios:\n la administracin y gestin de cuerpos de bomberos regulares y auxiliares, encargados de la prevencin y\nextincin de incendios, el rescate de personas y animales, la asistencia en catstrofes civiles, inundaciones,\naccidentes en carretera, etc.\n',0,0),(884,'843','Seguridad Social obligatoria',3,'84.3 Seguridad Social obligatoria\n',0,0),(885,'8430','Seguridad Social obligatoria',4,'84.30 Seguridad Social obligatoria\nEsta clase comprende:\n- la financiacin y administracin de los programas de servicios pblicos de seguridad social:\n el seguro social de enfermedad, accidentes y desempleo\n las pensiones de jubilacin\n los programas para cubrir la prdida de ingresos en casos de maternidad, incapacidad temporal, viudedad, etc.\n',0,0),(886,'P','Educacin',1,NULL,0,0),(887,'85','Educacin',2,'85 Educacin\n',0,0),(888,'851','Educacin preprimaria',3,'85.1 Educacin preprimaria\n',0,0),(889,'8510','Educacin preprimaria',4,'85.10 Educacin preprimaria\nEsta clase comprende:\n- la educacin preprimaria (educacin que precede al primer nivel). La educacin preprimaria se define como la\nprimera etapa de la educacin organizada, diseada principalmente para introducir a los nios en un entorno\neducativo de tipo escolar, es decir, servir de puente entre el hogar y el medio escolar.\n',0,0),(890,'852','Educacin primaria',3,'85.2 Educacin primaria\n',0,0),(891,'8520','Educacin primaria',4,'85.20 Educacin primaria\nEsta clase comprende la educacin primaria: la imparticin de cursos acadmicos y otras tareas relacionadas con el\ncurso, que proporcionan a los estudiantes una slida educacin bsica para la lectura, la escritura y las\nmatemticas, as como un nivel elemental de comprensin de disciplinas como la historia, la geografa, las ciencias\nnaturales, las ciencias sociales, el arte y la msica.\nAunque este tipo de educacin suele ofrecerse a nios, comprende tambin la imparticin de programas de\nalfabetizacin incluidos o no en el sistema escolar, cuyos contenidos son similares a los programas de la educacin\nprimaria, si bien estn dirigidos a aquellos que han superado la edad para integrarse en la escuela elemental (es\ndecir, los programas de alfabetizacin para adultos).\n',0,0),(892,'853','Educacin secundaria',3,'85.3 Educacin secundaria\nEste grupo comprende la educacin secundaria general y de formacin tcnica y profesional.\n',0,0),(893,'8531','Educacin secundaria general',4,'85.31 Educacin secundaria general\nEsta clase comprende el tipo de educacin que proporciona las bases para la formacin a lo largo de toda la vida y\npara el desarrollo humano, y que capacita para fomentar las oportunidades de educacin. Tales unidades ofrecen\nprogramas que suelen dar prioridad a las disciplinas y que son impartidos por profesorado ms especializado; lo ms\ncomn es que contraten a varios profesores para que impartan clases de su especialidad.\nLa especializacin por asignaturas empieza a tener cierta influencia, incluso en la formacin de los estudiantes que\nsiguen un programa de educacin general. Los programas estn encaminados a preparar a los estudiantes para el\nnivel de educacin tcnica o profesional, o bien para el ingreso en la educacin superior, sin necesidad de cursos\nsuplementarios\nEsta clase comprende:\n- la educacin secundaria general de nivel ms bajo, que corresponde aproximadamente a la escolaridad obligatoria\n- la educacin secundaria general de nivel ms alto, que da en principio acceso a la educacin superior.\n',0,0),(894,'8532','Educacin secundaria tcnica y profesional',4,'85.32 Educacin secundaria tcnica y profesional\nEsta clase comprende el tipo de educacin orientada en general a una determinada especializacin y en la que se\nimparten conocimientos tericos y prcticos que suelen tener por objeto la mejora de las posibilidades actuales o\nfuturas de empleo.\nLos objetivos de los programas pueden variar desde la preparacin para empleos de tipo general hasta la\npreparacin para una ocupacin concreta.\nEsta clase comprende:\n- la educacin tcnica y profesional de nivel inferior a la educacin superior, tal y como se define en 85.4.\nEsta clase comprende tambin:\n- formacin para guas tursticos\n- formacin para chefs, hoteleros y gerentes de restaurante\n- escuelas de cosmetologa y peluquera\n- formacin en reparacin de ordenadores\n- autoescuelas para los conductores profesionales, por ejemplo, de camiones, autobuses y autocares, las escuelas\nde pilotaje para pilotos profesionales\n',0,0),(895,'854','Educacin postsecundaria',3,'85.4 Educacin postsecundaria\nEste grupo comprende la imparticin de cursos de educacin postsecundaria no terciaria y de cursos acadmicos\nconducentes a la obtencin de ttulo de grado y post-grado. El requisito mnimo de ingreso es estar en posesin de\nun diploma acreditativo del mximo nivel de la educacin secundaria.\nEste grupo no comprende:\n- los programas de educacin para adultos definidos en la clase 85.5\n',0,0),(896,'8541','Educacin postsecundaria no terciaria',4,'85.41 Educacin postsecundaria no terciaria\nEsta clase comprende la provisin de educacin postsecundaria que no puede ser considerada educacin terciaria.\nPor ejemplo, la provisin de educacin postsecundaria suplementaria de preparacin para la educacin terciaria, o la\neducacin postsecundaria no terciaria profesional.\n',0,0),(897,'8542','Educacin terciaria',4,'85.42 Educacin terciaria\nEsta clase comprende:\n- el primer, segundo y tercer ciclo de la educacin terciaria\nEsta clase comprende tambin:\n- las escuelas de artes escnicas que imparten educacin terciaria\n',0,0),(898,'855','Otra educacin',3,'85.5 Otra educacin\nEste grupo comprende la formacin y educacin continuas de carcter general o profesional por motivos de\nprofesin, aficin o desarrollo personal.\nNo comprende las actividades educativas incluidas en los grupos 85.1 a 85.4, es decir, la educacin preprimaria,\neducacin primaria, educacin secundaria o educacin superior. Comprende las actividades de los campamentos y\nlas escuelas que ofrecen formacin deportiva a grupos o individuos, enseanza de idiomas, formacin relacionada\ncon las bellas artes, el teatro y la msica, u otro tipo de educacin o formacin especializada no comparable a la de\nlos grupos 85.1 a 85.4.\n',0,0),(899,'8551','Educacin deportiva y recreativa',4,'85.51 Educacin deportiva y recreativa\nEsta clase comprende la provisin de educacin en actividades deportivas a grupos o individuos, como la impartida\nen campamentos y escuelas. Comprende tambin las actividades de los campamentos que ofrecen formacin\ndeportiva con alojamiento. No comprende las actividades de los colegios y escuelas universitarios, ni de las\nuniversidades. La educacin puede impartirse en diversos escenarios, como las instalaciones para formacin de las\nque dispongan la unidad o el cliente, las instituciones de enseanza o por otros medios. La educacin que se\nimparte en esta clase est organizada formalmente.\nEsta clase comprende:\n- las clases de deporte (bisbol, baloncesto, cricket, ftbol, etc.)\n- los campamentos de formacin deportiva\n- las clases de gimnasia\n- las clases, academias o escuelas de hpica\n- las clases de natacin\n- los profesores, instructores y entrenadores deportivos profesionales\n- las clases de artes marciales\n- las clases de juegos de naipes (como el bridge)\n- las clases de yoga\n',0,0),(900,'8552','Educacin cultural',4,'85.52 Educacin cultural\nEsta clase comprende la educacin relacionada con las bellas artes, el teatro y la msica. Las unidades que\nimparten este tipo de educacin pueden denominarse escuelas, estudios, clases, etc. Ofrecen formacin\norganizada formalmente y principalmente con fines recreativos, por aficin o para desarrollo personal, es decir, este\ntipo de formacin no conduce a la obtencin de ningn diploma profesional ni ttulo de bachillerato o de graduacin.\nEsta clase comprende:\n- los profesores de piano y otros formadores musicales\n- las clases de arte\n- las clases de baile y estudios de baile\n- las escuelas de teatro (excepto las acadmicas)\n- las escuelas de bellas artes (excepto las acadmicas)\n- las escuelas de artes escnicas (excepto las acadmicas)\n- las escuelas de fotografa (excepto las profesionales)\n',0,0),(901,'8553','Actividades de las escuelas de conduccin y pilotaje',4,'85.53 Actividades de las escuelas de conduccin y pilotaje\nEsta clase comprende tambin:\n- las escuelas de pilotaje, navegacin y vela que no conceden certificados ni permisos profesionales\n',0,0),(902,'8559','Otra educacin n.c.o.p.',4,'85.59 Otra educacin n.c.o.p.\nEsta clase comprende:\n- la educacin a la que no puede asignarse un nivel determinado\n- los servicios de tutora acadmica\n- los centros de enseanza que imparten clases de recuperacin\n- los cursos de repaso para exmenes profesionales\n- la enseanza de la lengua y de las tcnicas de expresin oral\n- las clases de informtica\n- la formacin religiosa\nEsta clase comprende tambin:\n- la formacin para socorristas\n- las clases de tcnicas de supervivencia\n- las clases de oratoria\n- las clases de tcnicas de lectura rpida\n',0,0),(903,'856','Actividades auxiliares a la educacin',3,'85.6 Actividades auxiliares a la educacin\n',0,0),(904,'8560','Actividades auxiliares a la educacin',4,'85.60 Actividades auxiliares a la educacin\nEsta clase comprende:\n- la prestacin de actividades no docentes de apoyo a los procesos o sistemas educativos:\n- el asesoramiento educativo\n- los servicios de orientacin educativa\n- los servicios de evaluacin educativa\n- los servicios de pruebas educativas\n- la organizacin de programas de intercambio de estudiantes\n',0,0),(905,'Q','Actividades sanitarias y de servicios sociales',1,NULL,0,0),(906,'86','Actividades sanitarias',2,'86 Actividades sanitarias\nEsta divisin comprende las actividades de los hospitales generales y especializados de corta y larga estancia, los\nhospitales quirrgicos, psiquitricos y para drogodependientes, los sanatorios, los centros de medicina preventiva,\nlos hospitales geritricos, los manicomios, los centros de rehabilitacin, los lazaretos y otras instituciones sanitarias\nque dispongan de alojamiento y que proporcionan servicios de diagnstico y tratamiento mdico a pacientes internos\ncon una variedad situacin mdica. Comprende tambin las consultas y tratamientos realizados por mdicos de\nmedicina general, especialistas y cirujanos. Comprende las actividades odontolgicas de naturaleza general o\nespecializada, y las actividades de ortodoncia. Adems, esta divisin comprende las actividades relacionadas con la\nsalud humana no realizadas en hospitales o por doctores en medicina en ejercicio, sino por otro personal\nparamdico legalmente habilitado para tratar a pacientes.\n',0,0),(907,'861','Actividades hospitalarias',3,'86.1 Actividades hospitalarias\n',0,0),(908,'8610','Actividades hospitalarias',4,'86.10 Actividades hospitalarias\nEsta clase comprende:\n- las actividades de los hospitales de corta y larga estancia, es decir, las actividades mdicas, de diagnstico y\ntratamiento de los hospitales generales (por ejemplo, hospitales regionales y municipales, hospitales de\norganizaciones sin fines de lucro, hospitales universitarios, hospitales militares y penitenciarios) y de los hospitales\nespecializados (por ejemplo, hospitales psiquitricos y para drogodependientes, hospitales para enfermedades\ninfecciosas, maternidades, sanatorios especializados). Estas actividades estn principalmente destinadas a la\natencin de pacientes internos, se realizan bajo la supervisin directa de mdicos, y comprenden:\n los servicios del personal mdico y auxiliar\n los servicios de laboratorios e instalaciones tcnicas, incluso servicios de radiologa y anestesiologa\n los servicios de urgencia\n los servicios de quirfano, de farmacia, de comedor y otros servicios hospitalarios\n los servicios de los centros de planificacin familiar que ofrecen tratamientos mdicos como la esterilizacin o el\naborto, con alojamiento\n',0,0),(909,'862','Actividaes mdicas y odontolgicas',3,'86.2 Actividades mdicas y odontolgicas\nEste grupo comprende las actividades de consulta y tratamiento realizadas por mdicos de medicina general y\nespecializada, incluidos los cirujanos, los dentistas, etc.\nLas actividades pueden realizarse en consultorios privados, consultorios de grupos mdicos y ambulatorios\nhospitalarios, y en clnicas de empresas, escolares, de residencias de ancianos, de organizaciones sindicales y\nasociaciones profesionales, as como en el domicilio de los pacientes.\nEste grupo comprende tambin:\n- la asistencia privada a los pacientes internos por mdicos externos\n',0,0),(910,'8621','Actividades de medicina general',4,'86.21 Actividades de medicina general\nEsta clase comprende:\n- las consultas y tratamientos realizados por mdicos de medicina general\n',0,0),(911,'8622','Actividades de medicina especializada',4,'86.22 Actividades de medicina especializada\nEsta clase comprende:\n- las consultas y tratamientos realizados por mdicos especialistas y cirujanos\nEsta clase comprende tambin:\n- los servicios de los centros de planificacin familiar que ofrecen tratamientos mdicos como la esterilizacin o el\naborto, sin alojamiento\n',0,0),(912,'8623','Actividades odontolgicas',4,'86.23 Actividades odontolgicas\nEsta clase comprende:\n- las actividades de odontologa general o especializada, por ejemplo, endodoncia y odontologa peditrica; las\npatologas bucales.\n- las actividades de ortodoncia\nEsta clase comprende tambin:\n- la asistencia odontolgica en salas de operaciones\n',0,0),(913,'869','Otras actividades sanitarias',3,'86.9 Otras actividades sanitarias\n',0,0),(914,'8690','Otras actividades sanitarias',4,'86.90 Otras actividades sanitarias\nEsta clase comprende:\n- las actividades relacionadas con la salud humana no realizadas en hospitales o por doctores en medicina u\nodontlogos:\n actividades de enfermeras, comadronas, fisioterapeutas u otros facultativos en el mbito de la optometra,\nhidroterapia, masaje teraputico, terapia ocupacional, logopedia, podologa, homeopata, quiroprctica,\nacupuntura, etc.\nEstas actividades pueden realizarse en y en clnicas de empresas, escolares, de residencias de ancianos, de\norganizaciones sindicales y asociaciones profesionales, as como en establecimientos sanitarios residenciales\ndistintos de los hospitales, en consultas privadas, en el domicilio del paciente u otros lugares.\nEsta clase comprende tambin:\n- las actividades realizadas por personal paramdico de odontologa como los higienistas dentales, que pueden no\nejercer su trabajo en el mismo lugar que el odontlogo, pero se someten a la supervisin peridica de ste.\n- las actividades de los laboratorios mdicos, como:\n laboratorios de rayos X y otros centros de diagnstico por imagen\n laboratorios para anlisis de sangre\n- las actividades de bancos de sangre, bancos de esperma y de rganos para trasplante, etc.\n- el transporte en ambulancia, incluido por avin. Estos servicios suelen prestarse durante una urgencia mdica.\n',0,0),(915,'87','Asistencia en establecimientos residenciales',2,'87 Asistencia en establecimientos residenciales\nEsta divisin comprende la prestacin de asistencia en establecimientos residenciales en combinacin con cuidados\nde enfermera, de supervisin o de otros tipos, segn las necesidades de los residentes. Las instalaciones\nconstituyen una parte significativa del proceso de produccin y los cuidados prestados son una mezcla de servicios\nsociales y sanitarios, siendo estos ltimos en su mayor parte servicios de enfermera.\n',0,0),(916,'871','Asistencia en establecimientos residenciales con cuidados de  sanitarios',3,'87.1 Asistencia en establecimientos residenciales con cuidados sanitarios\n',0,0),(917,'8710','Asistencia en establecimientos residenciales con cuidados de  sanitarios',4,'87.10 Asistencia en establecimientos residenciales con cuidados sanitarios\nEsta clase comprende:\n- las actividades de:\n- las residencias de ancianos con cuidados de enfermera\n- los centros de convalecencia\n- las clnicas de reposo con cuidados de enfermera\n- los centros con cuidados de enfermera\n- las residencias con cuidados de enfermera\n',0,0),(918,'872','Asistencia en establecimientos residenciales para personas con discapacidad intelectual, enfermedad mental y drogodependencia',3,'87.2 Asistencia en establecimientos residenciales para personas con discapacidad intelectual,\nenfermedad mental y drogodependencia\n',0,0),(919,'8720','Asistencia en establecimientos residenciales para personas con discapacidad intelectual, enfermedad mental y drogodependencia',4,'87.20 Asistencia en establecimientos residenciales para personas con discapacidad intelectual,\nenfermedad mental y drogodependencia\nEsta clase comprende la prestacin de asistencia en establecimientos residenciales (aunque no la atencin\nhospitalaria autorizada) a personas con retraso mental, enfermedades mentales o problemas de drogodependencia.\nLos establecimientos ofrecen alojamiento, comida, supervisin protectora y asesoramiento, y cierto nivel de atencin\nsanitaria. Comprende tambin la prestacin de asistencia en establecimientos residenciales y el tratamiento de\npacientes con enfermedades mentales y problemas de drogodependencia.\nEsta clase comprende:\n- las actividades de:\n? los establecimientos para el tratamiento del alcoholismo o de la drogodependencia\n? los centros de convalecencia psiquitrica\n? las residencias para personas con problemas emocionales\n? los establecimientos para personas con retraso mental\n? los centros de reinsercin para personas con problemas mentales\n',0,0),(920,'873','Asistencia en establecimientos residenciales para personas mayores y con discapacidad fsica',3,'87.3 Asistencia en establecimientos residenciales para personas mayores y con discapacidad fsica\n',0,0),(921,'8730','Asistencia en establecimientos residenciales para personas mayores y con discapacidad fsica',4,'87.30 Asistencia en establecimientos residenciales para personas mayores y con discapacidad fsica\nEsta clase comprende la prestacin de asistencia en establecimientos residenciales a ancianos y personas\ndiscapacitadas que no pueden valerse por s mismas y/o que no desean vivir solas. Esta asistencia suele incluir\nalojamiento, comida, supervisin y asistencia en tareas de la vida diaria, como la limpieza domstica. En algunos\ncasos, estas unidades ofrecen cuidados de enfermera cualificados a los residentes en instalaciones independientes\ndentro del centro.\nEsta clase comprende:\n- las actividades de:\n? los establecimientos para personas asistidas\n? las comunidades de jubilados con cuidados continuos\n? las residencias de ancianos con cuidados de enfermera mnimos\n? las clnicas de reposo sin cuidados de enfermera\n',0,0),(922,'879','Otras actividades de asistencia en establecimientos residenciales',3,'87.9 Otras actividades de asistencia en establecimientos residenciales\n',0,0),(923,'8790','Otras actividades de asistencia en establecimientos residenciales',4,'87.90 Otras actividades de asistencia en establecimientos residenciales\nEsta clase comprende la prestacin de asistencia en establecimientos residenciales a personas (excepto ancianos y\ndiscapacitados) que no pueden valerse por s mismas o que no desean vivir solas.\nEsta clase comprende:\n- las actividades realizadas por turnos y destinadas a prestar asistencia social a nios y a categoras especiales de\npersonas que tienen algn impedimento para valerse por s mismas, pero en las que el tratamiento mdico o la\neducacin no constituyen un elemento importante:\n los orfanatos\n los centros de acogida y hogares infantiles\n los centros de acogida temporal para las personas sin hogar\n las instituciones que atienden a las madres solteras y a sus hijos\nLas actividades pueden ser realizadas por organismos oficiales u organizaciones privadas.\nEsta clase comprende tambin:\n- las actividades de:\n los centros residenciales de reinsercin para personas con problemas sociales y personales\n los centros residenciales de reinsercin para delincuentes\n las reformatorios residenciales para jvenes\n',0,0),(924,'88','Actividades de servicios sociales sin alojamiento',2,'88 Actividades de servicios sociales sin alojamiento\nEsta divisin comprende la prestacin de diversos servicios sociales directamente a los clientes. Las actividades de\nesta divisin no incluyen servicios de alojamiento, excepto con carcter temporal.\n',0,0),(925,'881','Actividades de servicios sociales sin alojamiento para personas mayores y con discapacidad',3,'88.1 Actividades de servicios sociales sin alojamiento para personas mayores y con discapacidad\n',0,0),(926,'8810','Actividades de servicios sociales sin alojamiento para personas mayores y con discapacidad',4,'88.10 Actividades de servicios sociales sin alojamiento para personas mayores y con discapacidad\nEsta clase comprende:\n- los servicios sociales, de asesoramiento, bienestar social, orientacin y otras similares que prestan a ancianos o a\npersonas discapacitadas en su domicilio o en otros lugares, ciertos organismos oficiales u organizaciones privadas,\norganizaciones de ayuda de tipo nacional o local, as como los especialistas que prestan servicios de consejo y\norientacin:\n visitas a los ancianos o personas discapacitadas\n actividades de atencin diurna para ancianos o adultos discapacitados\n la rehabilitacin ocupacional y la capacitacin de personas discapacitadas, siempre que el componente educativo\nsea limitado\n',0,0),(927,'889','Otras actividades de servicios sociales sin alojamiento',3,'88.9 Otros actividades de servicios sociales sin alojamiento\n',0,0),(928,'8891','Actividades de cuidado diurno de nios',4,'88.91 Actividades de cuidado diurno de nios\nEsta clase comprende tambin:\n- las actividades de las guarderas diurnas para alumnos, incluyendo el cuidado diurno de nios discapacitados\n',0,0),(929,'8899','Otros actividades de servicios sociales sin alojamiento n.c.o.p.',4,'88.99 Otros actividades de servicios sociales sin alojamiento n.c.o.p.\nEsta clase comprende:\n- los servicios sociales, de asesoramiento, bienestar social, asilo, orientacin y otras similares, que prestan a\nindividuos o familias en su domicilio o en otros lugares, ciertos organismos oficiales u organizaciones privadas,\norganizaciones de auxilio en caso de catstrofes y organizaciones de ayuda de tipo nacional o local, as como los\nespecialistas que prestan servicios de consejo y orientacin:\n las actividades de asistencia social y orientacin de nios y adolescentes\n los servicios de adopcin y prevencin de malos tratos a la infancia y a otros colectivos\n el asesoramiento sobre el presupuesto familiar, orientacin familiar y matrimonial\n las actividades de ayuda a la comunidad o al vecindario\n la prestacin de auxilio a vctimas de catstrofes, refugiados, inmigrantes, etc. incluido su alojamiento temporal o\nprolongado\n la rehabilitacin ocupacional y la capacitacin de personas desempleadas, siempre que el componente educativo\nsea limitado\n la determinacin de las personas con derecho a recibir asistencia social, ayudas para el alquiler de viviendas o\ncupones para comprar alimentos\n los centros de da para personas sin hogar y otros grupos socialmente desfavorecidos\n las actividades benficas como la recaudacin de fondos u otras actividades de apoyo a los servicios sociales\n',0,0),(930,'R','Actividades artsticas, recreativas y de entretenimiento',1,NULL,0,0),(931,'90','Actividades de creacin, artsticas y espectculos',2,'90 Actividades de creacin, artsticas y espectculos\nEsta divisin comprende la explotacin de instalaciones y la prestacin de servicios destinados a satisfacer los\nintereses culturales y de entretenimiento de sus clientes. Se incluye aqu la produccin, la promocin y la\nparticipacin en actuaciones en vivo, eventos o exposiciones concebidos para su contemplacin por el pblico; y la\nprovisin de destrezas artsticas, creativas o tcnicas para la obtencin de productos artsticos y la realizacin de\nactuaciones en vivo.\nEsta divisin no comprende:\n- la explotacin de museos de todo tipo, jardines botnicos y zoolgicos, la conservacin de lugares histricos y las\nactividades de las reservas naturales (vase la divisin 91)\n- las actividades de juegos de azar y apuestas (vase la divisin 92)\n- las actividades deportivas, de ocio y recreativas (vase la divisin 93).\nAlgunas unidades que ofrecen instalaciones y servicios culturales, de entretenimiento y recreativos se clasifican en\notras divisiones, como las de:\n- produccin y distribucin de pelculas cinematogrficas y de vdeos (vanse 59.11, 59.12 y 59.13)\n- la exhibicin cinematogrfica (vase 59.14)\n- las emisiones de radio y televisin (vanse 60.1 y 60.2)\n',0,0),(932,'900','Actividades de creacin, artsticas y espectculos',3,'90.0 Actividades de creacin, artsticas y espectculos\nEn este grupo se incluyen las actividades relacionadas con las artes creativas y escnicas, y otras afines.\n',0,0),(933,'9001','Artes escnicas',4,'90.01 Artes escnicas\nEsta clase comprende:\n- la produccin de obras de teatro, conciertos, peras, espectculos de danza y otras actividades escnicas\nrealizadas en directo:\n las actividades de grupos, circos o compaas, orquestas o bandas\n las actividades de artistas individuales como actores, bailarines, msicos, conferenciantes u oradores\n',0,0),(934,'9002','Actividades auxiliares a las artes escnicas',4,'90.02 Actividades auxiliares a las artes escnicas\nEsta clase comprende:\n- las actividades complementarias para la produccin de obras de teatro, conciertos, peras, espectculos de danza\ny otras actividades escnicas realizadas en directo:\n las actividades de directores, productores, diseadores y constructores de escenarios, tramoyistas, tcnicos de\niluminacin, etc.\nEsta clase comprende tambin las actividades de los productores o empresarios de eventos artsticos en vivo, con o\nsin instalaciones.\n',0,0),(935,'9003','Creacin artstica y literaria',4,'90.03 Creacin artstica y literaria\nEsta clase comprende:\n- las actividades de artistas individuales como escultores, pintores, dibujantes de dibujos animados, grabadores,\naguafuertistas, etc.\n- las actividades de escritores individuales de cualquier especialidad, incluida la escritura de ficcin, la escritura\ntcnica, etc.\n- las actividades de periodistas independientes\n- la restauracin de obras de arte como cuadros, etc.\n',0,0),(936,'9004','Gestin de salas de espectculos',4,'90.04 Gestin de salas de espectculos\nEsta clase comprende:\n- la explotacin de salas de teatro, salas de conciertos y otras salas de espectculos\n',0,0),(937,'91','Actividades de bibliotecas, archivos, museos y otras actividades culturales',2,'91 Actividades de bibliotecas, archivos, museos y otras actividades culturales\nEsta divisin comprende las actividades de bibliotecas y archivos; las actividades de museos de todo tipo, jardines\nbotnicos y zoolgicos; la explotacin de lugares histricos y las actividades de reservas naturales. Comprende\nasimismo la conservacin y la exhibicin de objetos, emplazamientos y maravillas naturales de inters histrico,\ncultural o educativo (p. ej., lugares patrimonio de la humanidad, etc.).\nEsta divisin no comprende:\n- las actividades deportivas, de ocio y recreativas como la explotacin de playas para el bao y parques recreativos\n(vase la divisin 93)\n',0,0),(938,'910','Actividades de bibliotecas, archivos, museos y otras actividades culturales',3,'91.0 Actividades de bibliotecas, archivos, museos y otras actividades culturales\n',0,0),(939,'9101','Actividades de bibliotecas y archivos',4,'91.01 Actividades de bibliotecas y archivos\nEsta clase comprende:\n- las actividades de documentacin e informacin de bibliotecas de todo tipo, salas de lectura, audicin o proyeccin,\narchivos pblicos, destinadas a servir al pblico en general o a una clientela especializada como estudiantes,\ncientficos, empleados o asociados, as como la gestin de los archivos oficiales:\n la creacin de colecciones, ya sean especializadas o no\n la catalogacin de colecciones\n el prstamo y almacenamiento de libros, mapas, revistas, pelculas, discos, cintas, obras de arte, etc.\n la recuperacin con objeto de atender necesidades de informacin, etc.\n- bibliotecas y servicios de almacenamiento de fotos y pelculas\n',0,0),(940,'9102','Actividades de museos',4,'91.02 Actividades de museos\nEsta clase comprende:\n- las actividades de museos de todo tipo:\n museos de arte, joyera, muebles, trajes, cermica, orfebrera\n museos de historia natural, ciencia y tecnologa, museos de historia, incluidos los museos militares\n otros museos especializados\n museos al aire libre\n',0,0),(941,'9103','Gestin de lugares y edificios histricos',4,'91.03 Gestin de lugares y edificios histricos\nEsta clase comprende:\n- la explotacin y conservacin de lugares y edificios histricos\n',0,0),(942,'9104','Actividades de los jardines botnicos, parques zoolgicos y reservas naturales',4,'91.04 Actividades de los jardines botnicos, parques zoolgicos y reservas naturales\nEsta clase comprende:\n- la gestin de jardines botnicos y zoolgicos, incluidos los infantiles\n- la gestin de reservas naturales, incluyendo la proteccin de la vida salvaje, etc.\n',0,0),(943,'92','Actividades de juegos de azar y apuestas',2,'92 Actividades de juegos de azar y apuestas\nEsta divisin comprende la explotacin de instalaciones para los juegos de azar, como casinos, bingos y salas de\nmquinas tragaperras, as como la prestacin de servicios relacionados con el juego, como loteras y apuestas\nhpicas.\n',0,0),(944,'920','Actividades de juegos de azar y apuestas',3,'92.0 Actividades de juegos de azar y apuestas\n',0,0),(945,'9200','Actividades de juegos de azar y apuestas',4,'92.00 Actividades de juegos de azar y apuestas\nEsta clase comprende las actividades de juegos de azar y apuestas como:\n- la venta de billetes de lotera\n- la explotacin de mquinas tragaperras\n- la explotacin de sitios de Internet dedicados a los juegos de azar virtuales\n- la corredura de apuestas y otras actividades afines\n- la explotacin de agencias de apuestas hpicas\n- la explotacin de casinos, incluidos los \"casinos flotantes\"\n',0,0),(946,'93','Actividades deportivas, recreativas y de entretenimiento',2,'93 Actividades deportivas, recreativas y de entretenimiento\nEsta divisin comprende la provisin de actividades recreativas, de esparcimiento y deportivas (excepto las de\nmuseos, la conservacin de lugares histricos, las actividades de jardines botnicos y zoolgicos y de reservas\nnaturales, y las apuestas y juegos de azar).\nSe excluyen de esta divisin las artes escnicas, la msica y otras artes y actividades de entretenimiento como la\nproduccin de obras de teatro, conciertos, peras, espectculos de danza y otras actividades escnicas realizadas\nen directo (vase la divisin 90).\n',0,0),(947,'931','Actividades deportivas',3,'93.1 Actividades deportivas\nEste grupo comprende la explotacin de instalaciones deportivas; las actividades de equipos o clubes deportivos\nparticipantes fundamentalmente en eventos deportivos en vivo ante una audiencia de pago; las actividades de\ndeportistas independientes dedicados a la participacin en eventos deportivos o carreras en vivo; las actividades de\nloa propietarios de automviles, perros, caballos, etc. participantes en carreras y dedicados fundamentalmente a\npromover la competicin de stos en carreras u otros acontecimientos deportivos con espectadores; las actividades\nde entrenadores deportivos que prestan servicios especializados de apoyo a participantes en eventos y\ncompeticiones deportivas; la explotacin de estadios; y otras actividades de organizacin, promocin y gestin de\neventos deportivos n.c.o.p.\n',0,0),(948,'9311','Gestin de instalaciones deportivas',4,'93.11 Gestin de instalaciones deportivas\nEsta clase comprende:\n- la explotacin de instalaciones para eventos deportivos a cubierto o al aire libre (en lugares abiertos, en recintos o\nlugares cubiertos, con asientos para espectadores o sin ellos):\n estadios de ftbol, hockey, cricket, rugby\n pistas para carreras de automviles, perros, caballos\n piscinas y centros de natacin\n estadios de atletismo\n instalaciones y estadios para deportes de invierno\n pabellones de hockey sobre hielo\n canchas de boxeo\n campos de golf\n boleras\n- la organizacin y explotracin de acontecimientos deportivos al aire libre o en recintos cubiertos, con la\nparticipacin de profesionales o aficionados, por parte de organizaciones con instalaciones propias\nEsta clase comprende la gestin y la dotacin de personal para el funcionamiento de tales instalaciones.\n',0,0),(949,'9312','Actividades de los clubes deportivos',4,'93.12 Actividades de los clubes deportivos\nEsta clase comprende las actividades de clubes deportivos profesionales, semiprofesionales o de aficionados que\nofrecen a sus miembros la oportunidad de participar en actividades deportivas.\nEsta clase comprende:\n- la explotacin de clubes deportivos:\n clubes de ftbol\n clubes de bolos\n clubes de natacin\n clubes de golf\n clubes de boxeo\n clubes de deportes de invierno\n clubes de ajedrez\n clubes de atletismo\n clubes de tiro, etc.\n',0,0),(950,'9313','Actividades de los gimnasios',4,'93.13 Actividades de los gimnasios\nEsta clase comprende:\n- las actividades de clubes e instalaciones de fitness y culturismo\n',0,0),(951,'9319','Otras actividades deportivas',4,'93.19 Otras actividades deportivas\nEsta clase comprende:\n- las actividades de productores o promotores de eventos deportivos, con o sin instalaciones\n- las actividades por cuenta propia realizadas por deportistas y atletas, jueces y rbitros, cronometradores, etc.\n- las actividades de ligas deportivas y rganos de regulacin del deporte\n- las actividades relacionadas con la promocin de espectculos deportivos\n- las actividades de las cuadras de caballos y galgos y de las escuderas participantes en carreras\n- la explotacin de cotos de pesca y de caza deportivas\n- las actividades de los guas de montaa\n- las actividades de apoyo a la caza y la pesca deportivas o recreativas\n',0,0),(952,'932','Actividades recreativas y de entretenimiento',3,'93.2 Actividades recreativas y de entretenimiento\nEste grupo comprende una amplia gama de unidades que gestionan instalaciones o prestan servicios para atender\nlos diversos intereses recreativos de sus clientes. Comprende la explotacin de diversas atracciones, como las\naccionadas por medios mecnicos, atracciones acuticas, juegos, espectculos, exposiciones temticas y\nmerenderos.\nSe excluyen de este grupo las actividades deportivas y las artes escnicas, la msica y otras artes y actividades de\nentretenimiento.\n',0,0),(953,'9321','Actividades de los parques de atracciones y los parques temticos',4,'93.21 Actividades de los parques de atracciones y los parques temticos\nEsta clase comprende las actividades de los parques de atracciones y los parques temticos. Comprende la\nexplotacin de diversas atracciones, como las accionadas por medios mecnicos, atracciones acuticas, juegos,\nespectculos, exposiciones temticas y merenderos.\n',0,0),(954,'9329','Otras actividades recreativas y de entretenimiento',4,'93.29 Otras actividades recreativas y de entretenimiento\nEsta clase comprende las actividades relacionadas con el entretenimiento y las actividades recreativas (excepto las\nde parques de atracciones y parques temticos), no clasificadas en otros apartados:\n- la explotacin de juegos accionados con monedas\n- las actividades de parques recreativos (sin alojamiento)\n- la explotacin de instalaciones de transporte recreativo, por ejemplo, puertos deportivos\n- la explotacin de estaciones de esqu\n- el alquiler de equipos de recreo y ocio como parte integral de instalaciones recreativas\n- las ferias y muestras de ndole recreativa\n- las actividades en playas, incluido el alquiler de instalaciones y equipos como baos, taquillas, sillas, etc.\n- la explotacin de salas de baile\nEsta clase comprende asimismo las actividades de productores o empresarios de eventos en vivo distintos de los\nespectculos artsticos o deportivos, con o sin instalaciones.\n',0,0),(955,'S','Otros servicios',1,NULL,0,0),(956,'94','Actividades asociativas',2,'94 Actividades asociativas\nEsta divisin comprende las actividades de las organizaciones que representan los intereses de grupos especiales o\nque promueven ideas ante la opinin pblica. Generalmente, estas organizaciones estn integradas por miembros,\naunque sus actividades pueden tambin contar con la participacin de personas que no son miembros y beneficiar a\nestas personas. El desglose bsico de esta divisin est determinado por la finalidad de dichas organizaciones, a\nsaber, la defensa de los intereses de los empleadores, de trabajadores por cuenta propia y de la comunidad\ncientfica (grupo 94.1), los intereses de los empleados (grupo 94.2) o la promocin de ideas y actividades religiosas,\npolticas, culturales, educativas o recreativas (grupo 94.9).\n',0,0),(957,'941','Actividades de organizaciones empresariales, profesionales y patronales',3,'94.1 Actividades de organizaciones empresariales, profesionales y patronales\nEste grupo comprende las actividades de las unidades que promueven los intereses de los miembros de\norganizaciones empresariales y patronales. En el caso de las organizaciones profesionales, comprende asimismo\nlas actividades de promocin de los intereses profesionales de los miembros de la profesin.\n',0,0),(958,'9411','Actividades de organizaciones empresariales y patronales',4,'94.11 Actividades de organizaciones empresariales y patronales\nEsta clase comprende:\n- las actividades de las organizaciones cuyos miembros se interesan principalmente por el desarrollo y la\nprosperidad de las empresas de un determinado sector empresarial o comercial, incluida la agricultura y ganadera,\no por la situacin y el crecimiento econmicos de una determinada zona geogrfica o subdivisin poltica,\nindependientemente del sector empresarial.\n- las actividades de las federaciones de dichas asociaciones.\n- las actividades de las cmaras de comercio, las corporaciones empresariales y organismos similares\n- la difusin de informacin, la representacin ante organismos pblicos, las relaciones pblicas y las negociaciones\nlaborales de asociaciones empresariales y patronales\n',0,0),(959,'9412','Actividades de organizaciones profesionales',4,'94.12 Actividades de organizaciones profesionales\nEsta clase comprende:\n- las actividades de organizaciones cuyos miembros se interesan principalmente en una disciplina cientfica, prctica\nprofesional o esfera tcnica concreta, como las asociaciones mdicas, jurdicas o contables, las asociaciones de\ningenieros o de arquitectos, etc.\n- las actividades de asociaciones de especialistas en el campo cientfico, acadmico o cultural, como asociaciones\nde escritores, pintores, artistas de diversos tipos, periodistas, etc.\n- la difusin de informacin, el establecimiento y la supervisin del cumplimiento de normas profesionales, la\nrepresentacin ante los organismos de la Administracin y las relaciones pblicas de las asociaciones profesionales\nEsta clase comprende tambin:\n- las actividades de las sociedades cientficas\n',0,0),(960,'942','Actividades sindicales',3,'94.2 Actividades sindicales\n',0,0),(961,'9420','Actividades sindicales',4,'94.20 Actividades sindicales\nEsta clase comprende:\n- la promocin de los intereses de los empleados integrados en organizaciones sindicales y laborales\nEsta clase comprende tambin:\n- las actividades de las asociaciones de trabajadores por cuenta ajena que se interesan principalmente por la\nrepresentacin de sus intereses en relacin a los salarios y la situacin laboral, y por la adopcin de medidas\nconcertadas a travs de su organizacin\n- las actividades de los sindicatos de empresa, de los sindicatos sectoriales y de las organizaciones sindicales\nagrupadas segn criterios regionales, organizativos o de otro tipo\n',0,0),(962,'949','Otras actividades asociativas',3,'94.9 Otras actividades asociativas\nEste grupo comprende las actividades de las unidades (excepto las organizaciones empresariales, patronales y\nprofesionales y los sindicatos) que promueven los intereses de sus miembros.\n',0,0),(963,'9491','Actividades de organizaciones religiosas',4,'94.91 Actividades de organizaciones religiosas\nEsta clase comprende:\n- las actividades de organizaciones religiosas y de personas que atienden directamente a los feligreses en iglesias,\nmezquitas, templos, sinagogas y otros lugares\n- las actividades de monasterios, conventos y organizaciones similares\n- las actividades de retiro religioso\nEsta clase comprende tambin:\n- las actividades de servicios fnebres religiosos\n',0,0),(964,'9492','Actividades de organizaciones polticas',4,'94.92 Actividades de organizaciones polticas\nEsta clase comprende:\n- las actividades de organizaciones polticas y de sus organizaciones auxiliares como, por ejemplo, las juveniles de\nlos partidos polticos. Estas organizaciones se dedican principalmente a influir en la toma de decisiones de los\norganismos de la administracin colocando a sus afiliados o simpatizantes en puestos polticos y conlleva la difusin\nde informacin, las relaciones pblicas, la recaudacin de fondos, etc.\n',0,0),(965,'9499','Otras actividades asociativas n.c.o.p.',4,'94.99 Otras actividades asociativas n.c.o.p.\nEsta clase comprende:\n- las organizaciones (no directamente ligadas a un partido poltico) que defienden una causa o alternativa de carcter\npblico mediante campaas de educacin del pblico, influencia poltica, recaudacin de fondos, etc.:\n los movimientos de protesta o las iniciativas cvicas\n los movimientos ecolgicos y de defensa del medio ambiente\n las organizaciones que prestan apoyo a servicios municipales y educativos n.c.o.p.\n las organizaciones que buscan la proteccin y mejora de la situacin de determinados grupos, por ejemplo, grupos\ntnicos o minoritarios\n las asociaciones con fines patriticos, incluidas las asociaciones de veteranos de guerra\n- las asociaciones de consumidores\n- las asociaciones de automovilistas\n- las asociaciones dedicadas a entablar relaciones sociales tales como los clubes rotarios, las logias, etc.\n- las asociaciones juveniles, las asociaciones, clubes y sindicatos de estudiantes, etc.\n- las asociaciones para la prctica de actividades o aficiones culturales o recreativas (excepto deportes o juegos)\ncomo, por ejemplo, los clubes literarios, de poesa y de biblifilos, de historia, de jardinera, de cine y fotografa, de\nmsica y arte, de artesana o de coleccionistas, los clubes sociales, comparsas de carnaval, etc.\nEsta clase comprende tambin:\n- las actividades de concesin de ayudas por asociaciones u otras entidades\n',0,0),(966,'95','Reparacin de ordenadores, efectos personales y artculos de uso domstico',2,'95 Reparacin de ordenadores, efectos personales y artculos de uso domstico\nEsta divisin comprende la reparacin y el mantenimiento de ordenadores y perifricos, como los ordenadores de\nsobremesa, ordenadores porttiles, terminales informticas, dispositivos de almacenamiento e impresoras.\nComprende asimismo la reparacin de equipos de comunicaciones como los aparatos de fax, los equipos de radio\nde transmisin-recepcin y la electrnica de consumo, como los aparatos de radio y los televisores, los artculos de\nuso domstico y de jardn, como cortadoras de csped y ventiladores, calzado y artculos de cuero, muebles y\nenseres domsticos, prendas y accesorios de vestir, artculos deportivos, instrumentos musicales, artculos para la\nprctica de diversas aficiones y otros efectos personales y domsticos.\nSe excluye de esta divisin la reparacin de equipos mdicos y de diagnstico por imagen, los instrumentos de\nmedicin y de geodesia, el instrumental de laboratorio y los equipos de radar y sonar (vase 33.13).\n',0,0),(967,'951','Reparacin de ordenadores y equipos de comunicacin',3,'95.1 Reparacin de ordenadores y equipos de comunicacin\nEste grupo comprende la reparacin y el mantenimiento de ordenadores y perifricos, as como de equipos de\ncomunicacin.\n',0,0),(968,'9511','Reparacin de ordenadores y equipos perifricos',4,'95.11 Reparacin de ordenadores y equipos perifricos\nEsta clase comprende la reparacin de equipos electrnicos, como ordenadores, equipos informticos y perifricos.\nEsta clase comprende la reparacin y el mantenimiento de:\n- ordenadores de sobremesa\n- ordenadores porttiles\n- unidades de disco magnticas, unidades de memoria flash y otros dispositivos de almacenamiento\n- unidades de disco pticas (p. ej., CD-RW, CD-ROM, DVD-ROM, DVD-RW)\n- impresoras\n- monitores\n- teclados\n- ratones, joysticks y accesorios trackball\n- mdems informticos internos y externos\n- terminales informticos especializados\n- servidores informticos\n- escneres, incluidos los lectores de cdigos de barras\n- lectores de tarjetas inteligentes\n- cascos de realidad virtual\n- proyectores informticos\nEsta clase comprende tambin la reparacin y el mantenimiento de:\n- terminales informticos, como los cajeros automticos (ATM), los terminales de punto de venta, no operados\nmecnicamente\n- ordenadores de mano (PDA)\n',0,0),(969,'9512','Reparacin de equipos de comunicacin',4,'95.12 Reparacin de equipos de comunicacin\nEsta clase comprende la reparacin y el mantenimiento de equipos de comunicacin como:\n- telfonos inalmbricos\n- telfonos mviles\n- mdems de equipo portador\n- aparatos de fax\n- equipos de transmisin para comunicaciones (p. ej., enrutadores (routers), puentes (bridges), mdems)\n- equipos de radio de transmisin-recepcin\n- cmaras de televisin y vdeo de uso profesional\n',0,0),(970,'952','Reparacin de efectos personales y artculos de uso domstico',3,'95.2 Reparacin de efectos personales y artculos de uso domstico\nEste grupo comprende la reparacin y el mantenimiento de efectos personales y artculos de uso domstico.\n',0,0),(971,'9521','Reparacin de aparatos electrnicos de audio y vdeo de uso domstico',4,'95.21 Reparacin de aparatos electrnicos de audio y vdeo de uso domstico\nEsta clase comprende la reparacin y el mantenimiento de productos de electrnica de consumo:\n- reparacin de productos de electrnica de consumo:\n receptores de radio y televisin\n magnetoscopios (VCR)\n reproductores de CD\n cmaras de vdeo de uso domstico\n',0,0),(972,'9522','Reparacin de aparatos electrodomsticos y de equipos para el hogar y el jardn',4,'95.22 Reparacin de aparatos electrodomsticos y de equipos para el hogar y el jardn\nEsta clase comprende la reparacin y el mantenimiento de aparatos domsticos y de equipos para el hogar y el\njardn:\n- reparacin y mantenimiento de aparatos domsticos\n frigorficos, hornos, lavadoras, secadoras, equipos de aire acondicionado, etc.\n- reparacin y mantenimiento de equipos para el hogar y el jardn\n mquinas cortacsped, aspiradores de nieve y hojas, podadoras para setos, etc.\n',0,0),(973,'9523','Reparacin de calzado y artculos de cuero',4,'95.23 Reparacin de calzado y artculos de cuero\nEsta clase comprende la reparacin y el mantenimiento de calzado y artculos de cuero:\n- reparacin de calzado, maletas y similares\n- arreglo de tacones\n',0,0),(974,'9524','Reparacin de muebles y artculos de menaje',4,'95.24 Reparacin de muebles y artculos de menaje\nEsta clase comprende:\n- el retapizado, la aplicacin de nuevos acabados, la reparacin y la restauracin de mobiliario y enseres\ndomsticos, incluido el mobiliario de oficina\n',0,0),(975,'9525','Reparacin de relojes y joyera',4,'95.25 Reparacin de relojes y joyera\nEsta clase comprende:\n- la reparacin de relojes y sus partes, como las cajas de todo tipo de materiales, mecanismos, cronmetros, etc.\n- la reparacin de artculos de joyera\n',0,0),(976,'9529','Reparacin de otros efectos personales y artculos de uso domstico',4,'95.29 Reparacin de otros efectos personales y artculos de uso domstico\nEsta clase comprende la reparacin de efectos personales y artculos de uso domstico:\n- la reparacin de bicicletas\n- la reparacin y arreglo de prendas de vestir\n- la reparacin de artculos deportivos (excepto armas deportivas) y de material de acampada\n- la reparacin de libros\n- la reparacin de instrumentos musicales (excepto rganos e instrumentos musicales histricos)\n- la reparacin de juguetes y artculos similares\n- la reparacin de otros efectos personales y enseres domsticos\n- la afinacin de pianos\n',0,0),(977,'96','Otros servicios personales',2,'96 Otros servicios personales\nEsta divisin comprende todas las actividades de servicios no mencionadas en otros apartados de la clasificacin.\nEn particular, comprende ciertos tipos de servicios como el lavado y la limpieza (en seco) de artculos textiles y de\npiel, la peluquera y otros tratamientos de belleza y las pompas fnebres y actividades relacionadas con las mismas.\n',0,0),(978,'960','Otros servicios personales',3,'96.0 Otros servicios personales\n',0,0),(979,'9601','Lavado y limpieza de prendas textiles y de piel',4,'96.01 Lavado y limpieza de prendas textiles y de piel\nEsta clase comprende:\n- las actividades de lavado, limpieza en seco, planchado, etc. de todo tipo de prendas de vestir (incluso prendas de\npiel) y otros artculos textiles, que se realizan a mquina, a mano o en mquinas accionadas con monedas para el\npblico en general o para clientes industriales o comerciales\n- la recogida y entrega de ropa para lavandera\n- el lavado de alfombras y tapices con espuma y la limpieza de cortinas, ya sea en las instalaciones del cliente o no;\n- la provisin de ropa blanca, uniformes de trabajo y similares realizada por lavanderas\n- los servicios de suministro de paales\n',0,0),(980,'9602','Peluquera y otros tratamientos de belleza',4,'96.02 Peluquera y otros tratamientos de belleza\nEsta clase comprende:\n- las actividades de lavado, corte, peinado, teido, aplicacin de mechas, ondulacin y alisado del cabello y otras\nactividades similares para hombres y mujeres\n- el afeitado y recorte de la barba\n- los masajes faciales, manicura, pedicura, maquillaje, etc.\n',0,0),(981,'9603','Pompas fnebres y actividades relacionadas',4,'96.03 Pompas fnebres y actividades relacionadas\nEsta clase comprende:\n- la sepultura e incineracin de cadveres humanos o de animales y otras actividades relacionadas con las mismas:\n la preparacin del cadver para su inhumacin o cremacin y los servicios de embalsamamiento\n la prestacin de servicios de inhumacin o cremacin\n el alquiler de locales destinados a velatorios\n- el alquiler o venta de tumbas\n- el mantenimiento de tumbas y mausoleos\n',0,0),(982,'9604','Actividades de mantenimiento fsico',4,'96.04 Actividades de mantenimiento fsico\nEsta clase comprende:\n- las actividades de baos turcos, saunas, baos de vapor, solariums, salones de adelgazamiento y masaje, etc.\n',0,0),(983,'9609','Otros servicios personales n.c.o.p.',4,'96.09 Otras servicios personales n.c.o.p.\nEsta clase comprende:\n- las actividades de astrologa y espiritismo\n- las actividades de contratacin de acompaantes, las actividades de las agencias de contactos y los servicios de\nlas agencias matrimoniales\n- los servicios para animales de compaa, como alojamiento, cepillado, cuidado y adiestramiento\n- las organizaciones de genealoga\n- las actividades de estudios de tatuaje y piercing\n- los limpiabotas, los maleteros, los aparcacoches, etc.\n- la explotacin por concesin de mquinas de servicios personales accionadas con monedas (fotomatones,\nbsculas, mquinas para medir la presin arterial, taquillas accionadas con monedas, etc.)\n',0,0),(984,'T','Actividades de los hogares como empleadores de personal domstico; actividades de los hogares como productores de bienes y servicios para uso propio',1,NULL,0,0),(985,'97','Actividades de los hogares como empleadores de personal domstico',2,'97 Actividades de los hogares como empleadores de personal domstico\n',0,0),(986,'970','Actividades de los hogares como empleadores de personal domstico',3,'97.0 Actividades de los hogares como empleadores de personal domstico\n',0,0),(987,'9700','Actividades de los hogares como empleadores de personal domstico',4,'97.00 Actividades de los hogares como empleadores de personal domstico\nEsta clase comprende las actividades de los hogares como empleadores de personal domstico, como doncellas,\ncocineros, camareros, ayudas de cmara, mayordomos, lavanderas, jardineros, porteros, mozos de cuadra,\nchferes, conserjes, gobernantas, nieras, preceptores, secretarios, etc.\nEsta categora permite al personal domstico empleado declarar la actividad de su empleador en los censos o\nestudios, aunque el empleador sea un particular. El producto obtenido mediante esta actividad es consumido por el\npropio hogar empleador.\n',0,0),(988,'98','Actividades de los hogares como productores de bienes y servicios para uso propio',2,'98 Actividades de los hogares como productores de bienes y servicios para uso propio\nEsta divisin comprende las actividades de los hogares como productores de bienes y servicios de subsistencia.\nUn hogar debe clasificarse aqu nicamente si resulta imposible identificar la actividad principal correspondiente a las\nactividades de subsistencia del hogar en cuestin. Si el hogar lleva a cabo actividades de mercado, debe clasificarse\ncon arreglo a la actividad principal de mercado que realice.\n',0,0),(989,'981','Actividades de los hogares como productores de bienes para uso propio',3,'98.1 Actividades de los hogares como productores de bienes para uso propio\n',0,0),(990,'9810','Actividades de los hogares como productores de bienes para uso propio',4,'98.10 Actividades de los hogares como productores de bienes para uso propio\nEsta clase comprende las actividades de los hogares como productores de bienes de subsistencia, es decir, las\nactividades de los hogares que producen bienes diversos para su propia subsistencia. Esas actividades incluyen la\ncaza y la recoleccin, la agricultura, la construccin de viviendas y la confeccin de prendas de vestir y otros bienes\nproducidos por un hogar para su propia subsistencia.\nSi los hogares tambin se dedican a la produccin de bienes para el mercado, se clasifican en la categora de la\nNACE correspondiente a dicha produccin. Si se dedican principalmente a la produccin de bienes de subsistencia\nespecficos, se clasifican en la categora de la NACE correspondiente a dicha produccin.\n',0,0),(991,'982','Actividades de los hogares como productores de servicios para uso propio',3,'98.2 Actividades de los hogares como productores de servicios para uso propio\n',0,0),(992,'9820','Actividades de los hogares como productores de servicios para uso propio',4,'98.20 Actividades de los hogares como productores de servicios para uso propio\nEsta clase comprende las actividades de los hogares como productores de servicios para su propia subsistencia.\nEstas actividades comprenden la cocina, la enseanza, el cuidado de los miembros del hogar y otros servicios que el\nhogar produce para su propia subsistencia.\nSi los hogares tambin se dedican a la produccin de diversos bienes con fines de subsistencia, se clasifican en las\nactividades de los hogares como productores de bienes para su propia subsistencia.\n',0,0),(993,'U','Organismos extraterritoriales',1,NULL,0,0),(994,'99','Actividades de organizaciones y organismos extraterritoriales',2,'99 Actividades de organizaciones y organismos extraterritoriales\n',0,0),(995,'990','Actividades de organizaciones y organismos extraterritoriales',3,'99.0 Actividades de organizaciones y organismos extraterritoriales\n',0,0),(996,'9900','Actividades de organizaciones y organismos extraterritoriales',4,NULL,0,0);
